INSERT INTO SIGNO VALUES 
(1, E'2022-000136', E'MP', E'grafica', E'3int', NULL, E'Cosm\u00E9ticos; cremas cosm\u00E9ticas; preparaciones cosm\u00E9ticas para el cuidado de la piel; hisopos de algod\u00F3n para uso cosm\u00E9tico; kits de cosm\u00E9ticos; mascarillas de belleza; parches de gel para los ojos con una finalidad cosm\u00E9tica; aceites para uso cosm\u00E9tico; lociones para uso cosm\u00E9tico; leche limpiadora para el tocador; preparaciones de tocador; lociones para despu\u00E9s del afeitado; preparaciones para el afeitado; preparaciones bronceadoras [cosm\u00E9ticos]; preparaciones de protecci\u00F3n solar; desodorantes para seres humanos o para animales; dent\u00EDfricos; jab\u00F3n; sales de ba\u00F1o que no sean para uso m\u00E9dico; preparaciones para el ba\u00F1o que no sean para uso m\u00E9dico; preparaciones cosm\u00E9ticas para ba\u00F1os; champ\u00FAs, acondicionadores para el cabello; lociones para el cabello; spray para el cabello; transfer decorativos para uso cosm\u00E9tico; tatuajes temporales para el cuerpo y las u\u00F1as con una finalidad cosm\u00E9tica; esmalte de u\u00F1as; recubrimiento de esmalte para el base coat (primer de u\u00F1as); recubrimiento de esmalte para el top coat (recubrimiento final); preparaciones para el cuidado de las u\u00F1as; quitaesmaltes de u\u00F1as; pegatinas para u\u00F1as; u\u00F1as falsas; preparaciones de maquillaje; l\u00E1pices cosm\u00E9ticos; base de maquillaje; aerosoles fijadores de maquillaje; polvo de maquillaje; productos de maquillaje dedicados al embellecimiento del cutis; bases de maquillaje; correctores [cosm\u00E9ticos]; rubor; b\u00E1lsamos que no sean para uso m\u00E9dico; productos para el cuidado de los labios; b\u00E1lsamos labiales; delineadores de labios; brillos de labios; l\u00E1pices de labios; estuches para l\u00E1pices de labios; sombra para parpados; delineador de ojos; l\u00E1pices de ojos; l\u00E1pices de p\u00E1rpados; l\u00E1pices de mejillas; preparaciones cosm\u00E9ticas para pesta\u00F1as; m\u00E1scara; pesta\u00F1as postizas; cosm\u00E9ticos para cejas; kits de cejas; l\u00E1pices de cejas; m\u00E1scaras de cejas; compactos de polvo, rellenos; cartuchos y recambios para productos cosm\u00E9ticos y productos de maquillaje; preparaciones desmaquillantes; agua micelar; pa\u00F1uelos impregnados con preparaciones desmaquillantes; algod\u00F3n impregnado con preparaciones desmaquillantes; desmaquilladores de ojos; limpiadores para brochas cosm\u00E9ticas; perfumer\u00EDa; perfumes; agua de colonia; agua de tocador; difusores de leng\u00FCeta de fragancia de aire; preparaciones aromatizantes del aire; incienso; bolsitas (saches) para perfumar la ropa; lustra zapatos; conservantes del cuero [abrillantadores]; cremas para cuero. (Productos nacionales y/o extranjeros).', E'La etiqueta que se presenta a continuaci\u00F3n consiste en la representaci\u00F3n gr\u00E1fica de un c\u00EDrculo de fondo color negro en cuyo interior se encuentra una flor con cuatro p\u00E9talos redondos en color blanco y en el centro un c\u00EDrculo de color negro. El fondo de la etiqueta es de color blanco. Se reivindica el conjunto descrito.'),
(2, E'2022-000161', E'MP', E'mixta', E'31int', E'H HANNA', E'PRODUCTOS AGR\u00CDCOLAS, ACUICOLAS, HORT\u00CDCOLAS Y FORESTALES EN BRUTO Y SIN PROCESAR; GRANOS Y SEMILLAS EN BRUTO O SIN PROCESAR, FRUTAS Y VERDURAS, HORT\u00CDCOLAS Y LEGUMBRES FRESCAS, HIERBAS AROM\u00C1TICAS FRESCAS, PLANTAS Y FLORES NATURALES.', E'CONSISTE EN UNA ETIQUETA DONDE EN SU PARTE SUPERIOR SE OBSERVA UNA FIGURA CIRCULAR DE COLOR VERDE Y BORDE BLANCO Y VERDE,DENTRO SE APRECIA UNA LETRA H DE MANERA ESTILIZADA Y DE COLOR BLANCO, ALREDEDOR DE LA FIGURA CIRCULAR SE VEN UNAS ESPIGAS DE COLOR DORADO; DEBAJO DE TODO ESTO SE APRECIA LA PALABRA HANNA ESCRITA EN COLOR VERDE Y LETRAS ESTILIZADAS, SE REIVINDICA EL CONJUNTO DE T\u00C9RMINOS Y COLORES DESCRITOS'),
(3, E'2022-000292', E'MP', E'mixta', E'2int', E'SINOCHEM', E'TINTA DE IMPRESI\u00D3N; MASILLA [RESINA NATURAL]; MORDIENTES; TINTES; PINTURAS DE RESINA SINT\u00C9TICA; PINTURAS; REVESTIMIENTOS [PINTURAS]; COLORANTES; PREPARACIONES PROTECTORAS PARA METALES; PINTURAS IMPERMEABLES; PREPARACIONES ANTICORROSIVAS; PIGMENTOS; COLORANTES ALIMENTARIOS; TINTES ALIMENTARIOS.', E'CONSISTE EN UNA ETIQUETA RECTANGULAR DE FONDO BLANCO EN LA QUE SE OBSERVAN LOS SIGUIENTES ELEMENTOS: EN EL CENTRO DEL LADO IZQUIERDO DEL CONJUNTO SE OBSERVA UNA FIGURA IRREGULAR QUE SE ASEMEJA A UNA FLOR DE CUATRO P\u00C9TALOS DE COLOR AZUL OSCURO Y BORDES BLANCOS, LOS BORDES CONFORMAN A SU VEZ TRES FIGURAS OVALADAS DENTRO DE LOS P\u00C9TALOS, QUE SON DE COLOR AZUL CLARO. DEL LADO DERECHO DEL CONJUNTO SE OBSERVAN DOS CARACTERES CHINOS (SINOGRAMAS) EN COLOR GRIS, LOS CUALES SIGNIFICAN ZHONG HUA, Y TRADUCIDOS AL CASTELLANO SIGNIFICAN ZHONG = MEDIO, HUA = CAMBIO. DEBAJO Y DE MENOR TAMA\u00D1O SE LEE LA PALABRA DE FANTAS\u00CDA SINOCHEM ESCRITA EN LETRA MOLDE, CARACTER\u00CDSTICA, MIN\u00DASCULAS, DE TRAZO GRUESO Y DE COLOR GRIS. LA PALABRA SINOCHEM FORMA PARTE DE LA DENOMINACI\u00D3N COMERCIAL DE MI MANDANTE. SE REIVINDICA EL CONJUNTO DESCRITO.'),
(4, E'2022-000347', E'MS', E'denominativa', E'35int', E'BROWNIE', E'SERVICIOS DE VENTA AL POR MAYOR Y AL POR MENOR EN COMERCIOS Y A TRAV\u00C9S DE REDES MUNDIALES DE INFORM\u00C1TICA DE PRENDAS DE VESTIR, CALZADO, ART\u00CDCULOS DE SOMBRERER\u00CDA, BISUTER\u00CDA, JOYER\u00CDA, ART\u00CDCULOS DE MARROQUINER\u00CDA, BOLSOS, BOLSAS, NECESERES, TOALLAS, ART\u00CDCULOS DE PERFUMER\u00CDA Y COSM\u00C9TICA, ART\u00CDCULOS PARA LA PLAYA, GAFAS, FUNDAS, CARCASAS, ART\u00CDCULOS PARA EL HOGAR, BOTELLAS, ROPA DE DEPORTE, RELOJES, JOYEROS, M\u00C1SCARAS, PARAGUAS Y COMPLEMENTOS PARA EL CABELLO; SERVICIOS DE PROMOCI\u00D3N PRESTADOS POR UNA EMPRESA COMERCIAL A TRAV\u00C9S DE UNA TARJETA DE FIDELIZACI\u00D3N DE CLIENTES; SERVICIOS DE AYUDA A LA EXPLOTACI\u00D3N DE UNA EMPRESA COMERCIAL EN R\u00C9GIMEN DE FRANQUICIA; DEMOSTRACI\u00D3N DE PRODUCTOS; PROMOCI\u00D3N DE VENTAS (PARA TERCEROS); SERVICIOS DE ABASTECIMIENTO PARA TERCEROS (COMPRA DE PRODUCTOS Y SERVICIOS PARA OTRAS EMPRESAS).', NULL),
(5, E'2022-000454', E'MP', E'mixta', E'25int', E'INDUSTRIAS JHOSDAM', E'ARTICULOS DE VESTIR, CALZADOS, SOMBRERER\u00CDA.', E'EST\u00C1 CONFORMADA POR UNA FIGURA DE ELEMENTOS TRIANGULARES QUE SE ENTRELAZAN. EL COLOR DE LAS LINEAS ES EN NEGRO, Y BLANCO EL FONDO. DEBAJO DE LA FIGURA SE LEE LA PALABRA "INDUSTRIAS JHOSDAM". EL TERMINO "JHOSDAM" ES UNA CREACION DE FANTAS\u00CDA, NO TIENE TRADUCCI\u00D2N.'),
(6, E'2022-000481', E'MS', E'denominativa', E'35int', E'JNTL CONSUMER HEALTH', E'PUBLICIDAD; GESTI\u00D3N, ORGANIZACI\u00D3N Y ADMINISTRACI\u00D3N DE NEGOCIOS COMERCIALES, INCLUYENDO SERVICIOS DE PROVISI\u00D3N (SUMINISTRO) DE INFORMACI\u00D3N SOBRE PRODUCTOS DE CONSUMO RELACIONADOS CON EL CUIDADO DE LA PIEL Y EL CABELLO, CUIDADO DEL SOL (PROTECTORES SOLARES), BIENESTAR, CUIDADO DE LA SALUD Y VIDA SALUDABLE, APTITUD F\u00CDSICA, NUTRICI\u00D3N, BIENESTAR Y ESTILO DE VIDA SALUDABLE; SERVICIOS DE VENTAS MINORISTA (AL DETAL) EN L\u00CDNEA (ONLINE) DE PRODUCTOS PARA EL CUIDADO DE LA PIEL Y EL CABELLO, CUIDADO DEL SOL (PROTECTORES SOLARES), PRODUCTOS DENTALES, PREPARACIONES FARMAC\u00C9UTICAS PARA EL TRATAMIENTO DE LA TOS, RESFRIADOS, ALERGIAS Y PRODUCTOS NUTRICIONALES.', NULL),
(7, E'2022-000488', E'MS', E'grafica', E'36int', NULL, E'Servicios de operaciones financieras; operaciones monetarias; servicios de intercambio de criptomonedas; servicios de comercio (trading) de criptomonedas; servicios de intercambio financiero; servicios de intercambio de bienes futuros (bolsas a futuro); prestaci\u00F3n de servicios de intercambio (trading) financiero para el comercio de monedas virtuales; servicios de comercializaci\u00F3n (trading) de divisas en l\u00EDnea en tiempo real; servicios de provisi\u00F3n (suministro) de una plataforma de comercio (trading) electr\u00F3nico; servicios que proporcionan una plataforma de comercio (trading) electr\u00F3nico para la compra y venta de monedas digitales a cambio de monedas fiduciarias u otras monedas digitales; servicios de suministro de informaci\u00F3n financiera; servicios de suministro de informaci\u00F3n financiera sobre tipos de cambio; servicios de gesti\u00F3n financiera; servicios de gesti\u00F3n financiera de activos digitales y carteras (portafolios) de activos digitales; servicios financieros; servicios de transacciones financieras; servicios de comercio (trading) financiero; servicios de c\u00E1maras de compensaci\u00F3n financiera; servicios de procesamiento de pagos; servicios de procesamiento de pagos electr\u00F3nicos o pagos en l\u00EDnea; servicios de pagos electr\u00F3nicos; servicios de procesamiento de pagos con tarjetas de cargo; servicios de procesamiento de pagos con tarjetas de cr\u00E9dito; servicios de procesamiento de pagos con tarjetas de d\u00E9bito; servicios de procesamiento de pagos con tarjeta de prepago; servicios de corretaje; servicios de investigaci\u00F3n financiera; servicios de custodia financiera', E'La marca gr\u00E1fica cuyo registro se solicita consiste en un rect\u00E1ngulo de color blanco dentro del cual se observan dos rect\u00E1ngulos horizontales y paralelos de longitudes variables por encima de un cuadrado y a la derecha de otro cuadrado, todas estas figuras geom\u00E9tricas se reproducen en color negro.'),
(8, E'2022-000503', E'MP', E'denominativa', E'16int', E'OH MY DOG', E'PAPEL, CARTON Y ARTICULOS DE ESTAS MATERIAS, NO COMPRENDIDOS EN OTRAS CLASES, PRODUCTOS DE IMPRENTA, ARTICULOS DE ENCUADERNACION, FOTOGRAFIA, PAPELERIA, ADHESIVOS PARA LA PAPELERIA.', NULL),
(9, E'2022-000581', E'MP', E'mixta', E'30int', E'LAS IDEALES', E'PRODUCTOS PARA SAZONAR, ESPECIAS, SALSAS, MAYONESAS, SALSA DE TOMATE, SALSA DE QUESO, SALSAS CONDIMENTOS.', E'CONSISTE EN LA REPRESENTACION GRAFICA DE LA PALABRA \"LAS IDEALES\" (PALABRA DE FANTASIA). ESCRITA AL INICIO EN MAYUSCULA SEGUIDA DE LETRAS MINUSCULAS DE FORMA CURSIVA, EN COLOR AMARILLO. SE CARACTERIZA EL TERMINO \"LAS\" POR ESTAS EN LA PARTE SUPERIOR Y SER DE MENOR TAMA\u00D1O QUE LA ANTERIOR. DICHA DESCRIPCION SE ENCUENTRA EN UN OVALO DE COLOR AZUL OSCURO, BORDEADO EN COLOR ROJO. \"SE REIVINDICA LOS COLORES Y EL CONJUNTO DESCRITO\"'),
(10, E'2022-000785', E'MP', E'mixta', E'11int', E'RDA', E'APARATOS ELECTRICO Y OTROS.', E'FONDO NEGRO Y LETRAS BALNCAS EN MAYUSCULA'),
(11, E'2022-000786', E'MP', E'mixta', E'18int', E'AIR WILLSON W1', E'ARTICULOS DE CUEROS, BOLSOS Y OTROS', E'FONDO NEGRO CON LETRAS MAYUSCULAS BLANCAS Y GRISES'),
(12, E'2022-000980', E'NC', E'denominativa', E'46int', E'GLAFF PHARMACEUTICALS', E'EMPRESA DEDICADA A LA VENTA, FABRICACI\u00D3N, DISTRIBUCI\u00D3N, COMERCIALIZACI\u00D3N AL MAYOR Y DETAL DE TODO TIPO DE EQUIPOS M\u00C9DICOS, MEDICINAS PARA EL USO HUMANO Y ANIMAL EN TODAS SUS FORMAS Y PRESENTACIONES, PRODUCTOS SANITARIOS, PRODUCTOS FARMAC\u00C9UTICOS Y MATERIAL M\u00C9DICO DESCARTABLE.', NULL),
(13, E'2022-001014', E'NC', E'mixta', E'46int', E'CL\u00CDNICAS CLEO', E'NOMBRE COMERCIAL', E'EL DISE\u00D1O SOLICITADO CONSISTE EN UNA ETIQUETA RECTANGULAR SOBRE FONDO BLANCO, DONDE SE LEE EN LA PARTE SUPERIOR LA PALABRA \u201CCL\u00CDNICAS\u201D EN LETRAS MAYUSCULAS DE TRAZO FINO Y DE COLOR DORADO, DEBAJO DE ESTA SE ENCUENTRA LA PALABRA \u201CCLEO\u201D LA CUAL SE ENCUENTRA EN LETRAS MAY\u00DASCULAS DE TRAZO FINO Y DE COLOR DORADO. DE LA VOCAL \u201CE\u201D DE LA PALABRA CLEO, SE DESPRENDE LA SILUETA DELICADA DE LA NARIZ Y BOCA DE UNA MUJER, LO CUAL EN SU CONJUNTO CON LAS PALABRAS ANTES DESCRITAS, SIMULAN EL ROSTRO FEMENINO DE COLOR DORADO Y DE TRAZOS FINOS. SE REIVINDICA EL DISE\u00D1O SOLICITADO CON LOS COLORES DESCRITOS M\u00C1S NO LOS T\u00C9RMINOS GEN\u00C9RICOS.'),
(14, E'2022-001219', E'MS', E'denominativa', E'45int', E'TIKTOK MUSIC', E'SERVICIOS DE REDES SOCIALES EN L\u00CDNEA.', NULL),
(15, E'2022-001372', E'MP', E'mixta', E'25int', E'A TE ENAMORA', E'PRENDAS DE VESTIR, CALZADO, ART\u00CDCULOS DE SOMBRERER\u00CDA.', E'CONSISTE EN UNA ETIQUETA CONFORMADA POR LA LETRA "A" CON TRAZOS GRUESOS DE COLOR AZUL MARINO Y EN DONDE SE DESTACAN EN SU SUPERFICIE UNA FIGURAS EN FORMA DE CORAZONES DE COLOR VERDE, AZUL CLARO, AMARILLO, VERDE Y ANARANJADO. EN EL LADO DERECHO SE MUESTRA UN CORAZ\u00D3N CON MAYOR PROPORCI\u00D3N A LOS DEM\u00C1S DE COLOR AZUL CLARO. EN LA PARTE INFERIOR LA MARCA TE ENAMORA TAMBI\u00C9N DE COLOR AZUL OSCURO EN LETRA DE MOLDE CON TRAZOS DELGADOS. SE REVINDICAN LOS COLORES, FORMAS Y DISE\u00D1OS.'),
(16, E'2022-001438', E'MP', E'mixta', E'30int', E'TATO', E'Caf\u00E9, t\u00E9, cacao y sus suced\u00E1neos; arroz, pastas alimenticias y fideos; tapioca y sag\u00FA; harinas y preparaciones a base de cereales; alimentos a base de avena; f\u00E9cula para uso alimenticio; barras de cereales; barritas de cereales ricas en prote\u00EDnas; barritas de regaliz; biscotes; chocolate; productos de confiter\u00EDa a base de almendras; productos de confiter\u00EDa a base de man\u00ED; copos de cereales secos; hojuelas de cereales; hojuelas de avena; panqueques; galletas; germen de trigo para la alimentaci\u00F3n humana; gofres; harinas; levadura; muesli; pastas para untar a base de chocolate; pastas para untar a base chocolate con frutos secos; pralin\u00E9s; refrigerios a base de arroz; refrigerios a base de cereales; s\u00E9mola; tortillas de harina; pan, productos de pasteler\u00EDa y confiter\u00EDa; chocolate; helados cremosos, sorbetes y otros helados; az\u00FAcar, miel, jarabe de melaza; levadura, polvos de hornear; sal, productos para sazonar, especias, hierbas en conserva; vinagre, salsas y otros condimentos; hielo.', E'La marca mixta cuyo registro se solicita est\u00E1 conformada por una etiqueta rectangular de color blanco dentro de la cual se observa la caricatura del personaje TATO (t\u00E9rmino de fantas\u00EDa y nombre propio) representado por la figura fantasiosa de un Mono humanizado, vestido con un traje tipo safari, que cuelga con su mano derecha de una liana de color verde claro (Pantone 376 C) y con su mano izquierda sostiene unos binoculares de color negro a la altura de su cara. TATO presenta una expresi\u00F3n facial alegre, con la boca abierta, con expresi\u00F3n sonriente, dejando ver su lengua de color rojo. El personaje tiene el cabello de color rojo (Pantone 199C), sus orejas son prominentes, lleva puesto un sombrero t\u00EDpico de safari de color marr\u00F3n claro (Pantone 134 C). El pelaje del cuerpo del mono es de color amarillo (Pantone 137 C), aunque el color de sus manos y rostro es de color marr\u00F3n (Pantone 162 C). El personaje viste ropa t\u00EDpica de safari, camisa de botones de color marr\u00F3n claro (Pantone 134 C), en la parte inferior de la camisa a la altura de la cintura se pueden apreciar dos bolsillos que se cierran con una solapa superior y un bot\u00F3n de color marr\u00F3n, en la parte superior de los bolsillos antes descritos se puede apreciar un cintur\u00F3n o correa de color verde claro (Pantone 376 C), debajo de la camisa tipo safari se deja ver una franela de color verde claro (Pantone 376 C), que termina a la altura de los codos del mono. TATO viste unos pantalones cortos o shorts, con la particularidad que tienen un dobladillo en la parte inferior, los pantalones se presentan igualmente de color marr\u00F3n claro (Pantone 134 C) y calza unos zapatos deportivos de color marr\u00F3n claro (Pantone 134C) y marr\u00F3n oscuro, las trenzas del calzado son de color amarillo y la suela de color negro que acompa\u00F1a con unas medias blancas. Se reivindica el conjunto descrito y los colores se\u00F1alados conforme a los facs\u00EDmiles que se acompa\u00F1an.'),
(17, E'2022-001447', E'MP', E'mixta', E'11int', E'MURASAKI', E'APARATOS E INSTALACIONES DE ALUMBRADO, CALEFACCI\u00D3N, ENFRIAMIENTO, PRODUCCI\u00D3N DE VAPOR, COCCI\u00D3N, SECADO, VENTILACI\u00D3N Y DISTRIBUCI\u00D3N DE AGUA, AS\u00CD COMO INSTALACIONES SANITARIAS. VAPORIZADORES EL\u00C9CTRICOS DE ALIMENTOS, CALENTADORES DE BA\u00D1O DE MARIA EL\u00C9CTRICOS, FREIDORAS EL\u00C9CTRICAS, HORNOS DE MICROONDAS, COCINAS DE AIRE CALIENTE, OLLAS ARROCERAS, UNIDADES DE CALENTAMIENTO DE ALIMENTOS ELECTRICAS, CALENTADORAS DE ALIMENTOS, FREIDORAS ELECTRICAS, DESHIDRATADORES DE ALIMENTOS, ASADORAS ELECTRICAS COCINAS AL AIRE LIBRE, TOSTADORAS, HORNOS TOSTADORES, MAQUINAS ELECTRICAS PARA HACER BEBIDAS CALIENTES, MAQUINAS ELECTRICAS PARA ESPUMAR LA LECHE, MAQUINAS DE CAFE EXPRESO, DE CAPUCHINO, FABRICANTES ELECTRICO DE BOTELLAS DE AGUA, YOGURTERAS ELECTRICAS, COCINAS PARA PASTAS, APARATOS PARA COCINAR CREPES, COCINA DE HUEVO, FABRICADORES DE PAN, SANDWICHERAS, MAQUINAS PARA HACER PIZZA, GAINETES PARA CALENTAR COMIDA, APARATOS PARA SECAR EL PELO, ELECTRODOMESTICOS TALES COMO COCINAS ELECTRICAS, HORNOS Y ENCIMERAS ELECTRICAS, BODEGAS CON TEMPERATURA CONTROLADA PARA VINOS, HORNOS ELECTRICOS AL VACIO CON TEMPERATURA CONTROLADA Y BA\u00D1O DE AGUA INCORPORADO, GABINETES Y MAQUINAS DE SECADO PARA ROPA, SECADOR DE ROPA Y REMOVEDOR DE OLORES Y ARRUGAS, CENTRIFUGADORA O SECADORA, VAPORIZADOR DE TELAS Y ROPA, CALENTADORES DE AGUA ELECTRICOS, BOMBILLAS, APARATOS DE ALUMBRADO, INSTALACIONES DE ALUMBRADO, BOMBILLAS DE EMISION DE LUZ DIODO APARATOS DE ILUMINACION Y EMISION DE LUZ DIODO INSTALACIONES DE LUZ DIODO, EMISORES DE LUZ DIODO, APARATOS DE ALUMBRADO Y SUS PARTES Y PIEZAS PARA TODOS LOS PRODUCTOS ANTES MENCIONADOS NO INCLUIDOS EN OTRAS CLASES.', E'CONSISTE FUNDAMENTALMENTE EN UNA ETIQUETA EN LA CUAL SE LEE LA PALABRA MURASAKI (QUE SE TRADUCE PURPURA) ESCRITA CON GRAF\u00CDA CARACTERISTICA Y ESTILIZADA, EN COLOR NEGRO Y DE TRAZO GRUESO. SE REIVINDICA EL CONJUNTO DESCRITO.'),
(18, E'2022-001457', E'MP', E'mixta', E'31int', E'FRANCHETTI', E'PRODUCTOS AGR\u00CDCOLAS, ACU\u00CDCOLAS, HORT\u00CDCOLAS Y FORESTALES EN BRUTO Y SIN PROCESAR; GRANOS Y SEMILLAS EN BRUTO O SIN PROCESAR; FRUTAS Y VERDURAS, HORTALIZAS Y LEGUMBRES FRESCAS, HIERBAS AROM\u00C1TICAS FRESCAS; PLANTAS Y FLORES NATURALES; BULBOS, PLANTONES Y SEMILLAS PARA PLANTAR; ANIMALES VIVOS; PRODUCTOS ALIMENTICIOS Y BEBIDAS PARA ANIMALES; MALTA.', E'EL DISE\u00D1O SOLICITADO ESTA SOBRE UN FONDO BLANCO DONDE SE OBSERVA EN PRIMER PLANO UNA FIGURA GEOM\u00C9TRICA RECTANGULAR DE MANERA VERTICAL DE TRAZO FINO DE COLOR NEGRO Y EN EL CENTRO DE LA FIGURA SE PALABRA FRANCHETTI (PARTE DEL APELLIDO DE ASCENDENTES DE PRIMERA GENERACI\u00D3N, PERO TAMBI\u00C9N SIGNIFICA SEG\u00DAN GOOGLE FRANQUICIAS), ESCRITA EN MAY\u00DASCULA, EN LETRA DE MOLDE, DE TRAZO FINO Y DE COLOR NEGRO, DICHA PALABRA ESA SUPERPUESTA Y ATRAVESANDO LA FIGURA. EN LA PARTE SUPERIOR DE LA PALABRA SE OBSERVA UNA ESPIGA DE COLOR DORADO CON DOS TONALIDADES UNA CLARA Y OTRA OSCURA QUE SE ABRE PASO HACIA ARRIBA ABRIENDO EN EL MEDIO DE LA FIGURA GEOM\u00C9TRICA UN ABERTURA. Y EN LA PARTE INFERIOR Y EN SU CENTRO DE LA FIGURA GEOM\u00C9TRICA SE ABRE UN DE IGUAL FORMA UN ABERTURA. SE REIVINDICA EL DISE\u00D1O SOLICITADO EN SU CONJUNTO CON LOS COLORES DESCRITO.'),
(19, E'2022-001498', E'MP', E'denominativa', E'5int', E'OLANZATIQUE', E'PRODUCTOS FARMAC\u00C9UTICOS PARA TRATAR ENFERMEDADES DEL SISTEMA NERVIOSO CENTRAL', NULL),
(20, E'2022-001503', E'MP', E'mixta', E'32int', E'BUZA CREAM', E'CERVEZAS, AGUAS MINERALES Y GASEOSAS Y OTRAS BEBIDAS NO ALCOH\u00D3LICAS, BEBIDAS Y ZUMOS DE FRUTAS, SIROPES OTRAS PREPARACIONES DE HACER BEBIDAS', E'SE OBSERVA UN CONO (ANARANJADO) DIVIDIDO POR UNA SERIE DE LINEAS TRANSVERSALES, EL HELADO DE COLOR BLANCO, CON PUNTOS DE COLORES VARIOS (ROJO VERDE, ANARANJADO, AZUL, MORADO) CON UNA CARICATURA DE ROSTRO SONRIENTE DELINEADO DE COLOR NEGRO CON SU LENGUA DE COLOR ROJO, TODO LO ANTES DESCRITO SE ENCUENTRA DENTRO DE UN CIRCULO DE FONDO COLOR AZUL OSCURO CON UNA SOBRE LINEA DE COLOR AZUL CLARO , EN LA PARTE CENTRAL OBSERVAMOS LA PALABRA "BUZA CREAM" (TRADUCCI\u00D3N. BUZA: PALABRA DE FANTAS\u00CDA CREAM: CREMA) DE COLOR FUCSIA EN LETRAS ESTILO CURSIVA SIENDO LA LETRAS INICIALES B Y C EN MAY\u00DASCULA Y DE MAYOR TAMA\u00D1O'),
(21, E'2022-001517', E'MP', E'mixta', E'9int', E'TOP IGNITION', E'PARA DISTINGUIR PARTES EL\u00C9CTRICAS, BOBINA DE ENCENDIDO, BUJ\u00CDAS Y CABLES DE BUJ\u00CDAS, TERMOSTATO, ROTOR, TAPAS DE DISTRIBUIDOR.', E'EL DISE\u00D1O SE DESCRIBE DE LA FORMA SIGUIENTE: EN PRIMERA INSTANCIA SE APRECIA UNA FIGURA ABSTRACTA, LA CUAL PARECE COMO LA FORMA DE UNA FLAMA O LLAMA DE FUEGO ENCENDIDO; EN LA CUAL SE OBSERVA COMO DOS LENG\u00DCETAS ONDULANTES CON DIRECCI\u00D3N HACIA ARRIBA. ESTA FIGURA O LLAMA ENCENDIDA VA ENCERRADA EN UN C\u00CDRCULO, EL CUAL, \u00C9STE NO SE CIERRA COMPLETAMENTE, PUES HAY UNA ABERTURA EN LA PARTE SUPERIOR EN DONDE SOBRE SALE LA PUNTA DE LA FLAMA DE LA LENG\u00DCETA IZQUIERDA, QUE ES M\u00C1S ALTA QUE LA DERECHA. TODO EL DIBUJO DESCRITO EST\u00C1 FORMADO POR TRAZOS MEDIANOS DE COLOR AMARILLO MOSTAZA O ANARANJADO OSCURO. DEBAJO DE ESTA FIGURA ABSTRACTA, SE PRESENTA ESCRITO EL SIGNO SOLICITADO "TOP IGNITION", T\u00C9RMINOS DEL IDIOMA INGL\u00C9S, QUE AMBOS TIENEN DIVERSAS ACEPCIONES. POR EJEMPLO "TOP", COMO ADJETIVO, PUEDE SIGNIFICAR SUPERIOR, M\u00C1XIMO, TAMBI\u00C9N M\u00C1S ALTO, Y COMO SUSTANTIVO PODR\u00CDA SER LA CIMA, LA TAPA, EL TOPE, LA CUMBRE, LA PARTE SUPERIOR, E INCLUSIVE COMO VERBO SE TRADUCE EN REMATAR. POR OTRO LADO, "IGNITION", ES UN SUSTANTIVO QUE TRADUCIDO AL ESPA\u00D1OL SIGNIFICA IGNICI\u00D3N, EL CUAL PUEDE SIGNIFICAR: ENCENDIDO. AHORA BIEN, EL SIGNO "TOP IGNITION" EST\u00C1 ESCRITO CON LETRAS DE TIPO IMPRENTA ART\u00CDSTICA MUY PARTICULAR. SE PRESENTAN TODAS ESCRITAS EN MAY\u00DASCULAS. EST\u00C1N FORMADAS POR UN TRAZO MEDIANO DEL MISMO COLOR DE LA FIGURA ABSTRACTA ANTES DESCRITA, ES DECIR, CON UN COLOR AMARILLO MOSTAZA O ANARANJADO OSCURO. TODO EL DISE\u00D1O EST\u00C1 CONTENIDO EN UN FONDO DE COLOR BLANCO. SE REIVINDICA TODO SU CONTENIDO.'),
(22, E'2022-001545', E'MS', E'denominativa', E'35int', E'BIONTECH', E'SUMINISTRO DE SERVICIOS DE INFORMACI\u00D3N Y ASESORAMIENTO RELACIONADOS CON EL COMERCIO ELECTR\u00D3NICO; SUMINISTRO DE INFORMACI\u00D3N AL CLIENTE SOBRE PRODUCTOS FARMAC\u00C9UTICOS Y M\u00C9DICOS A TRAV\u00C9S DE UNA RED INFORM\u00C1TICA EN L\u00CDNEA; SERVICIOS DE VENTA MINORISTA O MAYORISTA DE PRODUCTOS FARMAC\u00C9UTICOS; SERVICIOS DE VENTA MINORISTA O MAYORISTA DE PREPARACIONES MEDICINALES; SERVICIOS DE VENTA MINORISTA O MAYORISTA DE SUMINISTROS M\u00C9DICOS.', NULL),
(23, E'2022-001546', E'MS', E'denominativa', E'42int', E'BIONTECH', E'INVESTIGACI\u00D3N CIENT\u00CDFICA CON FINES M\u00C9DICOS; INVESTIGACI\u00D3N M\u00C9DICA Y CIENT\u00CDFICA EN EL CAMPO DEL TRATAMIENTO DE ENFERMEDADES INMUNOL\u00D3GICAS, TRATAMIENTO DEL C\u00C1NCER Y TRATAMIENTO DE ENFERMEDADES INFECCIOSAS; SUMINISTRO DE SERVICIOS DE INFORMACI\u00D3N, CONSULTOR\u00CDA Y ASESORAMIENTO EN INVESTIGACIONES M\u00C9DICAS Y CIENT\u00CDFICAS, TODO EN LOS CAMPOS DEL TRATAMIENTO DE ENFERMEDADES INMUNOL\u00D3GICAS, TRATAMIENTO DEL C\u00C1NCER Y TRATAMIENTO DE ENFERMEDADES INFECCIOSAS; RECOPILACI\u00D3N DE DATOS PARA INVESTIGACI\u00D3N M\u00C9DICA Y CIENT\u00CDFICA, ENSAYOS CL\u00CDNICOS Y ADMISI\u00D3N DE MEDICAMENTOS.', NULL),
(24, E'2022-001584', E'MP', E'grafica', E'30int', NULL, E'CAF\u00C9, T\u00C9, CACAO Y SUS SUCED\u00C1NEOS; ARROZ, PASTAS ALIMENTICIAS Y FIDEOS; TAPIOCA Y SAG\u00DA; HARINAS Y PREPARACIONES A BASE DE CEREALES; PAN, PRODUCTOS DE PASTELER\u00CDA Y CONFITER\u00CDA; CHOCOLATE; HELADOS CREMOSOS, SORBETES Y OTROS HELADOS; AZ\u00DACAR, MIEL, JARABE DE MELAZA; LEVADURA, POLVOS DE HORNEAR; SAL, PRODUCTOS PARA SAZONAR, ESPECIAS, HIERBAS EN CONSERVA; VINAGRE, SALSAS Y OTROS CONDIMENTOS; HIELO.', E'Consiste en una etiqueta en la cual se observa un c\u00EDrculo de trazo grueso en color negro de fondo blanco y en su interior se observan tres figuras similares a unas horquillas en color negro, de trazo grueso con una terminaci\u00F3n en punta similar a una flecha y las tres se encuentran superpuestas entre s\u00ED. La primera figura se encuentra orientada verticalmente con la punta en direcci\u00F3n al norte, mientras que las otras dos figuras se encuentran colocadas en forma perpendicular o inclinada estando la segunda figura orientada con la punta hacia el sureste y la tercera hacia el suroeste formando en el medio la figura de un hex\u00E1gono de trazo grueso en color blanco. Se reivindica los colores y conjuntos descritos.'),
(25, E'2022-001643', E'MP', E'mixta', E'2int', E'SOLINTEX', E'PINTURAS, BARNICES, LACAS; PRODUCTOS CONTRA LA HERRUMBRE Y EL DETERIORO DE LA MADERA; COLORANTES, TINTES; TINTAS DE IMPRENTA, TINTAS DE MARCADO Y TINTAS DE GRABADO; RESINAS NATURALES EN BRUTO; METALES EN HOJAS Y EN POLVO PARA LA PINTURA, LA DECORACI\u00D3N, LA IMPRENTA Y TRABAJOS ART\u00CDSTICOS. ACEITES ANTIHERRUMBRE,ACEITES PARA CONSERVAR LA MADERA, B\u00C1LSAMO DEL CANAD\u00C1, BARNICES DE ASFALTO, BARNICES DE BET\u00DAN, BARNICES, BLANCO DE CAL, DILUYENTES PARA LACAS, DILUYENTES PARA PINTURAS, ESMALTES [BARNICES], ESMALTES PARA PINTAR / PINTURAS AL ESMALTE, ESPESANTES PARA PINTURAS, ESTUCO, EXTRACTOS DE MADERA COLORANTE / EXTRACTOS DE MADERA DE TINTE / EXTRACTOS DE PALO DE CAMPECHE, FIJADORES [BARNICES], LACAS, M\u00C1STIQUE [RESINA NATURAL, PINTURAS BACTERICIDAS, PINTURAS ANTIGRAFITI, PINTURAS ANTIINCRUSTANTES / PINTURAS ANTISUCIEDAD, PREPARACIONES ANTICORROSIVAS, SECANTES [AGENTES DE SECADO] PARA PINTURAS,', E'UN LOGOTIPO FORMADO POR TRES FIGURAS EN FORMA DE DIAMANTES DE COLORES AZUL OSCURO, NARANJA Y AZUL OSCURO NUEVAMENTE SUPERPUESTOS, SE REIVINDICA LOS COLORES AQU\u00CD DESCRITO PARA LA MARCA SOLICITADA ATRAVESADOS POR UN RECT\u00C1NGULO DE FONDO BLANCO EN CUYO CENTRO SE ENCUENTRA UN CONJUNTO DE LETRAS QUE FORMAN LA PALABRA Y SE LEE SOLINTEX. EN NEGRO, SE REIVINDICA EL CONJUNTO ANTES DESCRITO ELIMINANDO LAS PALABRAS GEN\u00C9RICAS Y/O LOS T\u00C9RMINOS GEN\u00C9RICOS QUE IMPIDAN EL REGISTRO PARA LA CLASE SOLICITADA'),
(26, E'2022-001737', E'MP', E'denominativa', E'30int', E'VENGRANO', E'CAF\u00C9, TE, CACAO Y SUCED\u00C1NEOS DEL CAF\u00C9, ARROZ, TAPIOCA Y SAGU, HARINAS Y PREPARACIONES A BASE DE CEREALES, PAN, PRODUCTOS DE PASTELER\u00CDA Y CONFITER\u00CDA, HELADOS, AZ\u00DACAR, MIEL, JARABE DE MELAZA, LEVADURA, POLVOS DE HORNEAR, SAL, MOSTAZA, VINAGRE, SALSA (CONDIMENTOS), ESPECIAS, HIELO.', NULL),
(27, E'2022-001810', E'MP', E'mixta', E'30int', E'CAF\u00C9 MOR\u00C1N', E'CAF\u00C9 Y SUCED\u00C1NEOS DEL CAF\u00C9.', E'EL DISE\u00D1O SE DESCRIBE DE LA FORMA SIGUIENTE: EN PRIMERA INSTANCIA SE APRECIA UNA FIGURA CUADRADA DE FONDO DE COLOR NEGRO. DENTRO DEL CUADRADO DE FONDO NEGRO, EN TODO SU CENTRO, SE PRESENTA UN C\u00CDRCULO DE COLOR BLANCO, DE TRAZO GRUESO, EN DONDE SE PUEDE OBSERVAR QUE SU DELINEADO INTERIOR O LADO INTERNO ES LISO DE FORMA CONTINUA, MIENTRAS QUE SU DELINEADO EXTERIOR O LADO EXTERNO, SE PUEDE APRECIAR QUE ESTA FORMADO POR PEQUE\u00D1AS ONDAS O SEMI PUNTAS CONTINUAS, QUE LO HACEN VER, COMO SI FUESE UN BORDADO QUE PARECE SER LA DE UNA MEDALLA. DENTRO DEL C\u00CDRCULO BLANCO, SE APRECIA UN FONDO FORMADO POR DOS COLORES, EN FORMA DE DEGRADE O MOTEADO, PUES EN LA PARTE SUPERIOR SE VE UN MARR\u00D3N M\u00C1S OSCURO, MIENTRAS QUE EN LA PARTE BAJA SE OBSERVA UN MARR\u00D3N M\u00C1S CLARO. SOBRE LO QUE SE HA DETALLADO, EN TODA LA PARTE CENTRAL, EXTENDI\u00C9NDOSE A TODO EL FONDO DEL C\u00CDRCULO BLANCO; SE ENCUENTRA ESCRITO EL SIGNO SOLICITADO "CAF\u00C9 MOR\u00C1N"; ESCRITO CON LETRAS DE TIPO CURSIVA, EN FORMA DE T\u00CDTULO, ES DECIR, LA PRIMERA LETRA DE CADA PALABRA ES MAY\u00DASCULA Y LAS SIGUIENTES SON MIN\u00DASCULAS. LAS LETRAS SON DE TRAZO MUY GRUESO Y DE COLOR ROJO, DELINEADO CON UN TRAZO FINO DE COLOR BLANCO. SE PRESENTA EN PRIMERA INSTANCIA, EL T\u00C9RMINO "CAF\u00C9", T\u00C9RMINO GEN\u00C9RICO Y DESCRIPTIVO QUE NO SE REIVINDICA EN EL DISE\u00D1O. JUSTO DEBAJO DEL T\u00C9RMINO "CAF\u00C9", SE PRESENTA EL T\u00C9RMINO "MOR\u00C1N". SE OBSERVA QUE EL TAMA\u00D1O DE LAS LETRAS DEL T\u00C9RMINO "MOR\u00C1N", SON MUCHO M\u00C1S ALTAS QUE LA DEL T\u00C9RMINO "CAF\u00C9". TAL ES AS\u00CD, QUE LA PRIMERA LETRA DE LA PALABRA "MOR\u00C1N", EL TRAZO DEL EXTREMO IZQUIERDO DE LA LETRA "L" SOBRESALE DEL C\u00CDRCULO BLANCO. SE OBSERVA UNA PARTICULARIDAD EN LA PALABRA "MOR\u00C1N", PUES LA VOCAL "O", EST\u00C1 REPRESENTADA POR UN GRANO DE CAF\u00C9, EL CUAL SE VE EN ALTO RELIEVE. NO SE REIVINDICA EL T\u00C9RMINO "CAF\u00C9", POR LO ANTES EXPUESTO. POR LO DEM\u00C1S, SE REIVINDICA TODO SU CONTENIDO.'),
(28, E'2022-001912', E'MP', E'mixta', E'29int', E'MORELLA', E'CARNE, PESCADO, CARNE DE AVE Y CARNE DE CAZA; EXTRACTOS DE CARNE; FRUTAS Y VERDURAS, HORTALIZAS Y LEGUMBRES EN CONSERVA, CONGELADAS, SECAS Y COCIDAS; JALEAS, CONFITURAS, COMPOTAS; HUEVOS; LECHE, QUESOS, MANTEQUILLA, YOGUR Y OTROS PRODUCTOS L\u00C1CTEOS; ACEITES Y GRASAS PARA USO ALIMENTICIO.', E'EL LOGO EST\u00C1 COMPUESTO POR LA PALABRA MORELLA PARTE DEL NOMBRE DE MI PERSONA, ESCRITA EN LETRAS DE MOLDE Y EN MAY\u00DASCULA DE TRAZO GRUESO DE COLOR NEGRO, DONDE SE EVIDENCIA EN LA CONSONANTE M, EN LA PARTE INFERIOR Y EN EL MEDIO, UN PEQUE\u00D1O C\u00CDRCULO O CIRCUNFERENCIA DE COLOR NEGRO, TODO SOBRE UN FONDO BLANCO. SE REIVINDICA EL DISE\u00D1O SOLICITADO CON LOS COLORES DESCRITOS.'),
