(31, E'2022-002020', E'MP', E'mixta', E'30int', E'GANDOUR', E'GALLETAS, TORTAS (PASTELES), PREPARACIONES HECHAS DE HARINA Y CEREALES, PAN, PASTELER\u00CDA Y CONFITER\u00CDA, HELADOS COMESTIBLES HARINA DE MA\u00CDZ, HARINA DE TRIGO, MEZCLAS PARA PREPARAR TORTAS, PASTAS ALIMENTICIAS, ARROZ, AZ\u00DACAR, SALSAS, AVENA PROCESADA Y ALIMENTOS A BASE DE AVENA, T\u00C9, CAF\u00C9, CHOCOLATE, CACAO EN TODAS SUS PRESENTACIONES Y MEZCLAS, BEBIDAS DE CAF\u00C9 Y CHOCOLATE, KETCHUP (SALSA), SALSA A BASE DE TOMATES, MAYONESA, SALSA A BASE DE MAYONESAS, SALSA DE AJO, SALSA DE SOYA, SALSA INGLESA, SALSA BARBIQUIU, SALSA DE OSTRAS, SALSA DE AJ\u00CD DULCE, SALSA PICANTE, MEZCLAS DE SALSAS, AROMATIZANTES EN FORMA DE SALSAS CONCENTRADAS, SALSA AGRIDULCE, SALSAS DE CURRY, SALSAS PARA CARNE A LA BARBACOA, SALSAS PARA PASTA, SALSAS PARA PIZZAS, SALSAS UTILIZADAS COMO CONDIMENTOS, ESPECIAS, MOSTAZA, ABLANDADORES DE CARNES, ADEREZOS, ADOBOS, ESPECIAS PRODUCTOS PARA SAZONAR, CONDIMENTOS, LEVADURA, SABORIZANTES ALIMENTICIOS, SAL, VINAGRE, COMIDAS ENVASADAS A BASE DE ARROZ, CON CARNE, PESCADO O VERDURAS, COMIDAS PREPARADAS QUE CONSISTEN PRINCIPALMENTE EN ARROZ Y TAMBI\u00C9N CON CARNE, PESCADO O VERDURAS, SAL PARA CONSERVAR PESCADO.', E'SE TRATA DE UNA ETIQUETA DE FONDO BLANCO DONDE SE APRECIA DOS C\u00CDRCULOS DE TRAZO FINO EN COLOR AZUL UNO SUPERPUESTO ARRIBA DEL OTRO Y SIN TERMINAR, EN SU CENTRO SE PUEDE OBSERVAR LA FIGURA FANTASIOSA Y CARICATURALIZADA DE UN JOVEN CON CABELLO Y CEJAS MARR\u00D3N, OJOS NEGROS, PIEL COLOR CARNE QUE PRESENTA UN BRAZO ALZADO, CARA SONRIENTE CON DIENTES SUPERIORES EN BLANCO, LENGUA EN ROJO, EL MISMO CONTIENE UN ESPECIE DE SOMBRA EN COLOR PIEL MAS CLARA EN EL ANTEBRAZO Y CUELLO, TERMINANDO CON UNA FRANELA EN COLOR AZUL; DEBAJO DEL MISMO SE PUEDE LEER LA PALABRA DE FANTAS\u00CDA QUE NO TIENE TRADUCCI\u00D3N AL ESPA\u00D1OL GANDOUR, ESCRITA EN LETRAS DE MOLDE TRAZO GRUESO EN FORMA CARACTER\u00CDSTICA Y COLOR BLANCO, EN DONDE LAS LETRAS GAN CONTIENEN VARIAS PARTICULARIDADES YA QUE LAS LETRAS (G) Y (A) SON DE MAYOR TAMA\u00D1O QUE LA LETRA (N), IGUALMENTE LA LETRA (A) NO PRESENTA EN SU PARTE CENTRAL LA LINEA VERTICAL PARA DARLE UNA APRECIACI\u00D3N DIFERENTE, LAS TRES LETRAS EST\u00C1N COLOCADA MAS ARRIBA QUE LAS LETRAS DOUR, PARA DARLE UNA DISPOSICI\u00D3N ESCALONADA, TAMBI\u00C9N SE PUEDE NOTAR QUE LA LETRA (D) ESTA DIVIDIDA EN SU LADO IZQUIERDO, DENTRO DE LA LETRA (O) SE PUEDE APRECIAR UN CIRCULO DE COLOR BLANCO, LA LETRA (U) EN SU PARTE DERECHA ES DE MAYOR TAMA\u00D1O, LA LETRA (R) SE PUEDE NOTAR QUE ESTA ESCRITA EN FORMA INCOMPLETA EN SU PARTE SUPERIOR IZQUIERDA; TODO LO DESCRITO SE ENCUENTRA DENTRO DE UN FONDO DE TRAZO GRUESO EN COLOR AZUL. SE REIVINDICA EL CONJUNTO DESCRITO AS\u00CD COMO LA COMBINACI\u00D3N DE LOS COLORES.'),
(32, E'2022-002028', E'MP', E'mixta', E'33int', E'TAWALA LEGI\u00D3N', E'Bebidas alcoholicas (excepto cervezas).', E'EL DISE\u00D1O DE LA MARCA SE CARACTERIZA POR ESTAR COMPUESTO EN LA PARTE CENTRAL DEL DISE\u00D1O POR EL TERMINO "TAWALA" EN LETRAS MAY\u00DASCULAS TIPO IMPRENTA DE COLOR ROJO CON BORDES DE COLOR BLANCO, EN LAS LETRAS "A" SE OBSERVA DOS FIGURAS CIRCULARES DE COLOR DORADO EN EL CENTRO DE CADA UNA, EL TERMINO DESCRITO SE ENCUENTRA DENTRO DE UNA FIGURA RECTANGULAR DE COLOR ROJO CUYOS BORDES SE ENCUENTRAN SEPARADOS POR PEQUE\u00D1AS FIGURAS RECTANGULARES DE COLOR BLANCO, EN LA PARTE INFERIOR CENTRAL DE LA FIGURA SE ENCUENTRA LA EXPRESI\u00D3N "LICOR DE RON" EN LETRAS MAY\u00DASCULAS TIPO IMPRENTA DE COLOR NEGRO CON UNA LIGERA SEPARACI\u00D3N ENTRE ELLAS. EN LA PARTE INFERIOR DEL DISE\u00D1O SE ENCUENTRA EL TERMINO "LEGI\u00D3N" EN UNA GRAF\u00CDA CURSIVA DE COLOR DORADO Y CON UNA LIGERA INCLINACI\u00D3N DE IZQUIERDA A DERECHA, LA LETRA "L" SE ENCUENTRA EN MAY\u00DASCULA Y SE EXTIENDE POR DEBAJO DE LA LETRA "E" HASTA LLEGAR A LA LETRA "G". EN SU PARTE SUPERIOR CENTRAL SE ENCUENTRA UNA FIGURA IRREGULAR QUE ASEMEJA A UNA PERSONA QUE CARGA UNA LANZA SOBRE SU HOMBRO Y PORTA UN CASCO EN SU CABEZA SOBRE UN CABALLO DE COLOR NEGRO QUE MIRA HACIA EL LADO IZQUIERDO DEL DISE\u00D1O, A AMBOS LADOS SE POSICIONAN DOS FIGURAS IRREGULARES QUE ASEMEJAN ESTRELLAS DE CINCO PUNTAS TAMBI\u00C9N DE COLOR NEGRO, SEGUIDO DE LA EXPRESI\u00D3N "SOURCING PREMIUM QUALITY" (ABASTECIMIENTO DE PRIMERA CALIDAD) EN LETRAS MAY\u00DASCULAS TIPO IMPRENTA DE COLOR AMARILLO, A AMBOS LADOS DEL T\u00C9RMINO, SEGUIDAMENTE SE ENCUENTRAN DOS FIGURAS DE FORMA RECTANGULAR CON BORDES DE COLOR DORADO Y FONDO BLANCO UBICADAS EN LA PARTE CENTRAL IZQUIERDA. SOBRE EL CONJUNTO DESCRITO SE DISPONE LA EXPRESI\u00D3N "OF LEGIONARY MEN" (DE LOS HOMBRES LEGIONARIOS) EN LETRAS MAY\u00DASCULAS TIPO IMPRENTA DE COLOR DORADO ENTRE DOS ARCOS DE COLOR ROJO, AL FINAL DEL ARCO MAS GRANDE SE SIT\u00DAAN DOS FIGURAS IRREGULARES DE COLOR DORADO, LIGERAMENTE INCLINADAS Y QUE PRESENTAN SEMIC\u00CDRCULOS DE COLOR BLANCO EN SU INTERIOR. LOS ELEMENTOS ANTERIORMENTE DESCRITOS SE OBSERVAN SOBRE UN FONDO DE COLOR BLANCO. SE REIVINDICA EL CONJUNTO ANTERIORMENTE DESCRITO Y NO LAS PALABRAS GEN\u00C9RICAS Y/O DE USO COM\u00DAN UTILIZADAS SEPARADAMENTE.'),
(33, E'2022-002044', E'MP', E'mixta', E'32int', E'PAPELONYA', E'BEBIDAS, BEBIDAS GASIFICADAS, BEBIDAS CON LIM\u00D3N Y PANELA, BEBIDAS CON O A BASE DE PANELA, PREPARACIONES PARA HACER BEBIDAS CON O A BASE DE PANELA O PRODUCTOS DERIVADOS DE LA CA\u00D1A DE AZ\u00DACAR.', E'PAPELONY\u00C1 (LA PALABRA PAPELONY\u00C1 LEYENDA GEN\u00C9RICA NO REIVINDICABLE) CONSISTE EN LA REPRESENTACI\u00D3N GR\u00C1FICA DE LA PALABRA PAPELONY\u00C1 (LA PALABRA PAPELONY\u00C1 LEYENDA GEN\u00C9RICA NO REIVINDICABLE), DE TRAZO GRUESO, COLOR BLANCO CON BORDE AMARILLO Y VERDE. LAS LETRAS P, L, Y. ESCRITAS EN MAY\u00DASCULAS, EL RESTO EN MIN\u00DASCULAS. EN LAS LETRAS P Y O, SE OBSERVA QUE TIENEN EL FONDO DE COLOR VERDE. LA \u00DALTIMA LETRA A, VEMOS QUE SE ENCUENTRA ACENTUADA. TODO LO DESCRITO SOBRE UN FONDO BLANCO. SE REIVINDICA TODO EL CONJUNTO DESCRITO, AS\u00CD COMO LA COMBINACI\u00D3N DE COLORES: BLANCO, VERDE Y AMARILLO.'),
