(38, E'2022-002442', E'MP', E'mixta', E'30int', E'POLAR SINCE 1941', E'CAF\u00C9, T\u00C9, CACAO Y SUS SUCED\u00C1NEOS; ARROZ, PASTAS ALIMENTICIAS Y FIDEOS; TAPIOCA Y SAG\u00DA; HARINAS Y PREPARACIONES A BASE DE CEREALES; PAN, PRODUCTOS DE PASTELER\u00CDA Y CONFITER\u00CDA; CHOCOLATE; HELADOS CREMOSOS, SORBETES Y OTROS HELADOS; AZ\u00DACAR, MIEL, JARABE DE MELAZA; LEVADURA, POLVOS DE HORNEAR; SAL, PRODUCTOS PARA SAZONAR, ESPECIAS, HIERBAS EN CONSERVA; VINAGRE, SALSAS Y OTROS CONDIMENTOS; HIELO.', E'LA ETIQUETA TIENE COMO ELEMENTO PRINCIPAL EL CONJUNTO DENOMINATIVO \u201CPOLAR SINCE 1941\u201D EN DOS NIVELES. EN EL PRIMER NIVEL, SE LEE LA PALABRA DE FANTAS\u00CDA \u201CPOLAR\u201D EN LETRA DISPUESTA EN FORMA DE ARCO; EN LETRA TIPO MOLDE, EN MAY\u00DASCULAS, DONDE LA LETRA \u201CP\u201D ES DE MAYOR TAMA\u00D1O QUE EL RESTO DE LAS LETRAS. TODA LA PALABRA ES DE COLOR NEGRO. EN LA PARTE INFERIOR DE LA PALABRA POLAR Y CENTRADA SE LEE LA FRASE \u201CSINCE 1941\u201D, QUE TRADUCIDO AL ESPA\u00D1OL SIGNIFICA \u201CDESDE 1941\u201D\u201D; EN LETRA TIPO MOLDE, REDONDEADA, DONDE LA LETRA \u201CS\u201D SE OBSERVA EN MAY\u00DASCULA Y EL RESTO DE LAS LETRAS EN MIN\u00DASCULAS; TODAS DE TRAZO MEDIO, DE COLOR NEGRO. TODO LO ANTERIOR SE ENCUENTRA DENTRO DE UNA FIGURA ASIM\u00C9TRICA QUE RECORRE LOS BORDES DEL CONJUNTO ANTES DESCRITO; CON EL BORDE DE COLOR NEGRO DE TRAZO MEDIO. LO ANTERIOR SE OBSERVA SOBRE UN FONDO DE COLOR BLANCO. SE REIVINDICA EL CONJUNTO ANTERIORMENTE DESCRITO Y LA COMBINACI\u00D3N DE COLORES SEG\u00DAN SE DESCRIBE. LA DESCRIPCI\u00D3N DE COLORES SE HA HECHO EN CUMPLIMIENTO AL AVISO OFICIAL S/N EMANADO DEL REGISTRO DE LA PROPIEDAD INTELECTUAL FECHADO 18 DE NOVIEMBRE DE 1996.'),
