(41, E'2022-002734', E'MP', E'mixta', E'30int', E'NUTRI DELHI', E'CAF\u00C9, T\u00C9, CACAO Y SUCED\u00C1NEOS DEL CAF\u00C9; ARROZ; TAPIOCA Y SAG\u00DA; HARINAS Y PREPARACIONES A BASE DE CEREALES; PAN, PRODUCTOS DE PASTELER\u00CDA Y CONFITER\u00CDA; HELADOS; AZ\u00DACAR, MIEL, JARABE DE MELAZA; LEVADURA, POLVOS DE HORNEAR; SAL; MOSTAZA; VINAGRE, SALSAS (CONDIMENTOS); ESPECIAS; HIELO.', E'ESTA FIGURA CONSISTE EN UNA PALABRA DE FANTASIA NUTRI DELHI, DONDE SE PUEDE OBSERVAR LA LETRA N SE ENCUENTRA EN MAY\u00DASCULA DE COLOR BLANCO CON UN FONDO DE COLOR AZUL QUE EST\u00C1 CUBRE LA MAYOR PARTE DE LA PALABRA NUTRI, ASI MISMO LA LETRA ESCRITA EN MAY\u00DASCULA IDENTIFICADA EN COLOR VERDE, LA LETRA E EN MIN\u00DASCULA DE COLOR FUSCIA, LA LETRA L EN COLOR AMARILLO Y LA LETRA H DE IGUAL FORMA MIN\u00DASCULA SE ENCUENTRA EN COLOR TURQUESA TODA EST\u00C1S LETRA CON FONDO BLANCO CON EL FIN QUE SE VEA EN RELIVE, IDENTICANDAS ESTAS LETRAS CON COLORES VIVOS QUE REPRESENTA LA ALEGR\u00CDA DE NUESTROS ALIMENTOS'),
(42, E'2022-002792', E'MP', E'mixta', E'25int', E'LA SALLE', E'PRENDAS DE VESTIR, CALZADO, ARTICULOS DE SOMBRERIA, JEANS, UNIFORMES.', E'CONSISTE EN LA PALABRA LA DE COLOR AZUL, LA CUAL LA ACOMPA\u00D1A UNA ESTRELLA CUYO BORDE ES GRUESO DE COLOR AMARILLO Y SU FONDO ES BLANCO. DICHA ESTRELLA ES DE CINCO PICOS EN LA QUE SE EVIDENCIA QUE LOS MISMOS SON DE DISTINTAS DIMENSIONES, SIENDO LOS PICOS SUPERIORES E INFERIORES M\u00C1S GRANDES QUE LOS PIRCOS SUPERIORES E INFERIORES DERECHOS. AL LADO DE LA ESTRELLA CONTIN\u00DAA LA PALABRA SALLE EN COLOR AZUL. SE REIVINDICA TODO EL CONJUNTO DE ELEMENTOS ANTERIORMENTE DESCRITO A EXCEPCI\u00D3N DE: LOS ELEMENTOS GEN\u00C9RICOS DESCRIPTIVOS, LOS PREVIAMENTE REGISTRADOS O LOS QUE NO PUEDAN SER OBJETO DE REGISTRO.'),
