(46, E'2022-003383', E'MP', E'mixta', E'30int', E'ALIMENTOS TRINIDAD', E'PRODUCTOS Y SUBPRODUCTOS DE LA CA\u00D1A DE AZ\u00DACAR, TALES COMO AZ\u00DACAR BLANCA REFINADA, MORENA, EN POLVO, JARABE, CARAMELO, PANELA; CAF\u00C9 EN GRANO SIN PROCESAR, PROCESADO EN GRANO, MOLIDO; HARINAS DE TRIGO TODO USO, LEUDANTE, INTEGRAL, HARINAS DE MA\u00CDZ PRECOCIDA BLANCA Y AMARILLA; ARROZ BLANCO, INTEGRAL, PARBOLIZADO Y HARINA DE ARROZ', E'LA MARCA SOLICITADA EST\u00C1 FORMADA POR LA PALABRA \\\"TRINIDAD\\\" EN MIN\u00DASCULAS COMPUESTA EN UNA TIPOGRAF\u00CDA DE PALO SECO EN COLOR NEGRO Y SUBRAYADA CON UNA L\u00CDNEA DE COLOR GRIS MEDIO, EN CUYO EXTREMO SUPERIOR IZQUIERDO SE UBICA UNA CINTA RIBETEADA DE COLOR GRIS MEDIO QUE CONTIENE LA PALABRA \\\"ALIMENTOS\\\" EN MAY\u00DASCULAS Y EST\u00C1 COMPUESTA EN UNA TIPOGRAF\u00CDA DE PALO SECO EN COLOR BLANCO. AL EXTREMO SUPERIOR DERECHO SE MUESTRAN TRES ARCOS SEMICIRCULARES CONC\u00C9NTRICOS DE GROSOR VARIABLE EN COLOR GRIS MEDIO QUE SIMULAN LA ENTRADA A UNA PROFUNDA GALER\u00CDA ABOVEDADA. LA MARCA PUEDE TAMBI\u00C9N UTILIZARSE CON TODOS SUS ELEMENTOS EN COLOR BLANCO CUANDO ESTA SE PRESENTE SOBRE UN FONDO OSCURO.'),
