(48, E'2022-003661', E'MP', E'mixta', E'30int', E'ALIMENTOS VILLATERRA', E'CAF\u00C9, T\u00C9, CACAO Y SUCED\u00C1NEOS DEL CAF\u00C9; ARROZ, PASTAS ALIMENTICIAS Y FIDEOS; TAPIOCA Y SAG\u00DA; HARINAS Y PREPARACIONES A BASE DE CEREALES, AZ\u00DACAR, SAL, PRODUCTOS Y ESPECIES PARA SAZONAR.', E'ISOLOGO CONFORMADO POR UN FONDO DE COLOR BLANCO, EN EL QUE SE OBSERVA EN SU PARTE MEDIA CENTRAL INICIANDO DE IZQUIERDA A DERECHA A OJO DEL OBSERVADOR LA MITAD DE LA SILUETA DE UNA VIVIENDA QUE CONTIENE EN SU PARTE INTERNA TRES LINEAS CURVAS UBICADAS EN POSICI\u00D3N VERTICAL CON UNA PEQUE\u00D1A INCLINACI\u00D3N, Y SIENDO ESTAS DE LOS SIGUIENTES TAMA\u00D1OS; PEQUE\u00D1A, MEDIA Y GRANDE. SOBRE EST\u00C1 ULTIMA SE UBICAN TRES LINEAS VERTICALES DE MISMO TAMA\u00D1O Y GROSOR, CON TRES OVOIDES EN SUS PUNTAS. TODA LA SILUETA SE ENCUENTRA EN UN TONO COLOR ROJO Y SE VE INTERRUMPIDA EN SU PARTE DERECHA POR UNA LETRA "V" MAY\u00DASCULA SEGUIDA DE LAS LETRAS "I", "L", "L", "A", "T", "E", "R", "R", Y "A" FORMANDO AS\u00CD LA PALABRA "VILLATERRA" EN LETRA TIPO MOLDE Y OBSERV\u00C1NDOSE UN TONO COLOR ROJO EN LAS LETRAS "V", "I", "L", "L", Y "A", Y UN TONO COLOR AZUL OSCURO EN LAS LETRAS "T", "E", "R", "R", Y "A". EN LA PARTE SUPERIOR IZQUIERDA DEL T\u00C9RMINO SE ENCUENTRA ESCRITA EN LETRA CORRIDA DESTACANDO SU INICIAL EN MAY\u00DASCULA Y EL RESTO EN MINUSCULAS LA PALABRA "ALIMENTOS" EN UN TONO AZUL OSCURO Y GRAF\u00CDA ESPECIAL. SE REIVINDICAN LOS COLORES DESCRITOS. NO SE REIVINDICAN LOS T\u00C9RMINOS GEN\u00C9RICOS, COMUNES O DESCRIPTIVOS EN EL CONJUNTO.'),
(49, E'2022-003819', E'MP', E'mixta', E'33int', E'LA CAVA EST.1995', E'BEBIDAS ALCOH\u00D3LICAS, EXCEPTO CERVEZAS; PREPARACIONES ALCOH\u00D3LICAS PARA HACER BEBIDAS, VINOS, SIDRA ALCOH\u00D3LICA, AGUARDIENTES, LICORES, ESENCIAS ALCOH\u00D3LICAS, EXTRACTOS DE FRUTAS ALCOH\u00D3LICAS, AMARGOS.', E'EN EL CENTRO SE APRECIA UN CIRCULO DE TAMA\u00D1O GRANDE EL CUAL ESTA CERRANDO UN SEGUNDO CIRCULO, DENTRO DE LA FIGURA SE APRECIA DEL LADO SUPERIOR E INFERIOR UNA ABERTURA EN EL CENTRO EN DELINEADO DE COLOR VERDE, EN EL CENTRO DE LA ESAS ABERTURA LA PALABRA ( L, A, C, A, V, A, ) TODO ELLO EN DELINEADO COLOR VERDE, LAS LETRAS ( L ) Y ( A ) EST\u00C1N JUSTO AL BORDE DE CADA LADO. LA LETRA ( L ) TIENE UN PUNTICO EN LA PARTE SUPERIOR, AL IGUAL QUE LA LETRA ( V ) EN LA PARTE SUPERIOR, DEBAJO DE LA PALABRA LA SIGUIENTES LETRAS Y N\u00DAMEROS, (E, S, T, 1,9,9,5 ) ES UN JUEGO DE PALABRA TODAS EN COLOR VERDE. NO SE REIVINDICAN LAS LEYENDAS GEN\u00C9RICAS DESCRITAS, SE REIVINDICAN LOS COLORES Y CONJUNTOS DESCRIPTIVOS.'),
