(53, E'2022-004053', E'MS', E'mixta', E'35int', E'ZONA ROSAL', E'MARCA DE SERVICIO QUE DISTINGUE LOS SERVICIOS DE PUBLICIDAD, MARKETING Y DE PROMOCI\u00D3N, Y EL DESARROLLO DE CONCEPTOS PUBLICITARIOS.', E'LA ETIQUETA ESTA DISTINGUIDA POR UN CONJUNTO DE PALABRAS QUE SE LEEN: ZONA ROSAL; DISPUESTA EN LINEA RECTA, DENTRO DE UN MARCO COLOR GRIS. LA PALABRA ZONA ROSAL ESTA COMPUESTA POR UNA TIPOGRAFIA FRACCIOANDA CUYA COMPOSICION TIPOGR\u00C1FICA SE DESCRIBE DE LA SIGUIENTE MANERA: LETRA Z ESCRITA EN TAMA\u00D1O MAYUSCULA CON TIPOGRAFIA FRACCIONADA EN COLORES VERDE Y AZUL CLARO. LETRA O ESCRITA EN TAMA\u00D1O MINUSCULA, CON TIPOGRAFIA FRACCIONADA GRIS. LETRA N ESCRITA EN TAMA\u00D1O MINUSCULA, CON TIPOGRAFIA FRACCIONADA EN COLOR GRIS. LETRA A ESCRITA EN MINUSCULA CON TIPOGRAFIA FRACCIONADA GRIS. LETRA R ESCRITA EN TAMA\u00D1O MAYUSCULA, CON TIPOGRAFIA FRACCIONADA EN COLORES ROJO Y AMARILLO. LETRA O ESCRITA EN TAMA\u00D1O MINUSCULA, CON TIPOGRAFIA FRACCIONADA EN COLOR GRIS. LETRA S ESCRITA EN TAMA\u00D1O MINUSCULA CON TIPOGRAFIA FRACCIONADA COLOR GRIS. LETRA A ESCRITA EN TAMA\u00D1O MINUSCULA CON TIPOGRAFIA FRACCIONADA EN COLOR GRIS. LETRA L ESCRITA EN TAMA\u00D1O MINUSCULA EN COLOR AZUL CLARO.'),
(54, E'2022-004216', E'MS', E'mixta', E'39int', E'R', E'TRANSPORTE; EMBALAJE Y ALMACENAMIENTO DE MERCANC\u00CDAS; ORGANIZACI\u00D3N DE VIAJES.', E'EL DISE\u00D1O DE LA MARCA EN CUESTI\u00D3N EST\u00C1 COMPUESTO POR LA LETRA "R", LA CUAL SE OBSERVA EN MAY\u00DASCULAS, EN UNA GRAF\u00CDA ESPECIAL Y CARACTER\u00CDSTICA, DE COLOR NEGRO, CUYO LADO INFERIOR DERECHO SE OBSERVA PROYECTADO HACIA LA DERECHA Y SE DESTACA M\u00C1S GRUESO QUE EL RESTO DE LA LETRA. EN EL ESPACIO INFERIOR DE LA LETRA, COMPRENDIDO ENTRE LOS EXTREMOS INFERIORES DE LA MISMA, PUEDE OBSERVARSE UN TRI\u00C1NGULO RECT\u00C1NGULO PLASMADO EN COLOR VERDE AGUAMARINA. SE REIVINDICA EL CONJUNTO DESCRITO.'),
