(57, E'2022-004226', E'MP', E'mixta', E'5int', E'BAO BAO', E'PRODUCTOS FARMAC\u00C9UTICOS, PREPARACIONES PARA USO M\u00C9DICO Y VETERINARIO, PRODUCTOS HIGI\u00C9NICOS Y SANITARIOS PARA USO M\u00C9DICO, ALIMENTOS Y SUSTANCIAS DIET\u00C9TICAS PARA USO M\u00C9DICO O VETERINARIO, ALIMENTOS PARA BEB\u00C9S, SUPLEMENTOS ALIMENTICIOS PARA PERSONAS O ANIMALES, EMPLASTOS, MATERIAL PARA AP\u00D3SITOS, MATERIAL PARA EMPASTES E IMPRONTAS IMPRESIONES DENTALES, DESINFECTANTES, PRODUCTOS PARA ELIMINAR ANIMALES DA\u00D1INOS, FUNGICIDAS,PRODUCTOS FARMAC\u00C9UTICOS Y OTRAS PREPARACIONES PARA USO M\u00C9DICO O VETERINARIO. LOS PRODUCTOS DE HIGIENE PERSONAL QUE NO SEAN DE TOCADOR, LOS PA\u00D1ALES PARA BEB\u00C9S E INCONTINENTESY PARA LA INCONTINENCIA, LOS DESODORIZANTES QUE NO SEAN PARA PERSONAS O ANIMALES,LOS CHAMP\u00DAS, JABONES, LOCIONES Y DENT\u00CDFRICOS MEDICINALES, LOS SUPLEMENTOS ALIMENTICIOS DESTINADOS A COMPLETAR UNA DIETA NORMAL O A BENEFICIAR LA SALUD, LOS SUSTITUTOS DE COMIDAS Y LOS ALIMENTOS Y BEBIDAS DIET\u00C9TICOS PARA USO M\u00C9DICO O VETERINARIO.', E'CONSISTE EN LA REPRESENTACION GRAFIVA DE UN NI\u00D1O CARICATURIZADO CON ABUNDANTE CABELLO, Q UIEN LLEVA UN PA\u00D1AL COLOCADO Y UNA TOALLA EN FORMA DE CAPA COMO DE SUPER HEROE. EL NI\u00D1O ESTA DESPROVISTO DE VESTIMANTA Y SE MUESTRA CON LA MANO DERECHA COLOCADA EN SU CINTURA Y CON LA MANO IZQUIERDA EN FORMA DE SALUDO. SU MIRADA ESTA ENFOCADA AL CENTRO. EL COLOR DE LA LINEA ES DE COLOR AZUL, EL CUAL SE REIVINDICA. SU CABELLO TAMBIEN ES DE COLOR AZUL ASI COMO LA SOMBRA QUE PROYECTA DEBAJO DE LA FIGURA DEL NI\u00D1O,EL COLOR EN ESTOS ELEMENTOS SE REIVINDICA.EN LA PARTE I NFERIOR DE LA FIGURA SE PUEDE LEER LA FRASE BAO BAO QUE EN IDIOMA CHINO SE TRADUCE COMO "BEBE". DICHA FRASE ESTA DESCRITA EN COLOR NEGRO EL CUAL SE REIVINDICA Y EN LATRAS CURSIVAS INCLINADAS UN POCA HACIA EL LADO DERECHO Y CON LA LATRA INICIAL DE CADA PALABRA EN LETRA MAYUSCULA.'),
(58, E'2022-004236', E'MP', E'mixta', E'5int', E'TSINGYUAN', E'HERBICIDAS; DEPURATIVOS; BIOCIDAS; FUNGICIDAS PARA USO AGR\u00CDCOLA; PESTICIDAS; GERMICIDAS; MEDICAMENTOS PARA USO VETERINARIO; PRODUCTOS PARA ELIMINAR ANIMALES DA\u00D1INOS; HERBICIDAS PARA USO AGR\u00CDCOLA; FUNGICIDAS.', E'CONSISTE EN LA REPRESENTACI\u00D3N GR\u00C1FICA DE LA PALABRA DE FANTAS\u00CDA ‶TSINGYUAN″ (SIN TRADUCCI\u00D3N EN EL IDIOMA CASTELLANO), ESCRITA EN LETRAS DE MOLDE LIGERAMENTE ESTILIZADAS DE COLOR NEGRO SOBRE FONDO BLANCO. SE REIVINDICA EL CONJUNTO DESCRITO EN SU TOTALIDAD, SIN REIVINDICAR NING\u00DAN ELEMENTO QUE EN FORMA AISLADA PUDIERA SER CONSIDERADO COMO GEN\u00C9RICO O DESCRIPTIVO EN LA CLASE SOLICITADA.'),
(59, E'2022-004260', E'MP', E'mixta', E'16int', E'PITAPOLLO', E'PAPEL, CART\u00D3N Y ART\u00CDCULOS DE ESTAS MATERIAS NO COMPRENDIDOS EN OTRAS CLASES; PRODUCTOS DE IMPRENTA; MATERIAL DE ENCUADERNACI\u00D3N; FOTOGRAF\u00CDAS; ART\u00CDCULOS DE PAPELER\u00CDA; ADHESIVOS (PEGAMENTOS) DE PAPELER\u00CDA O PARA USO DOM\u00C9STICO; MATERIAL PARA ARTISTAS; PINCELES; M\u00C1QUINAS DE ESCRIBIR Y ART\u00CDCULOS DE OFICINA (EXCEPTO MUEBLES); MATERIAL DE INSTRUCCI\u00D3N O MATERIAL DID\u00C1CTICO (EXCEPTO APARATOS); MATERIAS PL\u00C1STICAS PARA EMBALAR (NO COMPRENDIDAS EN OTRAS CLASES); CARACTERES DE IMPRENTA; CLICH\u00C9S DE IMPRENTA. ESPECIALMENTE RECEPTACULOS, BOLSAS Y MATERIAS PL\u00C1STICAS PARA EMBALAR (NO COMPRENDIDAS EN OTRAS CLASES).', E'SE OBSERVA LA PALABRA PITAPOLLO, (FANTAS\u00CDA), ESCRITA EN LETRAS MIN\u00DASCULAS DE TRAZO GRUESO Y COLOR BLANCO, SOBRE UN FONDO ROJO CON BORDE NARANJA, QUE LE DA SILUETA A TODAS LAS LETRAS, DE LAS CUALES, LA "P" Y LA "A", QUEDAN CARACTERISTICAMENTE ABIERTAS.SOBRE LA PALABRA SE DISTINGUE CLARAMENTE UNA FIGURA DE FONDO BLANCO QUE ASEMEJA UNA CABEZA DE AVE, DE CONTORNO ROJO Y NARANJA, DENTRO DEL CUAL SE REVELAN HACIA AFUERA, DOS C\u00CDRCULOS, COMO \u00D3RBITAS DE OJOS DE BORDE ROJO Y COLOR BLANCO, CON UN PUNTO O IRIS NEGRO. UN PICO AMARILLO EN FORMA DE "V" Y UNA CRESTA DE COLOR ROJO COMPUESTA DE TRES SECCIONES EN FORMA DE P\u00C9TALOS.SE REINVINDICA EL CONJUNTO DESCRITO.'),
