(66, E'2022-005555', E'MS', E'mixta', E'35int', E'METAFRAX GROUP', E'GESTI\u00D3N DE EMPRESAS; ESTUDIOS DE MERCADO; INFORMACI\u00D3N SOBRE NEGOCIOS; INVESTIGACI\u00D3N COMERCIAL; B\u00DASQUEDAS DE NEGOCIOS; MARKETING.', E'LA ETIQUETA CONSISTE EN UN ELEMENTO FIGURATIVO QUE SE REPRESENTA COMO UNA IMAGEN ESTILIZADA DE UN C\u00CDRCULO INCLINADO HACIA LA IZQUIERDA Y DIVIDIDO EN SU INTERIOR POR L\u00CDNEAS, DESDE L\u00CDNEAS LARGAS, DE COLOR MORADO, EN EL CENTRO, HASTA L\u00CDNEAS M\u00C1S PEQUE\u00D1AS EN LOS BORDES, TAMBI\u00C9N DE COLOR MORADO. EN LA PARTE INFERIOR DERECHA DEL ELEMENTO DE LA IMAGEN APARECE LA PALABRA \u00ABMETAFRAX GROUP\u00BB, QUE ESTA CONFORMADO POR LA PALABRA DE FANTAS\u00CDA  \u00ABMETAFRAX\u00BB, LA CUAL, NO POSEE TRADUCCI\u00D3N ALGUNA AL IDIOMA CASTELLANO NI TIENE UN SIGNIFICADO ESPEC\u00CDFICO EN EL COMERCIO O LA INDUSTRIA PERTINENTE, O APLICADA A LOS PRODUCTOS O SERVICIOS ENUMERADOS EN LA SOLICITUD. ASIMISMO, DEBAJO DE LA PALABRA DE FANTAS\u00CDA, SE APRECIA LA PALABRA EN INGL\u00C9S  \u00ABGROUP\u00BB, EL CUAL SE TRADUCE AL IDIOMA CASTELLANO COMO  \u00ABGRUPO\u00BB. TODO EL CONJUNTO SE ENCUENTRA SOBRE FONDO BLANCO. SE REIVINDICA EL CONJUNTO DESCRITO EN SU TOTALIDAD SIN REIVINDICAR NING\u00DAN ELEMENTO QUE EN FORMA AISLADA PUEDA SER CONSIDERADO GEN\u00C9RICO O DESCRIPTIVO EN LA CLASE SOLICITADA.'),
