(72, E'2022-005969', E'MP', E'mixta', E'29int', E'GALLETAS PUIG CRASK\u00CD BRAN', E'CARNE, PESCADO, CARNE DE AVE Y CARNE DE CAZA, EXTRACTOS DE CARNE, FRUTAS Y VERDURAS, HORTALIZAS Y LEGUMBRES EN CONSERVA, CONGELADAS, SECAS Y COCIDAS, JALEAS, CONFITURAS, COMPOTAS, HUEVOS, LECHE, QUESOS, MANTEQUILLA, YOGURT Y OTROS PRODUCTOS L\u00C1CTEOS, ACEITES Y GRASAS PARA USO ALIMENTICIO.', E'DESCRIPCI\u00D3N DE LA ETIQUETA GALLETAS PUIG CRASK\u00CD BRAN (LA PALABRA GALLETAS LEYENDA GEN\u00C9RICA NO REIVINDICABLE) CONSISTE EN LA REPRESENTACI\u00D3N GR\u00C1FICA DE UN CUADRADO, CON EL FONDO DE COLOR MARR\u00D3N. A SU VEZ SE OBSERVAN L\u00CDNEAS DIAGONALES, DE TRAZO FINO, BLANCAS Y MARRONES. \u00C9STAS HACIA EL LADO IZQUIERDO. DEL LADO IZQUIERDO SE VE UN C\u00CDRCULO CON EL FONDO DE COLOR BLANCO, EL BORDE DE COLOR ROJO Y BLANCO ALREDEDOR DE DICHO C\u00CDRCULO, DENTRO SE LEE GALLETAS PUIG, (LA PALABRA GALLETAS LEYENDA GEN\u00C9RICA NO REIVINDICABLE) DE TRAZO MEDIO Y GRUESO, DE COLOR ROJO, LA PALABRA GALLETAS, SE CARACTERIZA POR EMPEZAR CON LETRA DE TAMA\u00D1O NORMAL, CONTINUA CON LETRAS ALTAS Y FINALIZA CON LETRA DE TAMA\u00D1O NORMAL, LA PALABRA PUIG, DE TRAZO GRUESO, DE COLOR ROJO, SE CARACTERIZA POR EMPEZAR CON LETRA DE TAMA\u00D1O NORMAL, CONTINUA CON LETRAS ALTAS Y FINALIZA CON LETRA DE TAMA\u00D1O NORMAL. LUEGO SE LEE CRASK\u00CD BRAN. LA PALABRA CRASK\u00CD, DE TRAZO GRUESO, COLOR BLANCO CON SOMBREADO ROJO Y ANARANJADO, ESCRITA LA LETRA C EN MAY\u00DASCULA, EL RESTO EN MIN\u00DASCULA, SE OBSERVA QUE LA LETRA I EST\u00C1 ACENTUADA Y SE CARACTERIZA POR SER DE GRAN TAMA\u00D1O. DEBAJO EN LA PARTE INFERIOR DERECHA, SE LEE LA PALABRA BRAN, DE TRAZO GRUESO, COLOR MARR\u00D3N CON BORDE BLANCO, ESCRITA EN MAY\u00DASCULA. ENTRE LAS DOS PALABRAS ANTES DESCRITA SE OBSERVA LA FIGURA DE UNA RAMA DE TRIGO, DE COLOR AMARILLO. SE REIVINDICA EL CONJUNTO DESCRITO, AS\u00CD COMO LA COMBINACI\u00D3N DE LOS COLORES: ROJO, BLANCO, ANARANJADO, MARR\u00D3N Y AMARILLO. EXCEPTO LA PALABRA GEN\u00C9R