(78, E'2022-006639', E'MS', E'mixta', E'35int', E'PITAHAYA MEDIA MARKETING', E'SERVICIOS DE AGENCIAS DE PUBLICIDAD; CONSULTOR\u00CDA SOBRE ESTRATEGIAS DE COMUNICACI\u00D3N [PUBLICIDAD]; CONSULTOR\u00CDA SOBRE ESTRATEGIAS DE COMUNICACI\u00D3N [RELACIONES P\u00DABLICAS]; CREACI\u00D3N DE PERFILES DE CONSUMIDORES CON FINES COMERCIALES O DE MARKETING; DESARROLLO DE CONCEPTOS PUBLICITARIOS; DIFUSI\u00D3N DE MATERIAL PUBLICITARIO; ALQUILER DE ESPACIOS PUBLICITARIOS; ESTUDIOS DE MERCADO; SERVICIOS DE INTELIGENCIA DE MERCADO; INVESTIGACI\u00D3N DE MARKETING; MERCADOTECNIA.', E'CONSISTE EN UNA ETIQUETA CUADRADA DE FONDO BLANCO EN LA QUE SE OBSERVA UNA FIGURA EN FORMA DE GOTA, DE COLOR ROSADO OSCURO, LA CUAL SE ASEMEJA A UNA FRUTA. EN SU PARTE INTERNA, INFERIOR IZQUIERDA, SE ENCUENTRA UN SEMIC\u00CDRCULO, DE TAMA\u00D1O MEDIANO, DE COLOR ROSA CLARO. EN LA PARTE SUPERIOR EXTERNA DE LA FIGURA ANTES DESCRITA, ENCONTRAMOS UNAS L\u00CDNEAS GRUESAS, DE COLOR VERDE, LAS CUALES DESCIENDEN DE MANERA CURVADA. DEBAJO DE LA FIGURA DESCRITA SE LEE LA PALABRA PITAHAYA, ESCRITA EN UN GRAFISMO ESPECIAL, CARACTER\u00CDSTICA, DE TRAZO FINO, MAY\u00DASCULAS, DE COLOR NEGRO Y DEBAJO DE ESTA PALABRA SE LEE LA FRASE MEDIA MARKETING, ESCRITA EN LETRA ESTILIZADA, CARACTER\u00CDSTICA, DE TRAZO FINO, MAY\u00DASCULAS Y DE COLOR VERDE, PALABRAS QUE TRADUCIDAS AL CASTELLANO SIGNIFICAN MEDIA = MEDIOS, MARKETING =MERCADEO. SE REIVINDICA EL CONJUNTO DESCRITO.'),
