(82, E'2022-007277', E'MS', E'mixta', E'42int', E'BIOZTRONICS', E'SERVICIOS CIENT\u00CDFICOS Y TECNOL\u00D3GICOS, SERVICIOS DE INVESTIGACI\u00D3N Y DISE\u00D1O EN ESTOS \u00C1MBITOS; DISE\u00D1O Y DESARROLLO DE HARDWARE Y SOFTWARE.', E'Consiste en una etiqueta de fondo de color blanco sobre el cual se observa un robot con tonalidades verdes con un rect\u00E1ngulo azul en donde se ubicaran los ojos y la sonrisa del robot las cuales son de color verde. Debajo del robot se encuentra la palabra BIOZTRONICS escrita en letras caracter\u00EDsticas may\u00FAsculas. La Palabra BIO Significa vida, se le agrega la letra Z que corresponde a la inicial del nombre de la madre del fundador, seguido se agrega la palabra TRONICS que es el diminutivo de electronics que es una palabra del idioma ingles que traducido al espa\u00F1ol significa \u201CElectronica\u201D. En la palabra Bioztronics se observan tres tonos de colores, se remplazan las dos \u201CO\u201D que posee la palabra por c\u00EDrculos en color verde, la B, I y la Z est\u00E1n en color azul marino y en negrita, luego las letras T, R, N, I, C, y la S se encuentran en color gris. Debajo de la palabra BIOZTRONICS y tocando las dos O que se encuentran en el texto se consigue una l\u00EDnea curva que hace alusi\u00F3n a una sonrisa debajo de la palabra.'),
