(86, E'2022-008083', E'MP', E'mixta', E'30int', E'LOS ROSALES', E'CAF\u00C9, T\u00C9, CACAO Y SUS SUCED\u00C1NEOS; ARROZ, PASTAS ALIMENTICIAS Y FIDEOS; TAPIOCA Y SAG\u00DA; HARINAS Y PREPARACIONES A BASE DE CEREALES; PAN, PRODUCTOS DE PASTELER\u00CDA Y CONFITER\u00CDA; CHOCOLATE; HELADOS CREMOSOS, SORBETES Y OTROS HELADOS; AZ\u00DACAR, MIEL, JARABE DE MELAZA; LEVADURA, POLVOS DE HORNEAR; SAL, PRODUCTOS PARA SAZONAR, ESPECIAS, HIERBAS EN CONSERVA; VINAGRE, SALSAS Y OTROS CONDIMENTOS; HIELO.', E'SE APRECIA UN LOGOTIPO CON EL FONDO DE COLOR BLANCO, EN EL CENTRO LA PALABRA (LOS ROSALES) EN COLOR ROJO LAS LETRAS Y LIGERAMENTE INCLINADA, TENIENDO LAS TRES PRIMERAS LETRAS ( L,O,S ) EN MIN\u00DASCULA, CON UNA SEPARACI\u00D3N DE LA SILUETA DE ABAJO. LAS LETRAS (R,L) SON M\u00C1S GRANDE QUE EL RESTO DE LAS LETRAS (O,S,A,E,S), LA LETRA ( E ) TIENE EN LA PARTE DE ARRIBA, UNA FIGURA QUE ASEMEJA A UNA CORONA, CON CINCO PUNTAS, EN COLOR VERDE. EN LA PARTE DE ABAJO UNA SILUETA EN FORMA DE ARCO CON CINCO NIVELES EN COLOR VERDE DE MAYOR A MENOR Y CON LA SEPARACI\u00D3N DE LOS NIVELES EN COLOR BLANCO.NO SE REIVINDICAN LAS LEYENDAS GEN\u00C9RICAS DESCRITAS, SE REIVINDICAN LOS COLORES Y CONJUNTOS DESCRIPTIVOS.'),
(87, E'2022-008198', E'MP', E'mixta', E'3int', E'PINK SILVER', E'PRODUCTOS COSM\u00C9TICOS Y PREPARACIONES DE TOCADOR NO MEDICINALES; PRODUCTOS DE PERFUMER\u00CDA, ACEITES ESENCIALES.', E'EST\u00C1 COMPUESTA POR UNA ETIQUETA DE FONDO BLANCO DONDE SE LEE LA PALABRA PINK SILVER, (SIGNIFICA ROSA PLATA), ESCRITA EN LETRA DE MOLDE Y EN FORMA DE CALIGRAF\u00CDA, EN MAY\u00DASCULAS LAS CONSONANTE P – S Y EL RESTO EN MIN\u00DASCULAS DE COLOR NEGRO DE TRAZO FINO. SE REIVINDICA EL DISE\u00D1O SOLICITADO EN SU CONJUNTO CON LOS COLORES DESCRITO MAS NO LOS T\u00C9RMINOS GEN\u00C9RICOS.'),
(88, E'2022-008203', E'MP', E'mixta', E'9int', E'TELLUS POWER', E'ORDENADORES; TEL\u00C9FONOS CELULARES; LINTERNAS DE SE\u00D1ALES; DISPOSITIVOS DE CARGA PARA VEH\u00CDCULOS DE MOTOR; DISPOSITIVOS DE CARGA DE BATER\u00CDAS; BATER\u00CDAS RECARGABLES PARA VEH\u00CDCULOS EL\u00C9CTRICOS; CARGADOR SOLAR; ENERG\u00CDA M\u00D3VIL (BATER\u00CDA RECARGABLE); TABLETAS ELECTR\u00D3NICAS; CARGADORES DE BATER\u00CDAS RECARGABLES.', E'EL SIGNO QUE SE PRESENTA A CONTINUACI\u00D3N SE ENCUENTRA CONFORMADO POR LA PALABRA DE FANTAS\u00CDA  \u00ABTELLUS\u00BB, LA CUAL, NO POSEE TRADUCCI\u00D3N ALGUNA AL IDIOMA CASTELLANO NI TIENE UN SIGNIFICADO ESPEC\u00CDFICO Y, EN SU CONJUNTO, NO TIENE NING\u00DAN SIGNIFICADO EN EL COMERCIO O LA INDUSTRIA PERTINENTE O APLICADA A LOS PRODUCTOS ENUMERADOS EN LA SOLICITUD Y LA PALABRA EN INGL\u00C9S  \u00ABPOWER\u00BB, LA CUAL, TRADUCIDA AL IDIOMA CASTELLANO SIGNIFICA  \u00ABPODER\u00BB.AMBAS PALABRAS SE ENCUENTRAN ESCRITAS EN LETRAS DE MOLDE, DE COLOR NEGRO Y TRAZOS GRUESOS, CON UNA TIPOGRAF\u00CDA ESPECIAL, POSICIONADAS DE FORMA HORIZONTAL SOBRE UN FONDO DE COLOR BLANCO. EN LA PALABRA  \u00ABTELLUS\u00BB, TODAS LAS LETRAS SE ENCUENTRAN EN MAY\u00DASCULA, A EXCEPCI\u00D3N DE LA LETRA  \u00ABE\u00BB, LA CUAL, EST\u00C1 ESCRITA EN MIN\u00DASCULA. EN LA PALABRA  \u00ABPOWER\u00BB, TODAS LAS LETRAS SE ENCUENTRAN EN MIN\u00DASCULAS, A EXCEPCI\u00D3N DE LA LETRA  \u00ABR\u00BB, LA CUAL, EST\u00C1 ESCRITA EN MAY\u00DASCULA. DE IGUAL MANERA, LA PALABRA  \u00ABPOWER\u00BB SE ENCUENTRA SEPARADA POR UN APOSTROFE  \u00AB´\u00BB ENTRE LAS LETRAS  \u00ABO\u00BB Y  \u00ABW\u00BBSE REIVINDICA EL CONJUNTO DESCRITO EN SU TOTALIDAD SIN REIVINDICAR PROTECCI\u00D3N ALGUNA SOBRE CUALQUIER ELEMENTO GEN\u00C9RICO, DESCRIPTIVO NI GEOGR\u00C1FICO EN LA CLASE SOLICITADA.'),
(89, E'2022-008212', E'NC', E'mixta', E'46int', E'EL CLUB DE LAS PAYASITAS', E'EMPRESA DEDICADA A LA REPRESENTACION DE OBRAS MUSICALES Y ARTISTICAS, ASI COMO LA PRODUCCION, PROMOCION, REPRODUCCION, COMPRA, VENTA, CONSIGNACION Y DISTRIBUCION, IMPORTACION, EXPORTACION DE TODO LO QUE SE RELACIONE CON SOPORTES MUSICALES Y/O AUDIOVISUALES, TALES COMO DISCOS, CINTAS O CUALQUIER OTRO FORMATO, DE IGUAL MANERA DESARROLLAR, PROMOVER, CONTRATAR, REPRESENTAR ARTISTAS Y PRESENTAR EVENTOS ARTISTICOS DE TALENTO EN VIVO. REPRESENTAR FIRMAS NACIONALES O EXTRANJERAS QUE ACTUEN O QUE REPRESENTEN ARTISTAS, CONJUNTOS MUSICALES DE TEATRO O CUALQUIER OTRA NATURALEZA ANALOGA.', E'EL MENCIONADO DISE\u00D1O CONSISTE EN UNA ETIQUETA CUADRADA DE FONDO BLANCO EN CUYO INTERIOR EN LA PARTE CENTRICA IZQUIERDA SE DIBUJA UN PEQUE\u00D1O GLOBO EN COLOR AZUL CON UNA DELGADA TIRA DE COLOR NEGRO, DENTRO DE ESTE GLOBO SE ESCRIBE \\\"EL\\\" EN LETRA MOLDE DE COLOR BLANCO, SEGUIDO DE LA PALABRA \\\"CLUB\\\" ESCRITA EN LETRA MOLDE EN COLORES FUCSIA PARA LA LETRA \\\"C\\\" Y PARTE DE LA \\\"L\\\" Y ANARANJADO ROJIZO PARA LAS LETRAS \\\"L\\\", \\\"U\\\" Y \\\"B\\\", SE CONTINUA ESCRIBIENDO LA PALABRA \\\"DE LAS\\\" EN LETRA MOLDE DE COLOR BLANCO, ENCERRADO DENTRO DE UNA NARIZ DE PAYASO COLOR ROJO OSCURO, PARA FINALMENTE ESCRIBIRSE LA PALABRA \\\"PAYASITAS\\\" EN LETRA MOLDE EN COLORES AMARILLO PARA LA LETRA \\\"P\\\", VERDE PARA LA LETRA \\\"A\\\", AZUL JADE EN LA LETRA \\\"Y\\\" AZUL OCEANO PARA LA LETRAS \\\"A\\\" Y \\\"S\\\", AZUL OSCURO PARA LA LETRA \\\"I\\\" DONDE SE DESTACA UNA FIGURA DE NOTA MUSICAL DEL MISMO TONO ENCIMA DE LA LETRA, COLOR MORADO PARA LA LETRA \\\"T\\\" Y \\\"A\\\" Y FUCSIA PARA LA LETRA \\\"S\\\", TODO EL CONJUNTO MENCIONADO PREVIAMENTE SE ENCUENTRA CON UN FONDO BLANCO TIPO SOMBRA Y ENCERRADO CON UN BORDE DE COLOR FUCSIA PARA FORMAR LA PALABRA \\\"EL CLUB DE LAS PAYASITAS\\\", SE REIVINDICA TODO LO AQUI DESCRITO Y COLORES MENOS LO QUE PODRIA CONSIDERARSE COMO GENERICO.'),
(90, E'2022-008233', E'MP', E'mixta', E'6int', E'CLAVO VARETA C.A. MEJIA & CIA', E'METALES COMUNES Y SUS ALEACIONES; MATERIALES DE CONSTRUCCI\u00D3N Y EDIFICACI\u00D3N MET\u00C1LICOS; CONSTRUCCIONES TRANSPORTABLES MET\u00C1LICAS; CLAVOS, CABLES E HILOS MET\u00C1LICOS NO EL\u00C9CTRICOS; PEQUE\u00D1OS ART\u00CDCULOS DE FERRETER\u00CDA MET\u00C1LICOS; CONTENEDORES MET\u00C1LICOS DE ALMACENAMIENTO Y TRANSPORTE; CAJAS DE CAUDALES.', E'LA MARCA EST\u00C1 CONFORMADA POR UN CONJUNTO DE PALABRAS Y DISE\u00D1OS. EN LA PARTE SUPERIOR DERECHA, SOBRE UN RECT\u00C1NGULO DE COLOR NEGRO SE APRECIA LA EXPRESI\u00D3N CLAVO VARETA ESCRITO EN LETRA TIPO MOLDE DE COLOR BLANCO. BAJO LA MISMA Y SOBRE UN RECT\u00C1NGULO BLANCO SE APRECIA LA FIGURA DE DOS CLAVOS ENTRECRUZADOS DE COLOR BLANCO CON BORDES EN NEGRO. EN EL LADO DERECHO DEL DISE\u00D1O Y SOBRE UN FONDO DE COLOR ROJO SE PRESENTA EL DISE\u00D1O DE UNA ESFERA BLANCA CON L\u00CDNEAS NEGRAS, ATRAVESADA POR UN CLAVO Y SOBRE LA MISMA, UNA FRANJA CURVIL\u00CDNEA NEGRA DONDE SE APRECIA LA EXPRESI\u00D3N C.A. MEJIA & CIA, ESCRITA EN LETRA TIPO MOLDE DE COLOR BLANCO. LO QUE SE PRETENDE PROTEGER ES EL CONJUNTO DESCRITO Y NO LOS ELEMENTOS O T\u00C9RMINOS GEN\u00C9RICOS.'),
(91, E'2022-008247', E'MP', E'mixta', E'6int', E'TRITON', E'METALES COMUNES Y SUS ALEACIONES; MATERIALES DE CONSTRUCCI\u00D3N Y EDIFICACI\u00D3N MET\u00C1LICOS; CONSTRUCCIONES TRANSPORTABLES MET\u00C1LICAS; CABLES E HILOS MET\u00C1LICOS NO EL\u00C9CTRICOS; PEQUE\u00D1OS ART\u00CDCULOS DE FERRETER\u00CDA MET\u00C1LICOS;CAJAS DE CAUDALES.', E'LA MARCA EST\u00C1 COMPUESTA POR LA PALABRA TRITON, ESCRITA EN LETRA TIPO MOLDE DE COLOR AZUL Y DESTACANDO UNA FIGURA COMPUESTA POR TRES TRI\u00C1NGULOS DE COLOR AZUL, UNO DE ELLOS ATRAVESADO POR UNA L\u00CDNEA BLANCA, UBICADOS SOBRE LA LETRA O. LO QUE SE PRETENDE PROTEGER ES EL CONJUNTO DESCRITO Y NO LOS ELEMENTOS GEN\u00C9RICOS.'),
(92, E'2022-008292', E'MS', E'denominativa', E'43int', E'CAPITAL GRILL', E'SERVICIOS DE RESTAURACI\u00D3N (ALIMENTACI\u00D3N), PREPARAR ALIMENTOS Y BEBIDAS PARA EL CONSUMO, PRESTADOS POR PERSONAS O ESTABLECIMIENTOS, AS\u00CD COMO LOS SERVICIOS DE ALOJAMIENTO, ALBERGUE Y ABASTECIMIENTO DE COMIDA EN HOTELES, PENSIONES U OTROS ESTABLECIMIENTOS QUE PROPORCIONEN HOSPEDAJE TEMPORAL.', NULL),
(93, E'2022-008319', E'MP', E'mixta', E'25int', E'POSITEX', E'DISTINGUE: CALZADO, VESTIDO Y SOMBRERIA', E'LA ETIQUETA ESTA COMPUESTA POR UNA FIGURA QUE HACE LAS VECES DE UNA PERSONA CON LOS DOS BRAZOS HACIA ARRIBA Y LAS PIERNAS ABIERTAS EN MEDIO DE LOS BRAZOS UN PUNTO, QUE HACE LA FORMA DE UNA CARA, ESTA DE COLOR NARANJA, EL CUAL REIVINDICA EL GR\u00C1FICO Y EN LA PARTE DE ABAJO ESTA LA PALABRA "POSITEX" EN LETRAS AZULES, EN LETRAS GRANDES, LAS CUALES REIVINDICAN LA FIGURA, EL FONDO DE ESTA EN COLOR BLANCO QUE REIVINDICA TODA LA ETIQUETA'),
(94, E'2022-008511', E'MP', E'mixta', E'30int', E'WAFER 365 XL', E'CAF\u00C9, T\u00C9, CACAO Y SUS SUCED\u00C1NEOS; ARROZ, PASTAS ALIMENTICIAS Y FIDEOS; TAPIOCA Y SAG\u00DA; HARINAS Y PREPARACIONES A BASE DE CEREALES; PAN, PRODUCTOS DE PASTELER\u00CDA Y CONFITER\u00CDA; CHOCOLATE; HELADOS CREMOSOS, SORBETES Y OTROS HELADOS; AZ\u00DACAR, MIEL, JARABE DE MELAZA; LEVADURA, POLVOS DE HORNEAR; SAL, PRODUCTOS PARA SAZONAR, ESPECIAS, HIERBAS EN CONSERVA; VINAGRE, SALSAS Y OTROS CONDIMENTOS; HIELO.', E'LA ETIQUETA DE LA MARCA \u201CWAFER 365 XL\u201D, CONSTA DE UN LOGO CON FONDO AZUL, EN DONDE SE OBSERVA EN COLOR AZUL OSCURO CON BORDE AMARILLO LA PALABRA \u201CWAFER 365\u201D QUE ES UN TERMINO DE FANTAS\u00CDA Y ESTA ESCRITO EN LETRAS CARACTERISTICAS MINUSCULAS. DICHAS LETRAS TIENEN UN FONDO BLANCO. AL LADO DERECHO SE OBSERVA UNA FIGURA QUE ASEMEJA A UNA GALLETA TIPO WAFER (OBLEA) EN COLOR BLANCO CON UN RELLENO MARRON CLARO QUE SE OBSERVA EN LA PARTE DERECHA DE LA IMAGEN. EN LA PARTE INFERIOR DERECHA DE ESTA FIGURA EN FORMA DE GALLETA SE OBSERVAN LAS LETRAS \u201CXL\u201D EN COLOR BLANCO EN UN CIRCULO DE COLOR VERDE CLARO, DICHAS LETRAS ESTAN ESCRITAS EN LETRAS CARACTERISTICAS MAYUSCULAS. DEBAJO DE LAS LETRAS \u201CXL\u201D SE OBSERVAN UNAS FIGURAS QUE SE ASEMEJAN A UNAS AVELLANAS EN COLOR MARRON. SE REIVINDICA EL CONJUNTO DESCRITO. NO SE REIVINDICAN LOS ELEMENTOS GENERICOS, NI DESCRIPTIVOS.'),
(95, E'2022-008610', E'MP', E'mixta', E'11int', E'OG', E'APARATOS E INSTALACIONES DE DISTRIBUCI\u00D3N DE AGUA; INSTALACIONES SANITARIAS, ESPECIALMENTE, GRIFOS, DUCHAS, BA\u00D1ERAS, REGADERAS, LAVAMANOS, FREGADEROS, POCETAS, URINARIOS, BID\u00C9S, INODOROS, GRIFOS, GRIFOS MEZCLADORES PARA CONDUCTOS DE AGUA, GENERADORES DE MICROBURBUJAS PARA BA\u00D1ERAS,TAZAS DE INODOROS.', E'CONSISTE EN UN CONJUNTO EN EL CUAL SE OBSERVA LA FIGURA DE LO QUE ASEMEJA SER LA LETRA OMEGA DE FORMA ESTILIZADA Y DE TRAZO GRUESO DE LINEA BLANCA Y PUNTEAGUDA EN SU PARTE SUPERIOR SOBRE UN FONDO AZUL, DE FORMA CIRCULAR, CON LA PARTICULARIDAD DE TENER LO QUE PARECE UNA GOTA DE AGUA EN SU INTERIOR, DONDE SE OBSERVA UNA LINEA BLANCA EN EL LADO IZQUIERDO SUPERIOR QUE ASEMEJA UN REFLEJO DE LUZ. BAJO LA FIGURA DESCRITA SE ENCUENTRAN LAS LETRAS O y G ESCRITAS EN TRAZO MEDIO DE COLOR BLANCO. SE REIVINDICA EL CONJUNTO Y COLORES DESCRITOS.'),
(96, E'2022-008662', E'MS', E'denominativa', E'41int', E'SACA EL PECHO FEST', E'SERVICIOS DE ENTRETENIMIENTO; ACTIVIDADES DEPORTIVAS Y CULTURALES; FORMACI\u00D3N; SERVICIOS DE ESPECT\u00C1CULOS Y ENTRETENIMIENTO; ORGANIZACI\u00D3N Y DIRECCI\u00D3N DE EVENTOS CULTURALES, DEPORTIVOS, Y DE ENTRETENIMIENTO.', NULL),
(97, E'2022-008812', E'MP', E'mixta', E'28int', E'PLASTICOS CELIA', E'JUGUETES, ART\u00CDCULOS DE DEPORTE Y DE JUEGO.', E'La etiqueta esta conformada por una figura en forma de coraz\u00F3n de color rojo; en el interior de la misma se aprecia una figura de caricatura de color blanco y rojo, que asemeja una ni\u00F1a a medio cuerpo, con los brazos extendidos, con los ojos abiertos, boca sonriente y pelo largo recogido en dos mo\u00F1os extendidos, uno hacia el lado derecho y el otro hacia el lado izquierdo. En la parte inferior y sobre esta figura se aprecian las palabras: `Plasticos` escrita en min\u00FAscula a excepci\u00F3n de la primera letra que est\u00E1 en may\u00FAscula, en trazo grueso y estilizado, de color rojo y blanco; y `CELIA` escrita en su totalidad en letras may\u00FAsculas, de trazo grueso y estilizado, de color rojo y blanco. Se reivindica todo el conjunto y los colores descritos en \u00E9l, a excepci\u00F3n de los t\u00E9rminos gen\u00E9ricos.'),
(98, E'2022-009083', E'MS', E'mixta', E'37int', E'AION', E'RECONSTRUCCI\u00D3N DE M\u00C1QUINAS USADAS O PARCIALMENTE DESTRUIDAS; MANTENIMIENTO Y REPARACI\u00D3N DE VEH\u00CDCULOS TERRESTRES; LAVADO DE VEH\u00CDCULOS; ESTACIONES DE SERVICIO [REABASTECIMIENTO DE CARBURANTE Y MANTENIMIENTO]; ENGRASE DE VEH\u00CDCULOS; SERVICIOS DE RECARGA DE BATER\u00CDAS DE VEH\u00CDCULOS; MANTENIMIENTO Y REPARACI\u00D3N DE VEH\u00CDCULOS A MOTOR; SERVICIOS DE CARGA DE BATER\u00CDAS PARA VEH\u00CDCULOS DE MOTOR; MANTENIMIENTO Y REPARACI\u00D3N DE AVIONES; SERVICIOS DE REPARACI\u00D3N EN CASO DE AVER\u00CDA DE VEH\u00CDCULOS; TRATAMIENTO CONTRA LA HERRUMBRE; RECAUCHUTADO DE NEUM\u00C1TICOS; REPARACI\u00D3N DE LLANTAS DE GOMA; VULCANIZACI\u00D3N DE NEUM\u00C1TICOS (REPARACI\u00D3N); INSTALACI\u00D3N Y REPARACI\u00D3N DE ALARMAS ANTIRROBO.', E'CONSISTE EN UN DISE\u00D1O EN EL CUAL SE LEE \\\"AION\\\" (PALABRA DE FANTAS\u00CDA, SIN SIGNIFICADO PROPIO) EN LETRAS COLOR NEGRO, DE TRAZO GRUESO Y EN MAY\u00DASCULA; CON LA PARTICULARIDAD QUE EN LA LETRA \\\"A\\\" EL TRAZO HORIZONTAL EST\u00C1 INCOMPLETO Y COLOCADO EN LA PARTE M\u00C1S BAJA DE LA LETRA. SE REIVINDICA EL CONJUNTO ANTERIORMENTE DESCRITO Y LOS COLORES ANTES MENCIONADOS.'),
(99, E'2022-009112', E'MP', E'mixta', E'20int', E'MEETION', E'SILLAS [ASIENTOS]; MESAS; MESAS DE MECANOGRAF\u00CDA; ESTANTES DE ALMACENAMIENTO; CABALLETES [MUEBLES]; MUEBLES; CAJAS DE MADERA O DE MATERIAS PL\u00C1STICAS; BANCOS DE TRABAJO; PLACAS DE IDENTIFICACI\u00D3N NO MET\u00C1LICAS; COJINES.', E'CONSISTE EN LA PALABRA MEETION (PROVIENE DEL IDIOMA INGL\u00C9S Y TRADUCE: REUNI\u00D3N), ESCRITA EN LETRA DE IMPRENTA, MAY\u00DASCULA, DE TRAZO GRUESO Y FONDO COLOR NEGRO, CON LAS LETRAS M Y T EN MAYOR TAMA\u00D1O QUE LAS DEM\u00C1S LETRAS. A LA IZQUIERDA DE DICHA PALABRA SE OBSERVA UNA FIGURA IRREGULAR CON TRAZOS RECTOS UBICADOS EN DIFERENTES POSICIONES DE FONDO COLOR NEGRO, LA CUAL TIENE SOBRE ELLA DOS TRAZOS IRREGULARES QUE SIMULAN UN ROMBO, DE TRAZO GRUESO Y FONDO COLOR NEGRO. SE REIVINDICA EL CONJUNTO DESCRITO, CON LOS COLORES INDICADOS EN \u00C9L.'),
(100, E'2022-009512', E'MP', E'mixta', E'5int', E'NUTRIT YEAST', E'COMPLEMENTO ALIMENTICIO PARA ANIMALES (NUTRIT YEAST)', E'LA ETIQUETA CONTIENE: AL CENTRO EN LA PARTE SUPERIOR EL NOMBRE DE LA COMPA\u00D1IA (RODECAS ALIMENTOS) Y EL NOMBRE DEL PRODUCTO NUTRIT YEAST. SEGUIDO DE UN CINTILLO CON SILUETAS DE CABEZAS DE DISTINTOS ANIMALES. EN LA PARTE CENTRAL A LA IZQUIERDA INFORMACION NUTRICIONAL, EN LA PARTE CENTRAL A LA DERECHA DESCRIPCION DEL CONTENIDO EN UNIDADES DE PESO, EN LA PARTE INFERIOR A LA IZQUIERDA UN CIRCULO DISTINTIVO DEL PRODUCTO, EN LA PARTE INFERIOR A LA DERECHA CODIGO DE BARRA E INFORMACION DE LA EMPRESA COMERCIALIZADORA Y DE PRODUCCION.'),
(101, E'2022-009520', E'NC', E'mixta', E'46int', E'O2 OXIVEN', E'Producci\u00F3n, distribuci\u00F3n y comercializaci\u00F3n de gases industriales/medicinales; v\u00E1lvulas y cilindros; tanques.', E'El signo solicitado consiste en un dise\u00F1o conformado por los siguientes elementos: Se aprecia el termino OXIVEN escrita en letra molde, may\u00FAscula, siendo que las letras OXI son de color azul, las letras EN son de color verde y la letra V es de color azul y verde, en la parte superior del termino antes descrito observamos la letra O escrita en letra molde, may\u00FAscula, de color verde, en la parte inferior derecha se aprecia el numero dos escrita en letra molde, de color azul, as\u00ED mismo podemos apreciar que, en la parte inferior de la letra O se observa varias l\u00EDneas en forma de curva que se asemeja a una ola, la misma es de color azul y est\u00E1 unida al dise\u00F1o del n\u00FAmero dos. Se reivindica el conjunto y colores descritos con independencia del tama\u00F1o, y no as\u00ED las palabras o t\u00E9rminos gen\u00E9ricos, todo de acuerdo a los facs\u00EDmiles que se acompa\u00F1an.'),
(102, E'2022-009630', E'MP', E'denominativa', E'10int', E'VERSITIV', E'Cat\u00E9teres con agujas quir\u00FArgicas para la administraci\u00F3n de medicamentos; bombas y tubos de infusi\u00F3n.', NULL),
(103, E'2023-000002', E'MS', E'mixta', E'36int', E'LATITUD SEGUROS', E'SERVICIOS DE SEGUROS, OPERACIONES FINANCIERAS, MONETARIAS, NEGOCIOS INMOBILIARIOS.', E'EL DISE\u00D1O DE LA MARCA SE ENCUENTRA COMPUESTO POR EL T\u00C9RMINO \u201CLATITUD\u201D ESCRITO EN UNA GRAF\u00CDA ESPECIAL CARACTER\u00CDSTICA DE COLOR AZUL CELESTE, CON LA LETRA \u201CL\u201D EN MAY\u00DASCULA Y EL RESTO DE LAS LETRAS EN MIN\u00DASCULAS. EN LA PARTE INFERIOR DE DICHO TERMINO, EN MAYOR TAMA\u00D1O, SE DISPONE LA PALABRA \u201CSEGUROS\u201D ESCRITO EN UNA GRAF\u00CDA TIPO IMPRENTA DE COLOR AZUL MARINO EN MAY\u00DASCULA SOSTENIDA Y CON UNA LIGERA SEPARACI\u00D3N ENTRE SUS LETRAS. EN LA PARTE SUPERIOR IZQUIERDA DEL DISE\u00D1O SE ENCUENTRA UNA FIGURA SEMICIRCULAR, QUE ASEMEJA LA IMAGEN DE UN GLOBO TERR\u00C1QUEO, COMPUESTA DE VARIOS C\u00CDRCULOS, DE COLOR AZUL CELESTE, LOS CUALES DISMINUYEN SU TAMA\u00D1O EN LOS EXTREMOS DE LA FIGURA. EL CONJUNTO DESCRITO SE DISPONE SOBRE UN FONDO DE COLOR BLANCO. SE REIVINDICA EL CONJUNTO DESCRITO Y NO EL T\u00C9RMINO GEN\u00C9RICO UTILIZADO SEPARADAMENTE.'),
(104, E'2023-000016', E'MP', E'denominativa', E'5int', E'NIREDON', E'PREPARACIONES PARA LA DESTRUCCI\u00D3N DE PAR\u00C1SITOS; FUNGICIDAS, HERBICIDAS, INSECTICIDAS, NEMATICIDAS; BIOINSECTICIDAS; BIOFUNGICIDAS; BIONEMATICIDAS; BIOHERBICIDAS; AGENTES DE CONTROL BIOL\u00D3GICO PARA USO EN AGRICULTURA PARA EL CONTROL DE ENFERMEDADES F\u00DANGICAS Y BACTERIANAS, PLAGAS, NEMATODOS Y MALAS HIERBAS; PREPARACIONES PARA REPELER ANIMALES, AVES E INSECTOS; PRODUCTOS BIOL\u00D3GICOS Y PREPARACIONES A PARTIR DE MICROORGANISMOS, EXTRACTOS BOT\u00C1NICOS Y MINERALES PARA EL BIOCONTROL DE PLAGAS Y AGENTES PAT\u00D3GENOS.', NULL),
(105, E'2023-000106', E'MS', E'mixta', E'35int', E'MATILDA', E'PUBLICIDAD; GESTION, ORGANIZACION Y ADMINISTRACION DE NEGOCIOS COMERCIALES; TRABAJOS DE OFICINA.', E'EL SIGNO SOLICITADO CONSISTE EN UN DISE\u00D1O CON FONDO COLOR PANTONE 627C CONFORMADO POR LOS SIGUIENTES ELEMENTOS: EN UN PRIMER PLANO SE LEE LA PALABRA \u201CMATILDA\u201D ESCRITA EN LETRA TIPO MOLDE CON DOBLE BORDE Y MIN\u00DASCULAS DE COLOR PANTONE 176C.EN LA PARTE SUPERIOR CENTRADA DE LA PALABRA \u201CMATILDA\u201D SE DIBUJAN CUATRO FIGURAS:LA PRIMERA UBICADA DESDE EL BORDE SUPERIOR IZQUIERDO HASTA EL BORDE INFERIOR DERECHO, UNA FIGURA DE L\u00CDNEAS QUE SIMULA UNA ESPIGA CUYO COLOR ES PANTONE 176C.LA SEGUNDA FIGURA SIMULAN SUS L\u00CDNEAS CURVAS ENTRECRUZADAS A UN BATIDOR MANUAL CUYO COLOR PANTONE ES 176C, QUE VA DESDE EL BORDE INFERIOR IZQUIERDO AL BORDE SUPERIOR DERECHO.LA TERCERA FIGURA SIMULA EN SUS L\u00CDNEAS UNA PALETA CUYOS TRAZOS SON DE COLOR PANTONE 176C, QUE SE ENCUENTRA DIBUJADA EN EL CENTRO DE LAS FIGURAS DE LA ESPIGA Y EL BATIDOR. LA CUARTA FIGURA SIMULA CON SUS L\u00CDNEAS UN RODILLO CON SUS EXTREMIDADES DE AGARRE EN CADA PUNTA BIEN DELINEADAS, SOBREPONI\u00C9NDOSE Y EN EL CENTRO DE LAS FIGURAS ANTES DESCRITAS, CUYAS L\u00CDNEAS SON DE COLOR PANTONE 176C.TODAS LAS FIGURAS ANTES DESCRITAS SE ENCUENTRAN ENTRECRUZADAS EN SU CONJUNTO FORMAN UN SOLO GRUPO. EN LA PARTE SUPERIOR DE LA ETIQUETA, CENTRADA ENCIMA DE LAS FIGURAS DESCRITAS SE ENCUENTRA ESCRITA LA PALABRA MAISON Y EN SUS EXTREMIDADES EST\u00C1N DIBUJADAS UNAS L\u00CDNEAS CORTAS, CUYA TRADUCCI\u00D3N AL CASTELLANO ES HOGAR, LA CUAL NO SE REIVINDICA. EN LA PARTE INFERIOR DE LA ETIQUETA SE ENCUENTRA ESCRITA LAS PALABRAS P\u00C2STISSERIE FINE, LAS CUALES EN SU TRADUCCI\u00D3N AL CASTELLANO SIGNIFICA PASTELERIA FINA, LA CUAL NO SE REIVINDINCAN. EL RESTO DE LA ETIQUETA EN SU CONJUNTO, SE REIVINDICA EN COLORES, TAMA\u00D1OS Y TIPO DE LETRAS.'),
(106, E'2023-000166', E'MS', E'grafica', E'35int', NULL, E'Publicidad, gesti\u00F3n de negocios comerciales; administraci\u00F3n comercial; trabajos de oficina; relaciones p\u00FAblicas; contrataci\u00F3n de personal; vallas publicitarias; distribuci\u00F3n de propaganda; muestras publicitarias.', E'En la parte superior, se describe un dise\u00F1o en el cual se observan tres figuras iguales de forma ovaladas, compuesta de l\u00EDneas curvas de trazo fino, con la particularidad de que las figuras se alargan en cada uno de sus extremos y se encuentran, entre s\u00ED en la parte central. Debajo de lo anteriormente descrito, se observa en la parte central, una peque\u00F1a figura circular. Todo ello en color negro, presentando en su interior una l\u00EDnea de trazo fino en color blanco, que atraviesa el dise\u00F1o y se presenta sobre un fondo de color blanco.Debajo de todo lo anteriormente descrito, en la parte central, se observa la palabra \u201CTAMANACO\u201D, en letras de trazo grueso en color negro, presentando una l\u00EDnea de trazo fino en color blanco en el interior de cada letra y debajo de este conjunto se observa la palabra \u201CHOTEL\u201D en letras de igual forma y tama\u00F1o, de trazo fino en color negro y de menor tama\u00F1o con relaci\u00F3n a la palabra \u201CTAMANACO\u201D. Todo ello en fondo de color blanco. HOTEL TAMANACO es una marca registrada, cuyo titular es HOTEL TAMANACO C.A.'),
(107, E'2023-000191', E'MP', E'mixta', E'10int', E'LV', E'Anillos de dentici\u00F3n; sujetadores para chupetes; m\u00E1scaras sanitarias; m\u00E1scaras protectoras para fines m\u00E9dicos; chupetes para beb\u00E9s; vendas de apoyo; vendas, el\u00E1sticas; medias para varices; muletas; biberones; tapones para los o\u00EDdos [dispositivos de protecci\u00F3n auditiva]; bastones para fines m\u00E9dicos; cinturones para fines m\u00E9dicos; calzado ortop\u00E9dico; copas menstruales; cojines para fines m\u00E9dicos; raspadores de lengua; curetas para los o\u00EDdos; eslingas [vendas de soporte]; sillones para fines m\u00E9dicos o dentales; guantes para fines m\u00E9dicos; guantes para masajes; juguetes sexuales; l\u00E1mparas para fines m\u00E9dicos; mu\u00F1ecas de amor [mu\u00F1ecas sexuales]; preservativos ; sacaleches; estuches de instrumentos para uso m\u00E9dico; prendas de compresi\u00F3n; dispositivos de vibromasaje (Productos nacionales y/o extranjeros).', E'La etiqueta que se presenta a continuaci\u00F3n consiste en la representaci\u00F3n gr\u00E1fica de las letras L y V ubicadas en el centro de la etiqueta, escritas en may\u00FAsculas, de trazo grueso, de color negro. Asimismo, destaca la particularidad de que la letra L se encuentra ligeramente inclinada hacia la derecha y se intersecta con la letra V en su lado izquierdo. Dichas letras est\u00E1n rodeadas de diferentes figuras con formas de flores. A mayor proximidad de las letras y en los cuatro puntos diagonales con respecto a las mismas, se encuentran cuatro representaciones gr\u00E1ficas de una flor de color negro con cuatro p\u00E9talos con extremos puntiagudos que apuntan, cada uno, hacia un punto cardinal distinto. El centro de estas flores es un c\u00EDrculo de color blanco. M\u00E1s alejadas de las letras LV y ubicadas en cada uno de los cuatro puntos cardinales de la etiqueta, se encuentran cuatro representaciones gr\u00E1ficas de una flor de color blanco con cuatro p\u00E9talos con extremos puntiagudos que apuntan, cada uno, hacia un punto cardinal distinto. Cada una de estas cuatro flores tiene un c\u00EDrculo de color negro en su centro y se encuentra superpuesta sobre una figura m\u00E1s grande, de color negro y similar a un rombo con la diferencia de que sus lados son curvos. Adicionalmente, se muestran cuatro figuras con forma de flores en las cuatro esquinas de la etiqueta. Se trata de la representaci\u00F3n gr\u00E1fica de cuatro flores de color blanco con cuatro p\u00E9talos con bordes redondeados y orientados, cada uno, hacia un punto cardinal distinto. Cada una de estas cuatro flores tiene un c\u00EDrculo peque\u00F1o de color negro en su centro y se encuentra superpuesta sobre un c\u00EDrculo m\u00E1s grande de color negro. El fondo de la etiqueta es blanco. Se reivindica el conjunto descrito.'),
(108, E'2023-000228', E'MS', E'grafica', E'43int', NULL, E'Servicios de restauraci\u00F3n, hospedaje temporal.', E'En la parte superior se describe un dise\u00F1o, en el cual se observan tres figuras iguales de forma ovaladas, compuesta de l\u00EDneas curvas de trazo fino, con la particularidad de que las figuras se alargan en cada uno de sus extremos y se encuentran, entre s\u00ED en la parte central. Debajo de lo anteriormente descrito, se observa en la parte central, una peque\u00F1a figura circular. Todo ello en color negro, presentando en su interior una l\u00EDnea de trazo fino en color blanco, que atraviesa el dise\u00F1o y se presenta sobre un fondo de color blanco.Debajo de todo lo anteriormente descrito, en la parte central, se observa la palabra \u201CTAMANACO\u201D, en letras de trazo grueso en color negro, presentando una l\u00EDnea de trazo fino en color blanco en el interior de cada letra y debajo de este conjunto se observa la palabra \u201CCASINO\u201D en letras de igual forma y tama\u00F1o, de trazo fino en color negro y de menor tama\u00F1o con relaci\u00F3n a la palabra \u201CTAMANACO\u201D. Todo ello en fondo de color blanco. CASINO TAMANACO es una marca registrada, cuyo titular es HOTEL TAMANACO C.A.'),
(109, E'2023-000277', E'MP', E'grafica', E'9int', NULL, E'LOS PROGRAMAS INFORM\u00C1TICOS Y EL SOFTWARE DE TODO TIPO, INDEPENDIENTEMENTE DE SU SOPORTE DE GRABACI\u00D3N O MEDIO DE DIFUSI\u00D3N, INCLUIDO EL SOFTWARE GRABADO EN SOPORTES MAGN\u00C9TICOS O DESCARGADO EN UNA RED INFORM\u00C1TICA REMOTA.', E'CONSISTE EN UNA ETIQUETA CON FONDO COLOR BLANCO, EL CUAL SE OBSERVA UNA FIGURA DE SEMIOVALO DE COLOR CEREZO, DENTRO DE ELLA SE ENCUENTRA UNA NUEVA FIGURA DE COLOR NEGRO, LA MISMA POSEE UNA CURVA C\u00D3NCAVA EN LA PARTE CENTRAL SUPERIOR EN FORMA DE \\\\\\\"V\\\\\\\", DENTRO DE ESTA FIGURA NEGRA SE ENCUENTRAN DOS RECTANGULOS DE LINEA DELGADAS DE COLOR AZUL CON RELLENO COLOR NEGRO EN EL CENTRO, Y DEBAJO DE ESTOS UN CUADRADO CON LINEAS DELGADAS COLOR AZUL DE MENOR TAMA\u00D1O CON RELLENO COLOR NEGRO, DEL LADO DE LA FIGURA DE SEMI-OVALO DE COLOR CEREZO SE ENCUENTRA DEL LADO DERECHO Y EL IZQUIERDO DOS SEMIC\u00CDRCULOS DE COLOR AZUL. NOSE REIVINDICAN LOS TERMINOS GENERICOS NI DESCRIPTIVOS, SE REIVINDICA EL CONJUNTO DESCRITO.'),
(110, E'2023-000427', E'MP', E'mixta', E'3int', E'PEROS', E'PRODUCTOS COSM\u00C9TICOS Y DE TOCADOR NO MEDICINALES; DENT\u00CDFRICOS NO MEDICINALES; PERFUMER\u00CDA, ACEITES ESENCIALES; PREPARACIONES PARA BLANQUEAR Y OTRAS SUSTANCIAS PARA LAVAR LA ROPA; PREPARACIONES PARA LIMPIAR, PULIR, DESENGRASAR Y RASPAR', E'LA ETIQUETA DE LA MARCA \u201CPEROS\u201D, CONSTA DE UN LOGO CON FONDO BLANCO, EN DONDE SE OBSERVA EN LETRAS ROJAS LA PALABRA \u201CPEROS\u201D LA LETRA \u201CP\u201D EN LETRAS CARACTER\u00CDSTICAS MAY\u00DASCULAS Y LAS SIGUIENTES \u201CEROS\u201D, EN LETRAS CARACTER\u00CDSTICAS MIN\u00DASCULAS. SE REIVINDICA EL CONJUNTO DESCRITO. NO SE REIVINDICAN LOS ELEMENTOS GEN\u00C9RICOS, NI DESCRIPTIVOS.'),
(111, E'2023-000595', E'MP', E'mixta', E'5int', E'LOS LLANOS', E'PRODUCTOS FARMAC\u00C9UTICOS, PREPARACIONES PARA USO M\u00C9DICO Y VETERINARIO; PRODUCTOS HIGI\u00C9NICOS Y SANITARIOS PARA USO M\u00C9DICO; TOALLAS SANITARIOS; ALIMENTOS Y SUSTANCIAS DIET\u00C9TICAS PARA USO M\u00C9DICO O VETERINARIO, ALIMENTOS PARA BEB\u00C9S; SUPLEMENTOS ALIMENTICIOS PARA PERSONAS O ANIMALES; EMPLASTOS, MATERIAL PARA AP\u00D3SITOS; MATERIAL PARA EMPASTES E IMPRESIONES DENTALES; DESINFECTANTES; PRODUCTOS PARA ELIMINAR ANIMALES DA\u00D1INOS; FUNGICIDAS, HERBICIDAS.', E'CONSISTE EN LAS PALABRAS LOS LLANOS, EN LETRA CURSIVA, DE COLOR BLANCO, EN LETRAS MINISCULAS Y FONDO DE COLOR AZUL. SE REINVINDICA EL CONJUNTO ANTES DESCRITO.'),
(112, E'2023-000603', E'MP', E'denominativa', E'7int', E'LEO', E'M\u00C1QUINAS, M\u00C1QUINAS HERRAMIENTAS Y HERRAMIENTAS MEC\u00C1NICAS; MOTORES, EXCEPTO MOTORES PARA VEH\u00CDCULOS TERRESTRES; ACOPLAMIENTOS Y ELEMENTOS DE TRANSMISI\u00D3N, EXCEPTO PARA VEH\u00CDCULOS TERRESTRES; INSTRUMENTOS AGR\u00CDCOLAS QUE NO SEAN HERRAMIENTAS DE MANO QUE FUNCIONAN MANUALMENTE; INCUBADORAS DE HUEVOS; DISTRIBUIDORES AUTOM\u00C1TICOS.', NULL),
(113, E'2023-001213', E'MP', E'mixta', E'29int', E'LA TOSCANA', E'Leche, quesos, mantequilla, yogurt y otros productos l\u00E1cteos; aceites y grasas para uso alimenticio.', E'El signo solicitado consiste en un dise\u00F1o conformado por los siguientes elementos: Se aprecia el t\u00E9rmino LA TOSCANA en letra molde, color negro, la letra L en may\u00FAscula, un poco m\u00E1s gruesa que la letra a y rellena de color negro, en la parte derecha de dichas letras se aprecian 3 figuras que se asemejan a una hoja de un \u00E1rbol y de color negro, que tambi\u00E9n en su parte superior hay una mini separaci\u00F3n. Debajo de las letras La se aprecia el t\u00E9rmino Toscana en el cual la letra T est\u00E1n en may\u00FAscula en color negro y rellena de color negro y el resto de las letras est\u00E1n en min\u00FAsculas. Se reivindica el conjunto y colores descritos con independencia del tama\u00F1o, y no as\u00ED las palabras o t\u00E9rminos gen\u00E9ricos, todo de acuerdo a los facs\u00EDmiles que se acompa\u00F1an.'),
(114, E'2023-001290', E'MP', E'mixta', E'30int', E'CAF\u00C9 CEND\u00C9', E'CAF\u00C9, T\u00C9, CACAO, AZ\u00DACAR, ARROZ, TAPIOCA, SAG\u00DA, SUCED\u00C1NEOS DEL CAF\u00C9; HARINAS Y PREPARACIONES HECHAS DE CEREALES, PAN, PASTELER\u00CDA Y CONFITER\u00CDA, HELADOS COMESTIBLES; MIEL, PANELA DE CA\u00D1A DE AZ\u00DACAR, JARABE DE MELAZA; LEVADURA, POLVOS PARA ESPONJAR; SAL, MOSTAZA; VINAGRE, SALSAS (CONDIMENTOS); ESPECIAS; HIELO.', E'EL DISE\u00D1O SOLICITADO SE DESCRIBE DE LA SIGUIENTE MANERA: SE PRESENTA UNA FIGURA CUADRADA, QUE TIENE UN FONDO FORMADO POR DOS COLORES, NEGRO Y MARR\u00D3N OSCURO. ESTOS SE PRESENTAN, EN FORMA DEGRADADO, PUES EN LA PARTE SUPERIOR SE OBSERVA EL COLOR NEGRO, HASTA LA PARTE MEDIA, PARA LUEGO APARECER EL COLOR MARR\u00D3N OSCURO, EL CUAL PRESENTA TONALIDADES M\u00C1S OSCURAS EN FORMAS DISPERSAS. DENTRO DEL CUADRADO, SE OBSERVA EN LA PARTE SUPERIOR, SOBRE EL FONDO DE COLOR NEGRO, UN TRAZO MEDIANO DE COLOR BLANCO CURVO DE MEDIA LUNA, DE FORMA DE ARCO HACIA ABAJO. DENTRO DEL ARCO HACIA ABAJO, SE OBSERVA EL SIGNO SOLICITADO \u201CCEND\u00C9\u201D, ESCRITO CON LETRAS DE TIPO BRUSH SCRIPT CURSIVA; EN FORMA DE T\u00CDTULO, ES DECIR, LA PRIMERA LETRA ES MAY\u00DASCULA Y LAS SIGUIENTES SON MIN\u00DASCULAS. LAS LETRAS, SON DE GRAN TAMA\u00D1O, DE TRAZOS MUY GRUESO Y DE COLOR BLANCO. SOBRE EL T\u00C9RMINO \u201CCEND\u00C9\u201D, SE OBSERVA QUE SE PRESENTA ESCRITO EL T\u00C9RMINO \u201CCAF\u00C9\u201D, CON LETRAS DE TIPO IMPRENTA, EN FORMA DE T\u00CDTULO, ES DECIR, LA PRIMERA LETRA ES MAY\u00DASCULA Y LAS SIGUIENTES SON MIN\u00DASCULAS. ESTAS LETRAS SON DE UN TAMA\u00D1O PEQUE\u00D1O; DE TRAZO FINO Y DE COLOR BLANCO. EL T\u00C9RMINO \u201CCAF\u00C9\u201D, NO SE REIVINDICA POR SER GEN\u00C9RICO. DEBAJO DE TODO LO ANTES DESCRITO, JUSTO SOBRE EL FONDO DE COLOR MARR\u00D3N OSCURO, SE PRESENTA EL DIBUJO DE UN PAISAJE DE MONTA\u00D1AS. ESTE PAISAJE ESTA DIBUJADO O CONTENIDO SOBRE LA BASE DE UN TRAZO CURVO DE FORMA DE ARCO HACIA ARRIBA; DE COLOR BLANCO. SE OBSERVA QUE EL PAISAJE EST\u00C1 DIBUJADO POR TRAZOS GRUESOS DE COLOR BLANCO, LOS CUALES PRESENTAN CONTENIDAS DENTRO DE ELLAS: TONALIDADES DE GRIS CLARO, COMO SI ESTUVIESEN SOMBREADAS. EL PAISAJE VISTO DESDE LEJOS; EST\u00C1 FORMADO POR MONTA\u00D1AS QUE EST\u00C1N UNIDAS, QUE SE VEN SUS FALDAS Y CORDILLERAS, EN LOS CUALES SE APRECIAN SENDEROS, A LO LEJOS SE APRECIAN LAS LLANURAS Y SE PUEDE VER QUE AL FONDO HAY UN NACIENTE DE AGUA, YA QUE EN EL MEDIO SE OBSERVA C\u00D3MO SE FORMA UN R\u00CDO, QUE SE VA DESPLAZANDO HACIA ABAJO. TODO EL DIBUJO DE LAS MONTA\u00D1AS, LOS SENDEROS, EL RIO, EST\u00C1N DIBUJADOS POR TRAZOS MEDIANOS DE COLOR BLANCO, SOMBREADOS CON GRIS CLARO. SI SE OBSERVA EN PERSPECTIVA, Y SE VISUALIZA TODO EL CONJUNTO DESCRITO, PARECIERA QUE, TODO EL DISE\u00D1O EST\u00C1 CONTENIDO EN UN C\u00CDRCULO DE TRAZO GRUESO DE COLOR BLANCO, PERO \u00C9STE, SU BORDE NO LLEGA A UNIRSE COMPLETAMENTE, PUES SE SEPARAN EN LA PARTE MEDIA EN SUS EXTREMOS DERECHO E IZQUIERDO. SE OBSERVA TAMBI\u00C9N QUE, EN LA PARTE INFERIOR DEL DISE\u00D1O, JUSTO DEBAJO DEL TRAZO CURVO DE ARCO HACIA ARRIBA, SE VE UN PEQUE\u00D1O GRANO DE CAF\u00C9. TODO EL DISE\u00D1O SE ENCUENTRA CONTENIDO, COMO SE DESCRIBI\u00D3 ANTES, SOBRE UN FONDO DEGRADADO DE COLOR NEGRO Y DE COLOR MARR\u00D3N OSCURO. NO SE REIVINDICA LA PALABRA \u201CCAF\u00C9\u201D, POR SER UN T\u00C9RMINO GEN\u00C9RICO. POR LO DEM\u00C1S, SE REIVINDICA LOS COLORES Y TODO SU CONTENIDO.'),
(115, E'2023-001320', E'MS', E'grafica', E'35int', NULL, E'Servicios de venta al por menor en l\u00EDnea de prendas de vestir, calzado, sombrerer\u00EDa, art\u00EDculos deportivos y accesorios; Servicios de venta al por menor de prendas de vestir, calzado, sombrerer\u00EDa, art\u00EDculos deportivos y accesorios; Servicios de venta al por menor en l\u00EDnea de productos virtuales, a saber, prendas de vestir, calzado, sombrerer\u00EDa, art\u00EDculos deportivos y accesorios para su uso en mundos virtuales en l\u00EDnea; Servicios de venta al por menor de productos virtuales, a saber, prendas de vestir, calzado, sombrerer\u00EDa, art\u00EDculos deportivos y accesorios para su uso en mundos virtuales en l\u00EDnea.', E'El signo solicitado consiste en un dise\u00F1o conformado por los siguientes elementos: Se aprecian dos figuras las cuales se asemejan a arcos de color negro, uno de ellos est\u00E1 viendo hacia la parte superior y el otro hacia la parte inferior, los mismo son de delineado grueso en sus extremos y rellenos en los mismos y se hacen m\u00E1s delgado en su centro donde se encuentran entrelazados. Se reivindica el conjunto y colores descritos con independencia del tama\u00F1o, y no as\u00ED las palabras o t\u00E9rminos gen\u00E9ricos, todo de acuerdo a los facs\u00EDmiles que se acompa\u00F1an.'),
(116, E'2023-001378', E'MP', E'denominativa', E'30int', E'MIARROZ', E'CAF\u00C9, T\u00C9, CACAO Y SUCED\u00C1NEOS DEL CAF\u00C9; ARROZ, PASTAS ALIMENTICIAS Y FIDEOS; TAPIOCA Y SAG\u00DA; HARINAS Y PREPARACIONES A BASE DE CEREALES; PAN, PRODUCTOS DE PASTELER\u00CDA Y CONFITER\u00CDA; CHOCOLATE; HELADOS CREMOSOS, SORBETES Y OTROS HELADOS; AZ\u00DACAR, MIEL, JARABE DE MELAZA; LEVADURA, POLVOS DE HORNEAR; SAL, PRODUCTOS PARA SAZONAR, ESPECIAS, HIERBAS EN CONSERVA; VINAGRE, SALSAS Y OTROS CONDIMENTOS; HIELO.', NULL),
(117, E'2023-001718', E'MS', E'mixta', E'38int', E'REDDOT', E'SERVICIOS DE TELECOMUNICACIONES.', E'EL SIGNO SOLICITADO CONSISTE EN LA PALABRA REDDOT, EN COLOR NEGRO Y EN LETRA MOLDE, SIENDO QUE LA R Y LA SEGUNDA D SE ENCUENTRAN ESCRITAS EN MAY\u00DASCULAS. ASIMISMO, SE OBSERVA QUE LA LETRA O, ES REPRESENTADA COMO UNA FIGURA CIRCULAR, DE COLOR ROJO, CON CINCO PEQUE\u00D1OS C\u00CDRCULOS BLANCOS Y CUATRO L\u00CDNEAS DELGADAS INTERCONECTADAS ENTRE S\u00CD EN SU INTERIOR. NO SE REIVINDICAN LAS EXPRESIONES GEN\u00C9RICAS O DE USO COM\u00DAN QUE PUEDAN FORMAR PARTE DEL DISE\u00D1O. SE REIVINDICA EL CONJUNTO DESCRITO. (TRADUCCI\u00D3N DE REDDOT: PALABRA DE FANTASIA).'),
(118, E'2023-001798', E'MP', E'mixta', E'16int', E'GRUPO MC', E'COMPRENDE PRINCIPALMENTE EL PAPEL, LOS PRODUCTOS DE PAPEL Y LOS ART\u00CDCULOS DE OFICINA.', E'LA ETIQUETA CONSISTE EN EL LOGO DE LA MARCA GRUPO MC, UN CL\u00DASTER TUR\u00CDSTICO CONFORMADO POR UNA RED DE NEGOCIOS Y SERVICIOS INTEGRADA POR M\u00DALTIPLES AGENCIAS DE VIAJE, UN OPERADOR TUR\u00CDSTICO RECEPTIVO Y EMISOR Y UNA UNIDAD DEDICADA A LA ASESOR\u00CDA DE EMPRENDEDORES Y PYMES DEL SECTOR. EL LOGO ESTA CONFORMADO POR LA PALABRA GRUPO EN COLOR GRIS Y UN RECUADRO CON LAS INICIALES MC, LAS LETRAS CORRESPONDEN A LAS INICIALES DEL SR. MIGUEL CLERCH REPRESENTANTE DE LA MARCA. GRUPO SE REFIERE A QUE LA MARCA AGRUPA A DOS MARCAS (MCAIR Y MC TOURS) AMBAS YA REGISTRADAS. COLOR AZUL PANTONE: 7463C Y COLOR GRIS PANTONE 424C Y LA TIPOGRAF\u00CDA: HELVETICA NEUE.'),
