ES Y LA CORRIENTE EL\u00C9CTRICA; INVERSORES, CONVERTIDORES PARA GENERACI\u00D3N DE ENERG\u00CDA SOLAR; SOPORTES DE INVERSORES PARA LA GENERACI\u00D3N DE ENERG\u00CDA SOLAR; CONECTORES EL\u00C9CTRICOS PARA GENERACI\u00D3N DE ENERG\u00CDA SOLAR; APARATOS PARA INSPECCIONAR INSTALACIONES DE GENERACI\u00D3N DE ENERG\u00CDA SOLAR; CONVERTIDORES DIRECTOS DE ENERG\u00CDA SOLAR; DISPOSITIVOS DE ALMACENAMIENTO DE ENERG\u00CDA SOLAR; BATER\u00CDAS SOLARES; PANELES DE C\u00C9LULAS SOLARES; SOFTWARE DE COMPUTADORA PARA MEJORAR LAS CAPACIDADES AUDIOVISUALES DE APLICACIONES MULTIMEDIA, ESPECIALMENTE, PARA LA INTEGRACI\u00D3N DE TEXTO, AUDIO, GR\u00C1FICOS, IM\u00C1GENES E IM\u00C1GENES EN MOVIMIENTO; ROBOTS DE TELEPRESENCIA; EQUIPO DE COMUNICACIONES; CONECTORES PARA ENCHUFAR; CAMBIADORES DE EFECTIVO; SOFTWARE DE COMPUTADORA PARA COMUNICARSE CON USUARIOS DE DISPOSITIVOS PORT\u00C1TILES.', E'LA ETIQUETA TIENE COMO ELEMENTO PRINCIPAL LAS LETRAS \u201CHD\u201D, EN LETRA TIPO MOLDE, DE TRAZO GRUESO, EN LETRAS MAY\u00DASCULAS Y DE COLOR AZUL. EN LA PARTE IZQUIERDA SE PUEDE OBSERVAR UNA IMAGEN QUE ASEMEJA SER UNA FLECHA GEOM\u00C9TRICA, LA CUAL SE ENCUENTRA APUNTANDO HACIA LAS LETRAS \u201CHD\u201D, CON UN DEGRADADO DE COLOR VERDE QUE VA DE LA SIGUIENTE MANERA: EN LA PARTE SUPERIOR UN COLOR VERDE CLARO, LUEGO UN VERDE MEDIO Y, POSTERIORMENTE, UN VERDE M\u00C1S OSCURO. TODO EL CONJUNTO ANTERIORMENTE DESCRITO SE OBSERVA SOBRE UN FONDO BLANCO. SE REIVINDICA EL CONJUNTO ANTERIORMENTE DESCRITO, Y LA COMBINACI\u00D3N DE COLORES SEG\u00DAN SE DESCRIBE. LA DESCRIPCI\u00D3N DE COLORES SE HA HECHO EN CUMPLIMIENTO AL AVISO OFICIAL S/N EMANADO DEL REGISTRO DE LA PROPIEDAD INTELECTUAL FECHADO 18 DE NOVIEMBRE DE 1996.'),
