(122, E'2023-001981', E'MS', E'mixta', E'35int', E'MULTIMALL CENTER', E'COMPRENDE PRINCIPALMENTE LOS SERVICIOS QUE IMPLICAN LA GESTI\u00D3N, LA EXPLOTACI\u00D3N, LA ORGANIZACI\u00D3N Y LA ADMINISTRACI\u00D3N COMERCIAL DE UNA EMPRESA COMERCIAL O INDUSTRIAL, AS\u00CD COMO LOS SERVICIOS DE PUBLICIDAD, MARKETING Y PROMOCI\u00D3N. EN CONCLUSI\u00D3N, COMPRENDE LOS SERVICIOS PARA EL AGRUPAMIENTO, POR CUENTA DE TERCEROS, DE UNA AMPLIA GAMA DE PRODUCTOS, EXCEPTO SU TRANSPORTE, PARA QUE LOS CONSUMIDORES PUEDAN VERLOS Y ADQUIRIRLOS CON COMODIDAD; ESTOS SERVICIOS PUEDEN SER PRESTADOS POR COMERCIOS MINORISTAS O MAYORISTAS, DISTRIBUIDORES AUTOM\u00C1TICOS, CAT\u00C1LOGOS DE VENTA POR CORRESPONDENCIA O MEDIOS DE COMUNICACI\u00D3N ELECTR\u00D3NICOS TALES COMO SITIOS WEB O PROGRAMAS DE TELEVENTA.', E'ETIQUETAS: EL DISE\u00D1O DE LA MARCA CONSISTE EN UNA ETIQUETA DE FONDO BLANCO, APRECI\u00C1NDOSE EN LA PARTE IZQUIERDA UNA FIGURA FANTASIOSA DE UN CARRITO DE SUPERMERCADO DE BORDE AZUL OSCURO, EL INTERIOR DEL CARRITO ES DE COLOR BLANCO Y SE OBSERVAN DOS FIGURAS SIMILARES A UN TRAPECIO, LA FIGURA DEL LADO IZQUIERDO ES DE COLOR NARANJA Y LA FIGURA DEL LADO DERECHO ES DE COLOR AMARILLO; SE APRECIA EN LA PARTE DERECHA DE LA ETIQUETA LA PALABRA \u201CMULTIMALL\u201D COMPUESTA CON EL PREFIJO \u201CMULTI\u201D PARA HACER REFERENCIA A \u201CMUCHOS\u201D Y LA PALABRA DE ORIGEN INGL\u00C9S \u201CMALL\u201D CUYA TRADUCCI\u00D3N AL ESPA\u00D1OL ES \u201CVARIEDAD DE TIENDAS Y RESTAURANTES\u201D, EN LETRA MOLDE, MIN\u00DASCULA Y COLOR AZUL, SE PUEDE DETALLAR QUE EL INTERIOR DE LA LETRA \u201CM\u201D ES DE COLOR AMARILLO Y EL INTERIOR DE LA LETRA \u201CA \u201CES DE TIENE COLOR NARANJA, DEBAJO SE OBSERVA LA PALABRA DE ORIGEN INGL\u00C9S \u201CCENTER\u201D CUYA TRADUCCI\u00D3N AL ESPA\u00D1OL ES \u201CCENTRO\u201D EN LETRA MOLDE, MIN\u00DASCULA Y COLOR AMARILLO. SE REIVINDICA EL CONJUNTO DESCRITO A EXCEPCI\u00D3N DE LOS T\u00C9RMINOS GEN\u00C9RICOS QUE FORMAN PARTE DEL MISMO.'),
(123, E'2023-001982', E'MS', E'mixta', E'35int', E'SARITA', E'Servicios de publicidad; gesti\u00F3n, organizaci\u00F3n y administraci\u00F3n de negocios comerciales en las \u00E1reas de venta, comercializaci\u00F3n y promoci\u00F3n de productos de perfumer\u00EDa y cosm\u00E9ticos, incluyendo perfumes, aguas de colonias, maquillaje, cremas, productos de tocador, cosm\u00E9ticos perfumados, jabones y cremas para el cuidado de la cara y el cuerpo; trabajos de oficina; servicios de ventas al detal o al por menor (tiendas minoristas) de perfumes y cosm\u00E9ticos, incluyendo perfumes, aguas de colonias, maquillaje, cremas, productos de tocador, cosm\u00E9ticos perfumados, jabones y cremas para el cuidado de la cara y el cuerpo; servicios de venta al detal o al por menor en l\u00EDnea de perfumes y cosm\u00E9ticos, incluyendo perfumes, aguas de colonias, maquillaje, cremas, productos de tocador, cosm\u00E9ticos perfumados, jabones y cremas para el cuidado de la cara y el cuerpo; servicios de franquicias, incluidas franquicias de tiendas y comercios minoristas, servicios prestados por un franquiciador, en concreto asistencia en la explotaci\u00F3n o gesti\u00F3n de empresas industriales o comerciales; asistencia en la direcci\u00F3n de negocios; consultor\u00EDa en la organizaci\u00F3n de negocios; servicios de promoci\u00F3n, comercializaci\u00F3n y ventas de productos y servicios de terceros mediante la distribuci\u00F3n de material impreso y concursos de promoci\u00F3n; consultor\u00EDa en la organizaci\u00F3n de negocios; servicios de venta por correspondencia, ventas en l\u00EDnea o a trav\u00E9s de una red global de computadoras y venta en reuniones en domicilios particulares.', E'La marca mixta cuyo registro se solicita, consiste en un c\u00EDrculo o circunferencia de fondo color negro, en cuya parte superior se observa otra circunferencia de color blanco dividida en dos partes iguales por una l\u00EDnea horizontal de color negro, con la peculiaridad que dentro de cada parte segmentada se observa una especie de figura que semeja ser una gota en posici\u00F3n horizontal de color negro, en la parte superior dicha gota est\u00E1 alineada al extremo derecho y en la parte inferior est\u00E1 alineada al extremo izquierdo, en su conjunto dicha circunferencia semeja ser el dise\u00F1o fantasioso de la letra S. Justo debajo del dise\u00F1o de la letra S, se encuentra la marca SARITA escrita en letras may\u00FAsculas y en color blanco. Se reivindica el conjunto descrito, los colores se\u00F1alados conforme a los facs\u00EDmiles que se acompa\u00F1an.'),
(124, E'2023-002094', E'MP', E'mixta', E'31int', E'AIKOZ', E'Productos agr\u00EDcolas, acu\u00EDcolas, hort\u00EDcolas y forestales en bruto y sin procesar; granos y semillas en bruto o sin procesar; frutas y verduras, hortalizas y legumbres frescas, hierbas arom\u00E1ticas frescas; plantas y flores naturales; bulbos, plantones y semillas para plantar; animales vivos; productos alimenticios y bebidas para animales; malta', E'CONSISTE EN UN RECT\u00C1NGULO DE COLOR BLANCO, DENTRO DE ESTE SE ENCUENTRA LA PALABRA DE FANTAS\u00CDA AIKOZ, EN UNA TIPOGRAF\u00CDA ESPECIAL, LA LETRA A Y Z CONSISTE EN UN RECT\u00C1NGULO DE COLOR BLANCO, DENTRO DE ESTE SE ENCUENTRA LA PALABRA DE FANTAS\u00CDA AIKOZ, EN UNA TIPOGRAF\u00CDA ESPECIAL, LA LETRA A Y Z EST\u00C1N DE COLOR AMARILLO MOSTAZA Y LAS LETRAS I, K Y O EST\u00C1N DE COLOR VERDE CLARO, A EXCEPCI\u00D3N DEL PUNTO QUE SE ENCUENTRA ARRIBA DE LA I , QUE ESTA DE COLOR AMARILLO MOSTAZA. DEBAJO DE LA PALABRA DE FANTAS\u00CDA SE ENCUENTRA UNA LINEA EN FORMA DE MEDIA LUNA DE COLOR VERDE CLARO. SE REIVINDICA EL CONJUNTO ANTERIORMENTE DESCRITO Y LA COMBINACI\u00D3N DE COLORES SE HA HECHO EN CUMPLIMIENTO AL AVISO OFICIAL S/N EMANADO DEL REGISTRO DE LA PROPIEDAD INTELECTUAL FECHA 18 DE NOVIEMBRE DE 1996'),
(125, E'2023-002125', E'MP', E'mixta', E'1int', E'GREEN TIDE EXTRACTO DE ALGA', E'Productos qu\u00EDmicos para la industria, la ciencia y la fotograf\u00EDa, as\u00ED como para la agricultura, la horticultura y la silvicultura; resinas artificiales en bruto, materias pl\u00E1sticas en bruto; composiciones para la extinci\u00F3n de incendios y la prevenci\u00F3n de incendios; preparaciones para templar y soldar metales; sustancias para curtir cueros y pieles de animales; adhesivos (pegamentos) para la industria; masillas y otras materias de relleno en pasta; compost, abonos, fertilizantes; preparaciones biol\u00F3gicas para la industria y la ciencia.', E'CONSISTE EN UN LOGOTIPO RECTANGULAR DE COLOR VERDE CLARO CON LA PARTICULARIDAD DE TENER LOS BORDE REDONDEADOS DENTRO DEL MENCIONADO LOGOTIPO SE OBSERVA UN ARBOL DE COLOR VERDE ENCERRADO EN UN CIRCULO DE FONDO BLANCO EN LA PARTE SUPERIOR DE DICHA FIGURA SE OBSERVAN OTRAS FIGURAS SEMEJANDO SER UNAS HOJAS DE DIFERENTES TAMA\u00D1OS DE COLOR VERDE, EN LA PARTE INFERIOR UNAS FIGURAS SEMEJANDO SER LAS RAICES DEL MENCIONADO ARBOL, A UN LADO SE OBSERVA LAS PALABRAS GREEN TIDE (GREEN TIDE=MAREA VERDE) ESCRITA EN LETRAS GRUESAS DE COLOR BLANCO DEBAJO SE OBSERVAN ESCRITA LAS PALABRAS EXTRACTO DE ALGA (PALABRAS DE FANTASIA ), ESCRITAS EN LETRAS FINAS DE COLOR BLANCO. LOS COLORES SE MENCIONAN A EFECTOS DE DESCRIBIR EL CONJUNTO DESCRITO.'),
(126, E'2023-002215', E'MP', E'denominativa', E'5int', E'PRONOV', E'FORMULACIONES BACTERIANAS PROBI\u00D3TICAS PARA USO VETERINARIO Y PARA SUPLEMENTOS DIET\u00C9TICOS PARA ANIMALES.', NULL),
(127, E'2023-002412', E'MP', E'mixta', E'3int', E'EMELIE', E'PERFUMER\u00CDA. C\u00D3SMETICOS, ACEITES ESENCIALES, JABONES COSM\u00C9TICOS, SPLASH.', E'EL MENCIONADO DISE\u00D1O CONSISTE EN UNA ETIQUETA DE FONDO ESCARCHADO EN COLOR NEGRO EN CUYA PARTE C\u00C9NTRICA SE ESCRIBE LA PALABRA "EMELIE" (NOMBRE DE FANTAS\u00CDA) EN LETRA MOLDE DE TRAZO FINO EN COLOR DORADO, SE DESTACA LA LETRA "M" DE LA MENCIONADA PALABRA LA CUAL SE CONFORMA DE DOS ARCOS UNIDOS ENTRE SI PARA AS\u00CD HACER ALUSI\u00D3N A LA LETRA, SE REIVINDICA TODO LO AQU\u00CD DESCRITO Y COLORES MENOS LO QUE PODR\u00CDA CONSIDERARSE COMO GEN\u00C9RICO.'),
(128, E'2023-002471', E'NC', E'mixta', E'46int', E'LA SANAHORIA', E'ESTABLECIMIENTO COMERCIAL DEDICADO A LA VENTA, FABRICACI\u00D3N, COMERCIALIZACI\u00D3N, DISTRIBUCI\u00D3N, EXPENDIO EN GENERAL DE ALIMENTOS Y BEBIDAS.', E'El signo solicitado consiste en un dise\u00F1o conformado por los siguientes elementos: Se aprecia el t\u00E9rmino LA SANAHORIA escrita en letra molde, may\u00FAscula de color negro, en la parte superior del mismo se observa un figura la cual se asemeja a una pir\u00E1mide invertida, cuya punta inferior es ovalada, dicha pir\u00E1mide es de color negro e internamente posee m\u00FAltiples rect\u00E1ngulos de color blanco, m\u00E1s arriba se aprecian dos flechas de color negro, las cuales apuntan hacia la parte superior central del logo descrito anteriormente. Se reivindica el conjunto y colores descritos con independencia del tama\u00F1o, y no as\u00ED las palabras o t\u00E9rminos gen\u00E9ricos, todo de acuerdo a los facs\u00EDmiles que se acompa\u00F1an.'),
