(131, E'2023-002766', E'MP', E'mixta', E'29int', E'MANGUANGUA', E'Hortalizas y legumbres en conserva, congeladas, secas y cocidas; jaleas.', E'CONSISTE EN UN CUADRADO DE COLOR AZUL CLARO EN EL CUAL DESTACA LA IMAGEN DE UNA FRUTA CON FORMA DE CORAZ\u00D3N DE BORDES GRUESOS EN COLOR BLANCO CUYAS HOJAS EST\u00C1N DELINEADAS IGUALMENTE EN COLOR BLANCO. DEBAJO DE ESTA DESTACA EL TERMINO MANGUANGUA ESCRITO EN LETRA CARACTER\u00CDSTICA EN COLOR BLANCO Y EN LETRA MIN\u00DASCULA. MANGUANGUA= COSA O ASUNTO QUE NO PRESENTA DIFICULTAD SE REIVINDICA EL CONJUNTO DESCRITO Y SE REIVINDICAN LOS COLORES NO AS\u00CD LOS ELEMENTOS GEN\u00C9RICOS.'),
(132, E'2023-002860', E'NC', E'mixta', E'46int', E'ARQOS', E'UNA SOCIEDAD MERCANTIL DEDICADA A LA EXPLOTACI\u00D3N EN TODAS SUS FORMAS DEL RAMO INMOBILIARIO, COMPRA VENTA DE BIENES RA\u00CDCES, INVERSIONES DE TODO TIPO, INTERMEDIACIONES FINANCIERAS, CONSTRUCCIONES, PLANIFICACI\u00D3N Y VENTA, INVERSIONES EN BIENES RA\u00CDCES, AS\u00CD COMO LA PROMOCI\u00D3N, ORGANIZACI\u00D3N Y DESARROLLO DE NUEVAS EMPRESAS PARA LA PRODUCCI\u00D3N DE BIENES Y SERVICIOS; SERVICIOS DE ARRENDAMIENTO INMOBILIARIO; REPRESENTACI\u00D3N O AGENCIA DE OTRAS FIRMAS O PERSONAS NACIONALES O EXTRANJERAS.', E'EL SIGNO SOLICITADO CONSISTE EN EL DISE\u00D1O DE LA PALABRA "ARQOS" ESCRITO EN LETRA MOLDE, EN MAY\u00DASCULAS Y DE COLOR BLANCO, ESTANDO CADA LETRA EN EL INTERIOR DE UN CUADRADO DE COLOR NEGRO. NO SE REIVINDICAN LAS EXPRESIONES GEN\u00C9RICAS O DE USO COM\u00DAN QUE PUEDAN FORMAR PARTE DEL DISE\u00D1O. SE REIVINDICA EL CONJUNTO DESCRITO. ARQOS: PALABRA DE FANTAS\u00CDA.'),
(133, E'2023-002864', E'MP', E'grafica', E'9int', NULL, E'TRANSFORMADORES DE VOLTAJE; ACONDICIONADORES DE ENERG\u00CDA; UNIDADES DE POTENCIA [BATER\u00CDAS]; DISTRIBUIDORES DE ENERG\u00CDA [EL\u00C9CTRICA]; CONVERTIDORES EL\u00C9CTRICOS; APARATOS DE ALMACENAMIENTO DE ELECTRICIDAD; APARATOS E INSTRUMENTOS PARA ACUMULAR ELECTRICIDAD; APARATOS E INSTRUMENTOS PARA TRANSFORMAR ELECTRICIDAD; DISPOSITIVOS EL\u00C9CTRICOS DE CONTROL PARA LA GESTI\u00D3N DE LA ENERG\u00CDA; APARATOS E INSTRUMENTOS PARA ACUMULAR Y ALMACENAR ELECTRICIDAD; DISPOSITIVOS DE CARGA DE BATER\u00CDAS PARA VEH\u00CDCULOS DE MOTOR.', E'CONSISTE EN UNA ETIQUETA CUADRADA DE FONDO BLANCO EN LA QUE SE OBSERVA UNA FIGURA IRREGULAR QUE SE ASEMEJA A DOS FLECHAS ROJAS APUNTANDO CADA UNA HACIA EL CENTRO DEL CONJUNTO, UNIDAS POR UNA L\u00CDNEA SEMICIRCULAR DEL MISMO COLOR. SE REIVINDICA EL CONJUNTO DESCRITO.'),
(134, E'2023-002917', E'MP', E'mixta', E'30int', E'Gansito', E'Preparaciones hechas a base de cereal, pan, pasteles y galletas, bebidas a base de chocolate.', E'El signo solicitado consiste en un dise\u00F1o conformado por los siguientes elementos: Se aprecia el t\u00E9rmino GANSITO escrita en letra molde, en color negro, posicionada en diagonal, con un borde y fondo de color blanco; siendo que la letra G se encuentra en may\u00FAscula y el resto en min\u00FAscula. Todo el conjunto descrito reposa sobre un ovalo horizontal, posicionado en diagonal y de fondo color fucsia, con un trazado en el borde del ovalo en color azul. Se reivindica el conjunto y colores descritos con independencia del tama\u00F1o, y no as\u00ED las palabras o t\u00E9rminos gen\u00E9ricos, todo de acuerdo a los facs\u00EDmiles que se acompa\u00F1an.'),
