(136, E'2023-003045', E'MP', E'mixta', E'30int', E'CHUCHO CAFE', E'CAFE Y SUCEDANEOS DEL CAFE.', E'CONSISTE EN UN LOGOTIPO DE FONDO NEGRO, EN LA PARTE SUPERIOR SE APRECIA UN CIRCUNFERENCIA Y DENTRO SE VE UN BUSTO DE UN HOMBRE CON BARBA Y BIGOTE NEGRO, CABELLO NEGRO Y CON CORTE POR LA MITAD DE LA CABEZA Y PINTAS EN DORADO DEGRADADO, ENCIMA DE SU CABEZA SE APRECIA LO QUE SE SUPONE ES UN MANTO EN COLOR DORADO DEGRADADO, LA CIRCUNFERENCIA POR DENTRO ES DE COLOR DORADO EN DEGRADE; EN LA PARTE INFERIOR SE LEE CHUCHO EN CARACTERES ESTILIZADO Y COLOR DORADO EN DEGRADE, LA LETRA O ESTA REPRESENTADA POR UN GRANO DE CAFE EN COLOR DORADO, DEBAJO DE ESTO SE LEE CAFE (NO SE REIVINDICA) EN CARACTERES ESTILIZADOS Y COLOR DORADO EN DEGRADE Y SOBRE LA E UNA TILDE EN COLOR DORADO, SE REIVINDICA EL CONJUNTO DESCRITO, EN CUANTO A TERMINOS, COLORES Y FIGURAS, MENOS EL TERMINO CAFE.'),
(137, E'2023-003168', E'MP', E'grafica', E'30int', NULL, E'CAF\u00C9; BEBIDAS A BASE DE CAF\u00C9; BEBIDAS A BASE DE T\u00C9; T\u00C9; AZ\u00DACAR; MELAZA PARA LA ALIMENTACI\u00D3N; PASTELER\u00CDA; PUDINES; SUSHI; PREPARACIONES DE CEREALES; FIDEOS; APERITIVOS A BASE DE CEREALES; ALMID\u00D3N PARA LA ALIMENTACI\u00D3N; HELADOS; CONDIMENTOS; LEVADURA; PREPARACIONES AROM\u00C1TICAS PARA LA ALIMENTACI\u00D3N; PREPARACIONES PARA ENDURECER LA NATA MONTADA; ABLANDADORES DE CARNE CON FINES CULINARIOS; GLUTEN PREPARADO COMO PRODUCTO ALIMENTICIO.', E'EL SIGNO QUE SE PRESENTA A CONTINUACI\u00D3N SE ENCUENTRA CONFORMADO POR EL DIBUJO DE UN HOMBRE DE NIEVE DE COLOR BLANCO Y BORDES NEGROS, QUE LLEVA PUESTA UNA CAPA DE COLOR GRIS Y BORDES NEGROS Y UNA CORONA, IGUALMENTE, DE COLOR BLANCO Y BORDES NEGROS. EN LA MANO DERECHA, SOSTIENE UN CETRO QUE SE ASEMEJA A UN HELADO DE BARQUILLA, DE BORDES DE COLOR NEGRO, RELLENO DE COLORES BLANCO Y GRIS. TODO EL SIGNO SE ENCUENTRA SOBRE UN FONDO DE COLOR BLANCO. SE REIVINDICA EL CONJUNTO DESCRITO EN SU TOTALIDAD SIN REIVINDICAR NING\u00DAN ELEMENTO QUE PUEDA SER CONSIDERADO GEN\u00C9RICO O DESCRIPTIVO EN LA CLASE SOLICITADA.'),
(138, E'2023-003316', E'MP', E'mixta', E'29int', E'MAVESA', E'ACEITES Y GRASAS COMESTIBLES, MARGARINAS', E'LA ETIQUETA TIENE COMO ELEMENTO PRINCIPAL LA PALABRA DE FANTAS\u00CDA \u201CMAVESA\u201D, EN LETRA TIPO MOLDE, DE GRAN TAMA\u00D1O, DE TRAZO GRUESO, EN MIN\u00DASCULAS Y DE COLOR PANTONE 287 C; TAMBI\u00C9N SE PUEDE OBSERVAR QUE LAS LETRAS \u201CE\u201D Y \u201CS\u201D TIENEN UNA TERMINACI\u00D3N IRREGULAR. LA PALABRA DE FANTAS\u00CDA, SE ENCUENTRA ENCIMA DE UNA FIGURA QUE ASEMEJA SER UNA ESPECIE DE ONDA DE COLOR PANTONE 151 C. DEBAJO DE LA PALABRA DE FANTAS\u00CDA, SE OBSERVA UNA IMAGEN QUE ASEMEJA SER UN ART\u00CDCULO DE COCINA COMO ES EL SART\u00C9N, SALTEANDO VEGETALES, ENTRE LOS QUE SE OBSERVAN: PIMENT\u00D3N, CEBOLLA Y CHAMPI\u00D1ONES. EN LA BASE DE LA IMAGEN, SE OBSERVAN UNOS TRAZOS DE COLOR VERDE CLARO EN FORMA DE ONDAS Y COLOR VERDE OSCURO EL FONDO. SE REIVINDICA EL CONJUNTO ANTERIORMENTE DESCRITO.'),
(139, E'2023-003457', E'MS', E'mixta', E'41int', E'ASTRO100', E'ADMINISTRACI\u00D3N DE JUEGOS DE LOTER\u00CDAS, SERVICIOS DE JUEGOS INFORM\u00C1TICOS EN LINEA.', E'LA PRESENTE ETIQUETA ESTA REPRESENTADA EN CONJUNTO POR LETRAS MAS N\u00DAMEROS ASTRO100, ESCRITAS SUS LETRAS EN COLOR AZUL TENIENDO COMO PARTICULARIDAD UNA ABERTURA EN SU PARTE INFERIOR DE LA LETRA O OBSERV\u00C1NDOSE UNA PEQUE\u00D1A ESTRELLA CON SU DESTELLO EN SUSTITUCI\u00D3N DE SU ESPACIO INTERNO, BORDEADAS EN SU ENTORNO POR UNA LINEA DE COLOR GRIS UNIENDO ESTA CON EL NUMERO 100 SIENDO ESTE DE COLOR NEGRO CON EL MISMO BORDE QUE LOS UNI\u00D3 EN COLOR GRIS, SE REIVINDICA EL CONJUNTO DESCRITO MAS LOS COLORES MENCIONADOS.'),
