(141, E'2023-003524', E'MS', E'mixta', E'35int', E'AGRO SIM\u00D3N SEMBRAMOS AGRONEGOCIOS', E'Servicios de publicidad; servicios de gesti\u00F3n, organizaci\u00F3n y administraci\u00F3n de negocios comerciales en las \u00E1reas agr\u00EDcola y pecuaria, incluyendo gesti\u00F3n, organizaci\u00F3n y administraci\u00F3n de negocios en las \u00E1reas de siembra de productos del reino vegetal, cultivo y cosecha de productos alimenticios, as\u00ED como de comercializaci\u00F3n y venta al detal de agua de manantial, semillas, frutas, hortalizas, tub\u00E9rculos, huevos, productos l\u00E1cteos incluyendo leche, queso, mantequilla, ganado en pie y por cortes, carne vacuna, carne porcina, de caza y de ave; servicios de venta minorista (al detal) y servicios de ventas al mayor de toda clase de productos alimenticios, incluyendo frutas, productos l\u00E1cteos, hortalizas, productos l\u00E1cteos incluyendo leche, queso, mantequilla, carnes vacuna, porcina y de ave, carne de caza, servicios de venta minorista de agua de manantial, mineral o gasificada; servicios de promoci\u00F3n, mercadeo, comercializaci\u00F3n y venta de productos agr\u00EDcolas o pecuarios, incluyendo, semillas para viveros, plantas y otros productos agr\u00EDcolas; servicios de consultor\u00EDa sobre direcci\u00F3n de negocios; servicios de consultor\u00EDa sobre organizaci\u00F3n de negocios; servicios de consultor\u00EDa profesional sobre negocios comerciales; servicios de consultor\u00EDa en estrategias de comunicaci\u00F3n [relaciones p\u00FAblicas]; trabajos de oficina.', E'LA MARCA MIXTA CUYO REGISTRO SE SOLICITA, EST\u00C1 CONFORMADO POR UNA ETIQUETA DE FONDO COLOR BLANCO, EN CUYA PARTE SUPERIOR SE OBSERVA UNA CIRCUNFERENCIA DE FONDO COLOR BLANCO, DE TRAZO DELGADO DE COLOR AZUL (PANTONE 7470 C) Y DENTRO DE LA CUAL SE ENCUENTRAN CUATRO DISE\u00D1OS, EN EL EXTREMO SUPERIOR IZQUIERDO OBSERVAMOS UNA IMAGEN QUE SEMEJA SER UNA L\u00C1GRIMA CON SU EXTREMO DERECHO RECTO Y EL OTRO EN FORMA DE ARCO EN COLOR VERDE (PANTONE 7732 C), EN EL EXTREMO SUPERIOR DERECHO SE OBSERVA LO QUE SEMEJA SER UNA CABEZA DE GANADO EN COLOR GRIS (PANTONE COOL GRAY 9 C), EN EL EXTREMO INFERIOR IZQUIERDO OBSERVAMOS LA IMAGEN FANTASIOSA DE DOS RAMAS U HOJAS DE PALMA DE COLOR VERDE (PANTONE 7732 C), CON LA PARTICULARIDAD QUE UNA DE LAS HOJAS DE PALMA SOBRESALE LEVEMENTE DE LA CIRCUNFERENCIA Y EN EL EXTREMO DERECHO LA IMAGEN DE UNA L\u00C1GRIMA INVERTIDA CON SU EXTREMO IZQUIERDO RECTO Y EL EXTREMO DERECHO EN FORMA DE ARCO EN COLOR AZUL (PANTONE 7470 C). DEBAJO DE ESTA CIRCUNFERENCIA, SE ENCUENTRA EL ELEMENTO DENOMINATIVO DE LA MARCA CONFORMADO POR EL T\u00C9RMINO AGROSIM\u00D3N ESCRITO EN LETRAS MAY\u00DASCULAS, EN COLOR NEGRO, CON LA PARTICULARIDAD QUE LA LETRA A DE AGRO Y S DE SIM\u00D3N SOBRESALEN LEVEMENTE DEL RESTO DEL CONJUNTO. DEBAJO DE ESTE SIGNO SE OBSERVA UNA L\u00CDNEA RECTA DE COLOR AZUL (PANTONE 7470 C) CON DOS ROMBOS EN SUS EXTREMOS. SE REIVINDICA EL CONJUNTO DESCRITO Y LOS COLORES SE\u00D1ALADOS CONFORME A LOS FACS\u00CDMILES QUE SE ACOMPA\u00D1AN.'),
