(145, E'2023-003881', E'MS', E'denominativa', E'35int', E'VCRenewables', E'Servicios de asistencia y consultor\u00EDa en el \u00E1mbito de la gesti\u00F3n empresarial de empresas del sector energ\u00E9tico; Adquisici\u00F3n de contratos relativos al suministro de energ\u00EDa; Servicios de consultor\u00EDa de gesti\u00F3n y servicios de consultor\u00EDa empresarial en el \u00E1mbito de la energ\u00EDa procedente de fuentes renovables; Servicios de venta al por menor relativos a bater\u00EDas y sistemas de almacenamiento de energ\u00EDa y bater\u00EDas fuera de la red; Servicios de adquisici\u00F3n para terceros (compra de bienes y servicios para otras empresas) en el \u00E1mbito de la adquisici\u00F3n de energ\u00EDa y almacenamiento en bater\u00EDas; Adquisici\u00F3n de transacciones comerciales y contratos para terceros en el \u00E1mbito del almacenamiento de energ\u00EDa y bater\u00EDas, incluida la adquisici\u00F3n de contratos relativos a la capacidad de almacenamiento de energ\u00EDa, almacenamiento de energ\u00EDa en redes de suministro y capacidades de almacenamiento para terceros; Gesti\u00F3n comercial para terceros relativa a dispositivos e instalaciones que almacenan energ\u00EDa el\u00E9ctrica.', NULL),
