(152, E'2023-004719', E'MP', E'mixta', E'29int', E'MERLIN', E'CARNE, PESCADO, CARNE DE AVE Y CARNE DE CAZA; EXTRACTOS DE CARNE.', E'CONSISTE EN LA FIGURA DE UN SOMBRERO PUNTIAGUDO, DE FONDO COLOR ROJO, CON DOS BORDES FINOS COLOR BLANCO Y NEGRO, CON PLIEGUES IRREGULARES Y LA PUNTA DOBLADA HACIA LA IZQUIERDA; DONDE SE OBSERVAN CINCO ESTRELLAS, DE FONDO COLOR BLANCO Y BORDES FINOS COLOR NEGRO. UBICADO SOBRE UN RECT\u00C1GULO CURVO, DE FONDO COLOR NEGRO, DENTRO DEL QUE SE LEE MERLIN (PALABRA DE FANTAS\u00CDA, TAL Y COMO SE SOLICITA NO TIENE TRADUCCI\u00D3N), ESCRITA EN LETRA DE IMPRENTA, MAY\u00DASCULA, DE TRAZO GRUESO CON BORDES REDONDEADOS; CON LA PARTICULARIDAD DE QUE EL PUNTO DE LA LETRA I EST\u00C1 REPRESENTADO POR UNA ESTRELLA DE CINCO PUNTAS. EL CONJUNTO PEVIAMENTE DESCRITO ES DE FONDO COLOR BLANCO Y BORDE GRUESO COLOR NEGRO, CON EFECTO TRIDIMENSIONAL. DEBAJO SE OBSERVA UN RECT\u00C1NCULO DE BORDES REDONDEADOS, DE FONDO COLOR AMARILLO Y BORDE DE TRAZO GRUESO COLOR NEGRO. UNIDO EN SU PARTE INFERIOR A UNA PUNTA DE FONDO COLOR ROJO, DOBLADA HACIA LA DERECHA, CON DOS BORDES FINOS COLOR BLANCO Y NEGRO. SE REIVINDICA LA PALABRA MERLIN, Y TODO EL CONJUNTO DESCRITO CON LOS COLORES INDICADOS EN \u00C9L.'),
