(154, E'2023-004899', E'NC', E'mixta', E'46int', E'CHAIN A LA PARRILLA', E'TODO LO RELACIONADO CON LA TRANSFORMACI\u00D3N, ELABORACI\u00D3N, EMPACADO, COMERCIALIZACI\u00D3N DE ALIMENTOS, L\u00C1CTEOS Y TODOS SUS DERIVADOS AS\u00CD COMO EMBUTIDOS, ALIMENTOS PROCESADOS Y PRODUCTOS C\u00C1RNICOS, DE IGUAL FORMA LA VENTA DE UTENSILIOS E INGREDIENTES PARA LA PREPARACI\u00D3N DE PARRILLA Y ASADOS, PRESTACI\u00D3N DE SERVICIO DE ASESOR\u00CDAS T\u00C9CNICAS, TALLERES PR\u00C1CTICOS, RESTAURANTE, EVENTOS P\u00DABLICOS Y PRIVADOS, CATERING Y DEM\u00C1S ACTIVIDADES CONEXAS AL OBJETO.', E'SE OBSERVA UN ESCUDO CREADO CON UNA L\u00CDNEA GRUESA DE COLOR ROJO EN FORMA DE PENT\u00C1GONO CON BORDES REDONDEADOS QUE REPRESENTA LA CREACI\u00D3N ARTESANAL DE UN AHUMADOR PROPIO CON MATERIAL RECUPERADO. SOBRE EL ESCUDO SE ENCUENTRA LA SILUETA DE UNA LLAMA EN COLOR NEGRO QUE REPRESENTA LA AFICI\u00D3N POR DOMINAR EL ARTE DE COCINAR SOBRE LAS BRASAS, Y POR LA GASTRONOM\u00CDA PARRILLERA EN GENERAL. DEBAJO DEL ESCUDO SE OBSERVA LA EXPRESI\u00D3N "CHAIN" ESCRITA EN LETRAS MAY\u00DASCULAS DE TIPO MOLDE EN COLOR NEGRO ABARCANDO EL ANCHO DEL LOGO, REPRESENTANDO EL APODO FAMILIAR DEL CREADOR DE LA MARCA. EN LA L\u00CDNEA DEBAJO DE ESTA EXPRESI\u00D3N SE ENCUENTRA LA FRASE "A LA PARRILLA", ESCRITA EN LETRAS MAY\u00DASCULAS DE TIPO MOLDE EN COLOR NEGRO ABARCANDO EL ANCHO DEL LOGO, Y EN UN TAMA\u00D1O INFERIOR A LA EXPRESI\u00D3N "CHAIN", REPRESENTANDO UN AMPLIO Y RECONOCIDO PORTAFOLIO DE PRODUCTOS Y SERVICIOS DEL MERCADO PARRILLERO MARCANDO UN ESTILO DE ELEGANCIA, FUERZA Y PRESENCIA.'),
(155, E'2023-004956', E'MP', E'denominativa', E'1int', E'SALMTECH', E'ADITIVOS, PRODUCTOS QU\u00CDMICOS Y BIOL\u00D3GICOS DESTINADOS A LA INDUSTRIA ALIMENTARIA.', NULL),
(156, E'2023-005259', E'MP', E'denominativa', E'12int', E'VENTO', E'MOTOCICLETAS, MOTONETAS Y CUATRIMOTOS.', NULL),
(157, E'2023-005319', E'MP', E'mixta', E'18int', E'PEPSI', E'MOCHILAS; BOLSOS DE MANO; EQUIPAJE; MONEDEROS; PARAGUAS; CARTERAS; BOLSAS DE VIAJE DE LONA; ESTUCHES DE LLAVES; BOLSAS DE DEPORTE; BOLSAS DE MERCADO; BOLSOS DE VIAJE.', E'CONSISTE EN UNA ETIQUETA CUADRADA DE FONDO BLANCO EN LA QUE SE OBSERVA, EN EL CENTRO, UNA FIGURA CIRCULAR DE BORDES DE COLOR NEGRO, LA CUAL CONTIENE EN SU INTERIOR DOS SEMIC\u00CDRCULOS, EL PRIMERO DISPUESTO EN LA PARTE SUPERIOR ES DE COLOR ROJO, Y TIENE UNA L\u00CDNEA ONDULADA EN LA PARTE INFERIOR. EL SEGUNDO SEMIC\u00CDRCULO, DISPUESTO EN LA PARTE INFERIOR DEL C\u00CDRCULO, ES DE COLOR AZUL OSCURO Y TIENE UNA L\u00CDNEA ONDULADA EN LA PARTE SUPERIOR. EN EL MEDIO DEL C\u00CDRCULO SE OBSERVA UNA FRANJA ONDULADA DE COLOR BLANCO EN LA QUE SE LEE LA PALABRA DE FANTAS\u00CDA PEPSI ESCRITA EN LETRA MOLDE, CARACTER\u00CDSTICA, MAY\u00DASCULAS, DE TRAZO GRUESO Y DE COLOR NEGRO. LA PALABRA DE FANTAS\u00CDA PEPSI FORMA PARTE DE LA DENOMINACI\u00D3N COMERCIAL DE MI MANDANTE. SE REIVINDICA EL CONJUNTO DESCRITO.'),
(158, E'2023-005349', E'MP', E'grafica', E'16int', NULL, E'PRODUCTOS DE IMPRENTA; PUBLICACIONES IMPRESAS; REVISTAS; PERI\u00D3DICOS; DIARIOS; LIBROS; MATERIAL DE ENCUADERNACI\u00D3N; ART\u00CDCULOS DE PAPELER\u00CDA; ART\u00CDCULOS DE OFICINA; OBRAS DE ARTE Y FIGURAS DE PAPEL Y CART\u00D3N Y MAQUETAS DE ARQUITECTOS; GRABADOS ART\u00CDSTICOS; OBRAS DE ARTE DE PAPEL; PINCELES; PINTURAS; EQUIPOS Y MATERIALES PARA ARTE, MANUALIDADES Y MODELISMO; EMBALAJES PARA REGALO; MATERIALES DE EMBALAJE; BOLSAS DE PAPEL, CART\u00D3N O PL\u00C1STICO PARA EMBALAJE; ART\u00CDCULOS DE PAPEL, CART\u00D3N O PL\u00C1STICO PARA EMBALAJE; TARJETAS; CUADERNOS; AGENDAS PERSONALES; ADHESIVOS PARA LA PAPELER\u00CDA O DE USO DOM\u00C9STICO; FOTOGRAF\u00CDAS; MATERIAL DE INSTRUCCI\u00D3N O DE ENSE\u00D1ANZA; MATERIALES PL\u00C1STICOS PARA ENVOLVER Y EMBALAR; CAJAS DE PAPEL, CART\u00D3N O PL\u00C1STICO PARA EMBALAJE; INSIGNIAS DE PAPEL; CALCOMAN\u00CDAS; SERVILLETAS DE PAPEL; CARTELES; PAPEL PARA ENVOLVER (PRODUCTOS NACIONALES Y/O EXTRANJEROS).', E'LA ETIQUETA QUE SE PRESENTA A CONTINUACI\u00D3N CONSISTE EN LA REPRESENTACI\u00D3N GR\u00C1FICA DE DOS FIGURAS ANGELICALES EN COLORES BLANCO, NEGRO Y GRIS. LA ILUSTRACI\u00D3N EST\u00C1 CONFORMADA POR LOS ROSTROS DE DOS QUERUBINES, UNO DE CABELLO NEGRO QUE SE MUESTRA DE FRENTE Y EL OTRO DE CABELLO GRIS QUE SE MUESTRA DE PERFIL. SUS CUERPOS EST\u00C1N CUBIERTOS POR UN GRUPO DE TRES ALAS CON PLUMAS BLANCAS LEVEMENTE SOMBREADAS. AMBOS \u00C1NGELES PARECEN VER HACIA ARRIBA Y CADA UNO TIENE UN CINTILLO EN SU CABELLERA SOBRE EL QUE SE MUESTRA UNA PEQUE\u00D1A ESTRELLA BLANCA DE CINCO PUNTAS. EL FONDO DE LA ETIQUETA ES BLANCO. SE REIVINDICA EL CONJUNTO DESCRITO.'),
(159, E'2023-005353', E'MP', E'mixta', E'2int', E'DECOPAINT', E'PINTURA, REVESTIMIENTO DE SUPERFICIES, PINTURAS, BARNICES, LACAS, PRODUCTOS CONTRA LA HERRUMBRE RESINAS COLORANTES.', E'SE OBSERVA UN ISOLOGO EN FONDO BLANCO EN EL CENTRO DEL MISMO SE VISUALIZA UNA FIGURA COLOR NARANJA DEGRADANTE Y CON UN CIRCULO EN LA PARTE SUPERIOR CENTRADA DEBAJO DEL MISMO UN RECT\u00C1NGULO DE COLOR AZUL Y DENTRO DE LA MISMA SE LEE EN MAY\u00DASCULA DECOPAINT EN COLOR BLANCO, CABE DESTACAR QUE A SIMPLE VISTA DICHO LOGO HACE UNA SEMEJANZA A UNA BROCHA, NO REIVINDICANDO LOS T\u00C9RMINOS GEN\u00C9RICOS.'),
(160, E'2023-005521', E'MP', E'mixta', E'29int', E'PAFIA', E'CARNE, PESCADO, CARNE DE AVE Y CARNE DE CAZA; EXTRACTOS DE CARNE; FRUTAS Y VERDURAS, HORTALIZAS Y LEGUMBRES EN CONSERVA, CONGELADAS, SECAS Y COCIDAS; JALEAS, CONFITURAS, COMPOTAS; HUEVOS; LECHE, QUESOS, MANTEQUILLA, YOGUR Y OTROS PRODUCTOS L\u00C1CTEOS; ACEITES Y GRASAS PARA USO ALIMENTICIO.', E'CONSISTE EN UNA FIGURA IRREGULAR, DE BORDES DORADOS Y FONDO AZUL OSCURO, EN SU PARTE INFERIOR POSEE UNA CURVA CONVEXA, Y DE LADO DERECHO UNA SERIE DE TROZOS DE COLORES ORDENADADOS DE MAYOR A MENOR, INICIANDO DESDE EL PLATEADO, VERDE, VERDE OSCURO, GRIS, ROJO Y CULMINANDO DE MENOR TAMA\u00D1O EL AMARILLO. DENTRO DEL MISMO SE LEE LA PALABRA PAFIA (PALABRA DE FANTASIA), DESCRITA EN MAYUSCULA Y LETRA MODEL, DE COLOR PLATEADO. SE REIVINDICA EL CONJUNTO ANTES DESCRITOS, EXCEPTUANDO T\u00C9RMINOS GEN\u00C9RICOS.'),
(161, E'2023-005538', E'MP', E'denominativa', E'14int', E'PERPETUAL 1908', E'RELOJER\u00CDA Y ART\u00CDCULOS DE RELOJER\u00CDA, TALES COMO RELOJES, RELOJES DE PULSERA, COMPONENTES PARA RELOJER\u00CDA Y ART\u00CDCULOS DE RELOJER\u00CDA Y ACCESORIOS PARA RELOJER\u00CDA Y ART\u00CDCULOS DE RELOJER\u00CDA NO COMPRENDIDOS EN OTRAS CLASES, RELOJES Y OTROS INSTRUMENTOS CRONOM\u00C9TRICOS, CRON\u00D3METROS, CRON\u00D3GRAFOS (RELOJ Y RELOJER\u00CDA), PULSERAS DE RELOJ, CORREAS DE RELOJ, ESFERAS (RELOJ Y RELOJER\u00CDA), CAJAS Y ESTUCHES DE PRESENTACI\u00D3N PARA RELOJES, RELOJER\u00CDA Y JOYER\u00CDA, MECANISMOS DE RELOJER\u00CDA Y SUS PARTES; JOYER\u00CDA; PIEDRAS PRECIOSAS Y SEMIPRECIOSAS; METALES PRECIOSOS Y SUS ALEACIONES; ALFILERES (JOYER\u00CDA).', NULL),
