(165, E'2023-006036', E'MP', E'mixta', E'16int', E'MANPA ECOLOGY SUTIL', E'Papel y cart\u00F3n; papel higi\u00E9nico; papel toilette; toallas absorbentes de papel; papel secante; papel absorbente; pa\u00F1uelos de bolsillo de papel; servilletas de papel; baberos, pa\u00F1uelos y manteler\u00EDa elaborados de papel; banderolas de papel; bolsas de basura; bolsas de papel; cajas de cart\u00F3n o de papel; embalajes de papel o cart\u00F3n; toallitas de papel para la limpieza; toallitas de tocador de papel; papel sanitario; toallines de papel para uso dom\u00E9stico; papel encerado; papel caf\u00E9 (tipo kraft)', E'La marca mixta que se solicita consiste en una etiqueta rectangular de color blanco, dentro de la cual se observa, en la parte superior izquierda un tri\u00E1ngulo invertido de color rojo (Pantone 179C) y fondo de color blanco dentro del cual se inserta la marca MANPA (T\u00E9rmino de fantas\u00EDa y parte de la raz\u00F3n social de la empresa titular) escrita en letras may\u00FAsculas y en color azul (Pantone 7687C), justo debajo y ocupando casi toda la superficie central de la etiqueta, se encuentra el t\u00E9rmino ECOLOGY escrito en tipograf\u00EDa cursiva, en color Verde (Pantone 7732 C), con la particularidad que la letra E est\u00E1 escrita en may\u00FAscula mientras que el resto de las letras se encuentran en min\u00FAscula. En el extremo inferior derecho del conjunto se aprecia el dise\u00F1o tipogr\u00E1fico caracter\u00EDstico de la marca SUTIL en color blanco, escrita en graf\u00EDa especial, con la caracter\u00EDstica que la letra S se encuentra en may\u00FAscula y el resto en min\u00FAsculas, en forma cursiva e inserta dentro del dise\u00F1o de un \u00F3valo de fondo color verde (Pantone 7732 C), delineado su borde exterior por un trazo de color dorado (Pantone 385 C). Se reivindica el conjunto descrito y los colores se\u00F1alados conforme a los facs\u00EDmiles que se acompa\u00F1an. No se reivindica protecci\u00F3n ni exclusividad alguna sobre los t\u00E9rminos gen\u00E9ricos individualmente considerados, sino como formando parte del conjunto.'),
(166, E'2023-006074', E'MP', E'mixta', E'18int', E'MINISO', E'Tarjeteros [carteras]; ba\u00FAles [art\u00EDculos de equipaje]; billeteras; mochilas; bolsas; estuches para art\u00EDculos de tocador; estuches de compresi\u00F3n dise\u00F1ados para art\u00EDculos de equipaje; paraguas; bastones; bolsas para la compra reutilizables; estuches para llaves; monederos de cambio; bolsos de mano; etiquetas identificadoras para art\u00EDculos de equipaje; ropa para animales de compa\u00F1\u00EDa; bandoleras portabeb\u00E9s; bolsas de herramientas vac\u00EDas; arneses para guiar ni\u00F1os; collares para animales; bolsas de aseo, vac\u00EDas.', E'CONSISTE LA MARCA EN LA PALABRA DE FANTAS\u00CDA \u201CMINISO\u201D (PARTE DE LA RAZ\u00D3N SOCIAL DE LA SOLICITANTE), EN LETRAS ESTILIZADAS DE IMPRENTA MAY\u00DASCULA GRUESA EN COLOR NEGRO, LO ESENCIAL DE LA MARCA LO CONSTITUYE EL CONJUNTO DESCRITO. SE REIVINDICA EL COLOR NEGRO.'),
(167, E'2023-006176', E'MP', E'mixta', E'3int', E'PAOLA STUDIO', E'PRODUCTOS COSM\u00C9TICOS Y PREPARACIONES DE TOCADOR NO MEDICINALES; DENT\u00CDFRICOS NO MEDICINALES; PRODUCTOS DE PERFUMER\u00CDA, ACEITES ESENCIALES; PREPARACIONES PARA BLANQUEAR Y OTRAS SUSTANCIAS PARA LAVAR LA ROPA; PREPARACIONES PARA LIMPIAR, PULIR, DESENGRASAR Y RASPAR.LAS PREPARACIONES DE HIGIENE EN CUANTO PRODUCTOS DE TOCADOR;LAS TOALLITAS IMPREGNADAS DE LOCIONES COSM\u00C9TICAS;LOS DESODORANTES PARA PERSONAS O ANIMALES;LAS PREPARACIONES PARA PERFUMAR EL AMBIENTE; ACEITES DE TOCADOR, ACEITES ESENCIALES, AGUA MICELAR, ALGOD\u00D3N IMPREGNADO DE PREPARACIONES DESMAQUILLANTES, CREMAS COSM\u00C9TICAS, JABONES, MAQUILLAJE, M\u00C1SCARA DE PESTA\u00D1AS, MASCARILLAS DE BELLEZA, LAS PEGATINAS DECORATIVAS PARA U\u00D1AS;LA CERA PARA PULIR;EL PAPEL DE LIJA.', E'EL DISE\u00D1O CONSISTE EN EL NOMBRE MARCARIO (PAOLA STUDIO) DISPUESTO SOBRE UN FONDO BLANCO. LAS LETRAS DEL CONJUNTO SON CARACTER\u00CDSTICAS DE TRAZO CONTINUO, SEMIGRUESAS Y DE COLOR NEGRO, EL CONJUNTO SE ENCUENTRA LIGERAMENTE INCLINADO A LA DERECHA, LAS LETRAS P DE PAOLA Y S DE STUDIO SE ENCUENTRAN EN MAY\u00DASCULA.'),
(168, E'2023-006384', E'MP', E'denominativa', E'7int', E'NANO WEB', E'FILTROS DE AIRE, ACEITES, COMBUSTIBLES Y REFRIGERANTES PARA MOTORES DE COMBUSTI\u00D3N INTERNA, CABINAS DE VEH\u00CDCULOS Y MAQUINARIAS CON MEDIOS FILTRANTES DE ALTA EFICIENCIA, FABRICADOS CON UNA MEZCLA DE FIBRAS CUYO DI\u00C1METRO ES MEDIDO EN LA ESCALA DE LOS NAN\u00D3METROS.', NULL),
(169, E'2023-006527', E'MP', E'mixta', E'25int', E'THOM SAILOR', E'DISTINGUE: CALZADO, VESTIDO Y SOMBRERIA', E'LA ETIQUETA CONTIENE UNA FIGURA REDONDA DE COLOR ROJA, EN LA PARTE DE ADENTRO DE ESTA SE ENCUENTRA UNA FIGURA EN FORMA DE VELERO, DE COLOR ROJO CON EL FONDO DE COLOR NEGRO, DICHOS COLORES REIVINDICAN LA FIGURA, AL LADO DE ESTA EN LETRAS TIPO BICKHAM, DE COLOR NEGRO, LA PALABRA THOM SAILOR, CON FONDO COLOR BLANCO, DICHOS COLORES REIVINDICA LA ETIQUETA, PUDIENDO SER DE OTRO COLOR SEG\u00DAN EL TIPO DE CALZADO.'),
(170, E'2023-006642', E'NC', E'mixta', E'46int', E'M', E'FABRICACI\u00D3N, COMPRA, VENTA DE REPUESTOS, PARTE MEC\u00C1NICAS, EL\u00C9CTRICAS, ACCESORIOS, AUTOPERIQUITOS, LUBRICANTE, LA VENTA DE MOTOS Y EN GENERAL TODO LO RELACIONADO CON EL RAMO AUTOMOTRIZ.', E'COMO SE PUEDE APRECIAR ES UNA \u201CM\u201D ENTRELAZADA CON UN ELIPSE, LA CUAL ESTA LEVEMENTE INCLINADA HACIA EL LADO DERECHO, DE BORDE DE COLOR NEGRO Y BLANCO, EL CUAL ES GRUESO EN SU PARTE DELANTERA Y DELGADA EN SU PARTE TRASERA. EN LA LETRA \u201CM\u201D, SE US\u00D3 COMO REFERENCIA LAS INICIALES DEL NOMBRE DE LOS SOCIOS (ALEXANDRO Y ADRIANO), HACIENDO UNA FUSI\u00D3N DE LAS MISMAS CREANDO UNA UNI\u00D3N Y FORMANDO UNA \u201CM\u201D, QUE TERMINAN EN PUNTA EN FLECHAS, DANDO UN ACABADO DE ESTRUCTURA Y FIRMEZA. LA PALETA DE COLORES UTILIZADAS ES: AMARILLO: (#FFBB26) Y NEGRO: (#000000). SE ANEXA COPIA DETALLADA DE LA DESCRIPCI\u00D3N. MARCADA CON LA LETRA \u201CC\u201D'),
(171, E'2023-006692', E'MS', E'mixta', E'38int', E'QUEENS LEAGUE', E'DIFUSI\u00D3N DE CONTENIDOS AUDIOVISUALES Y MULTIMEDIA POR INTERNET; DIFUSI\u00D3N CONTINUA DE CONTENIDOS DE AUDIO Y DE V\u00CDDEO POR INTERNET; SERVICIOS DE DIFUSI\u00D3N CONTINUA DE CONTENIDOS DE V\u00CDDEO Y DE AUDIO; TRANSMISI\u00D3N DE ARCHIVOS DE DATOS, AUDIO, V\u00CDDEO Y MULTIMEDIA, INCLUIDOS ARCHIVOS DESCARGABLES Y ARCHIVOS DIFUNDIDOS EN FLUJO CONTINUO EN REDES INFORM\u00C1TICAS MUNDIALES; DISTRIBUCI\u00D3N DE DATOS O IM\u00C1GENES AUDIOVISUALES A TRAV\u00C9S DE UNA RED INFORM\u00C1TICA MUNDIAL O INTERNET; SERVICIOS DE ACCESO A PLATAFORMAS Y PORTALES DE INTERNET; SERVICIOS DE ACCESO DE USUARIO A PLATAFORMAS EN INTERNET; SERVICIOS DE TELECOMUNICACI\u00D3N MEDIANTE PLATAFORMAS Y PORTALES DE INTERNET Y POR OTROS SOPORTES; INTERCAMBIO ELECTR\u00D3NICO DE MENSAJES A TRAV\u00C9S DE SERVICIOS DE L\u00CDNEAS DE CHAT, SALAS DE CHAT Y FOROS DE INTERNET; SERVICIOS DE CONEXI\u00D3N POR MEDIOS DE TELECOMUNICACI\u00D3N A L\u00CDNEAS TELEF\u00D3NICAS DE CHAT; FACILITACI\u00D3N DE TABLONES DE ANUNCIOS ELECTR\u00D3NICOS EN L\u00CDNEA (ONLINE) Y SALAS DE CHARLA (CHAT ROOMS); SERVICIOS DE SALAS DE CHAT EN L\u00CDNEA PARA LA TRANSMISI\u00D3N DE MENSAJES, COMENTARIOS Y CONTENIDOS MULTIMEDIA ENTRE USUARIOS; SERVICIOS DE SALAS DE CHAT Y TABLONES DE ANUNCIOS ELECTR\u00D3NICOS EN L\u00CDNEA DESTINADOS A LA TRANSMISI\u00D3N DE MENSAJES ENTRE USUARIOS DE ORDENADOR; FACILITACI\u00D3N DE L\u00CDNEAS DE CHAT POR INTERNET; SUMINISTRO DE SERVICIOS DE CHATS DE VOZ; SERVICIOS DE SALAS DE CHAT PARA REDES SOCIALES; PROVISI\u00D3N DE FOROS DE DISCUSI\u00D3N (CHATS) EN INTERNET; FACILITACI\u00D3N DE FOROS DE DISCUSI\u00D3N (CHATS) EN INTERNET; FOROS [SALAS DE CHAT] PARA SISTEMAS DE REDES SOCIALES; SALAS DE CHAT EN L\u00CDNEA (ONLINE) PARA REDES SOCIALES; INTERCAMBIO ELECTR\u00D3NICO DE MENSAJES A TRAV\u00C9S DE SERVICIOS DE L\u00CDNEAS DE CHAT, SALAS DE CHAT Y FOROS DE INTERNET; TRANSMISI\u00D3N POR INTERNET DE V\u00CDDEOS, PEL\u00CDCULAS, IM\u00C1GENES, TEXTOS, FOTOGRAF\u00CDAS, JUEGOS, CONTENIDOS GENERADOS POR USUARIOS, CONTENIDOS DE AUDIO E INFORMACIONES; SERVICIOS DE TELECOMUNICACIONES; SERVICIOS DE DIFUSI\u00D3N V\u00CDA SAT\u00C9LITE RELACIONADOS CON EVENTOS DEPORTIVOS; EMISI\u00D3N EN CONTINUO DE EVENTOS DE DEPORTES ELECTR\u00D3NICOS.', E'CONSISTE EN LA REPRESENTACI\u00D3N GR\u00C1FICA DE UN ESCUDO DE COLOR MORADO, DENTRO DEL CUAL SE OBSERVA LA FIGURA DE UNA MUJER EN CUYA CABEZA LLEVA UNA CORONA Y EN SU MANO IZQUIERDA UNA ESFERA, TODO EL CONJUNTO ANTERIORMENTE DESCRITO ES DE COLOR BLANCO. DEBAJO SE LEE QUEENS LEAGUE (TRADUCEN AL CASTELLANO REINAS Y LIGA RESPECTIVAMENTE) UNA DEBAJO DE LA OTRA, ESCRITAS EN LETRA DE IMPRENTA, MAY\u00DASCULAS, DE TRAZO GRUESO Y COLOR MORADO. SE REIVINDICAN LAS PALABRAS QUEENS LEAGUE Y TODO EL CONJUNTO DESCRITO, CON LOS COLORES INDICADOS EN \u00C9L. NO SE REIVINDICAN LOS T\u00C9RMINOS DESCRIPTIVOS O GEN\u00C9RICOS POR SI SOLO CONSIDERADOS.'),
(172, E'2023-006946', E'MP', E'mixta', E'32int', E'SUNTY MANZANA', E'CERVEZAS; BEBIDAS SIN ALCOHOL; AGUAS MINERALES Y CARBONATADAS; BEBIDAS A BASE DE FRUTAS Y ZUMOS DE FRUTAS; SIROPES Y OTRAS PREPARACIONES PARA ELABORAR BEBIDAS SIN ALCOHOL.', E'CONSISTE EN UN RECT\u00C1NGULO, UBICADO EN POSICI\u00D3N HORIZONTAL, DIVIDIDO HORIZONTALMENTE POR UNA L\u00CDNEA ONDULADA, SIENDO LA PARTE SUPERIOR DE COLOR VERDE Y LA PARTE INFERIOR DE COLOR ROJO, DONDE SE OBSERVAN BURBUJAS DE DISTINTOS TAMA\u00D1OS DE COLOR AMARILLO Y HOJAS DE DISTINTOS TAMA\u00D1OS, DE COLOR VERDE, DISTRIBUIDAS EN EL RECT\u00C1NGULO. DENTRO DE ESTE SE LEEN EN DOS RENGLONES LAS PALABRAS: SUNTY MANZANA. SUNTY (PALABRA DE FANTAS\u00CDA, TAL Y COMO SE SOLICITA NO TIENE TRADUCCI\u00D3N), ESCRITA EN LETRA DE IMPRENTA, MAY\u00DASCULA, DE TRAZO GRUESO Y COLOR BLANCO, CON BORDES DE TRAZO FINO Y EFECTO TRIDIMENSIONAL EN COLOR VERDE; CON LA PARTICULARIDAD QUE SOBRE LA LETRA S, SE OBSERVA LA REPRESENTACI\u00D3N GR\u00C1FICA DE UN SOL CONFORMADO POR UN TRAZO FINO CURVO Y 19 RAYOS RECTOS DE DIFERENTES TAMA\u00D1OS, DE TRAZO FINO Y COLOR BLANCO. DEBAJO DE LAS LETRAS TY SE OBSERVA UNA HOJA DE COLOR VERDE, EN POSICI\u00D3N HORIZONTAL, DONDE SE LEE LA PALABRA MANZANA, ESCRITA EN LETRA DE IMPRENTA, MAY\u00DASCULA, DE MENOR TAMA\u00D1O, DE TRAZO GRUESO Y COLOR BLANCO. DEBAJO SE OBSERVA LA MITAD DE UNA MANZANA, DE COLOR ROJO, SU TALLO FINO DE COLOR MARR\u00D3N Y SALIENDO DE \u00C9L UNA HOJA DE COLOR VERDE. FRENTE A ELLA SE OBSERVA UN TRAZO GRUESO, ONDULADO, DE COLOR AMARILLO, QUE ASEMEJA SER UN CHORRO DE JUGO Y UBICADA AL FRENTE UNA MANZANA CORTADA A LA MITAD, DONDE SE OBSERVA SU CORAZ\u00D3N CON DOS SEMILLAS Y SU TALLO DE TRAZO FINO DE COLOR MARR\u00D3N. SE REIVINDICA LA PALABRA SUNTY Y TODO EL CONJUNTO DESCRITO, CON LOS COLORES INDICADOS EN \u00C9L. NO SE REIVINDICAN LOS T\u00C9RMINOS GEN\u00C9RICOS, DESCRIPTIVOS, NI DE USO COM\u00DAN, INDIVIDUALMENTE CONSIDERADOS.'),
