(174, E'2023-007359', E'MP', E'mixta', E'30int', E'ORIENTAL', E'ARROZ ENTERO', E'SE PUEDE VISUALIZAR EN LA GR\u00C1FICA EN UN FONDO DE COLOR BLANCO UNA FIGURA CONSTITUIDA DEL LADO IZQUIERDO, SE PUEDE OBSERVAR CINCO LINEAS SEMI-ONDULADAS QUE VAN DE COLOR VERDE OSCURO A VERDE CLARO, EN SU LADO DERECHO SE OBSERVA UNA FIGURA EN FORMA DE HOJA DE COLOR VERDE OSCURO CON UNA LINEA BLANCA EN EL CENTRO DE ELLA PARA COMPLETAR LA FIGURA EN EL CENTRO DE ELLAS SE PUEDE OBSERVAR UN SEMICIRCULAR EN REPRESENTACI\u00D3N DE EL SOL, ENCIMA DE \u00C9L SE VE UNA ESPIGA EN FORMA ONDULADA AMBOS DE COLOR AMARILLO OSCURO, DEBAJO DE LA IMAGEN SE LEE LA PALABRA ORIENTAL, EN COLOR NEGRO, SIENDO LA LETRA O EN MIN\u00DASCULA Y SU COMPLEMENTO EN MAY\u00DASCULA, SE REIVINDICA EL CONJUNTO DESCRITO.'),
(175, E'2023-007370', E'NC', E'mixta', E'46int', E'TU ALIADO', E'EMPRESA DEDICADA A TODO LO RELACIONADO CON LA COMERCIALIZACION, DISTRIBUCION, COMPRA, VENTA, IMPORTACION Y EXPORTACION AL MAYOR Y AL DETAL DE ROPA, CALZADO PARA DAMA, CABALLEROS Y NI\u00D1OS, TALES COMO: PIJAMAS, FRANELAS, JEANS, SHORTS, PANTALONES, CAMISAS, MONOS, TRAJES DE BA\u00D1O, ROPA INTERIOR, ROPA INTIMA, MEDIAS, LENCERIA', E'EL MENCIONADO DISE\u00D1O CONSISTE EN UNA ETIQUETA DE FONDO BLANCO EN CUYO INTERIOR EN LA PARTE CENTRICA SE ESCRIBE \"TU\" EN LETRA MOLDE DE TRAZO GRUESO EN COLOR AZUL OSCURO, SEGUIDO DEL DIBUJO UNICOLOR DEL PERFIL DE UNA PALMA ABIERTA DE UNA MANO DE LA MISMA TONALIDAD AZUL OSCURA, EN LA PARTE CENTRICA INFERIOR SE ESCRIBE \"ALIADO\" EN LETRA MOLDE DE TRAZO GRUESO EN COLOR AZUL OSCURO, SE REIVINDICA TODO LO AQUI DESCRITO Y COLORES MENOS LO QUE PODRIA CONSIDERARSE COMO GENERICO.'),
(176, E'2023-007420', E'MP', E'mixta', E'4int', E'MOTUL EGEN', E'ACEITES Y GRASAS INDUSTRIALES; LUBRICANTES; ACEITES, GRASAS Y LUBRICANTES PARA MOTORES DE VEH\u00CDCULOS; ADITIVOS NO QU\u00CDMICOS PARA CARBURANTES; PRODUCTOS PARA QUITAR EL POLVO, ABSORBENTES, HUMECTANTES O AGLUTINANTES, UTILIZADOS PARA EL MANTENIMIENTO DE MOTORES DE VEH\u00CDCULOS O DE CUALQUIER M\u00C1QUINA; CARBURANTES (INCLUIDA LA GASOLINA PARA MOTORES) Y COMBUSTIBLES; VELAS Y MECHAS PARA ALUMBRADO; COMPOSICIONES USADAS COMO AGLUTINANTES, AGLOMERANTES; ACEITES PARA HORQUILLAS (PRODUCTOS NACIONALES Y/O EXTRANJEROS).', E'LA ETIQUETA QUE SE PRESENTA A CONTINUACI\u00D3N CONSISTE EN LA REPRESENTACI\u00D3N GR\u00C1FICA DE LAS DENOMINACIONES MOTUL EGEN, ESCRITAS EN LETRAS MAY\u00DASCULAS ESTILIZADAS, DE TRAZOS GRUESOS Y DE COLOR BLANCO. POR SU PARTE, LA DENOMINACI\u00D3N MOTUL SE ENCUENTRA ENMARCADA POR UN RECT\u00C1NGULO DE COLOR ROJO MIENTRAS QUE LA DENOMINACI\u00D3N EGEN EST\u00C1 ENMARCADA POR UN RECT\u00C1NGULO CONTIGUO DE COLOR AZUL OSCURO. DENTRO DE LA PALABRA MOTUL, DESTACA EL DISE\u00D1O DE LA LETRA T DADO QUE SU EXTREMO SUPERIOR IZQUIERDO TIENE UNA FORMA PUNTIAGUDA DELIMITADA POR EL CONTORNO DE LA LETRA O. EL FONDO DE LA ETIQUETA ES BLANCO. SE REIVINDICA EL CONJUNTO DESCRITO.'),
(177, E'2023-007470', E'MS', E'mixta', E'44int', E'PALUZ', E'SERVICIOS M\u00C9DICOS Y DE SALUD, ASISTENCIA M\u00C9DICA, SERVICIOS \u00D3PTICOS, FISIOTERAPIA, SERVICIOS SANATORIOS, SERVICIOS DE ODONTOLOG\u00CDA, SERVICIOS DE RESIDENCIA CON ASISTENCIA M\u00C9DICA, SERVICIOS TERAP\u00C9UTICOS Y PSICOL\u00D3GICOS, SERVICIOS DE AN\u00C1LISIS PRESTADOS POR LABORATORIOS M\u00C9DICOS CON FINES DE DIAGN\u00D3STICOS Y TERAP\u00C9UTICOS, SERVICIOS DE DIET\u00C9TICA Y NUTRICI\u00D3N.', E'SE OBSERVA UN SIGNO MIXTO, EN CUYOS COMPONENTES SE APRECIAN UN ELEMENTO DENOMINATIVO Y OTRO FIGURATIVO. EL ELEMENTO DENOMINATIVO EST\u00C1 COMPUESTO POR LA PALABRA PALUZ EN LETRA IMPRENTA, MIN\u00DASCULAS, TRAZO GRUESO, LAS LETRAS PA DE COLOR CELESTE Y LAS LETRAS LUZ DE COLOR AZUL. LA DENOMINACI\u00D3N PALUZ NO TIENE TRADUCCI\u00D3N AL CASTELLANO, CONSTITUYENDO UN SIGNO DE FANTAS\u00CDA, EL CUAL POSEE UN SIGNIFICADO PROPIO, ES TOTALMENTE FRUTO DE LA IMAGINACI\u00D3N, Y NO TRANSMITE OTRO SIGNIFICADO M\u00C1S QUE EL DE ACTUAR COMO MARCA. EL ELEMENTO FIGURATIVO, SE ENCUENTRA MANIFIESTO PRINCIPALMENTE A TRAV\u00C9S DE UNA FIGURA QUE SE APRECIA A LA IZQUIERDA DEL ELEMENTO DENOMINATIVO, REPRESENTADA POR UN SEMI CIRCULO, COMPUESTO POR LA FIGURA DE DOS MANOS VISTAS DESDE UNA PERSPECTIVA FRONTAL DE COLOR BLANCO CON L\u00CDNEAS CELESTE, LAS CUALES PARECEN ENVOLVER UNA PEQUE\u00D1A CRUZ DE COLOR CELESTE. AS\u00CD PUES, LA DENOMINACI\u00D3N TIENE UN TRAZO MODERNO CON LETRAS SIN REMATES Y BORDES CURVEADOS. SE REIVINDICA TODO EL DISE\u00D1O EN SU CONJUNTO.'),
(178, E'2023-007476', E'MP', E'denominativa', E'27int', E'YALA', E'ALFOMBRAS, FELPUDOS, ESTERAS Y ESTERILLAS, LIN\u00D3LEO Y OTROS REVESTIMIENTOS DE SUELOS; TAPICES MURALES QUE NO SEAN DE MATERIAS TEXTILES; ALFOMBRILLAS PARA AUTOM\u00D3VILES; ALFOMBRAS PARA CUBRIR SUELOS TALES COMO ALFOMBRILLAS DE BA\u00D1O, COLCHONETAS DE GIMNASIA, ESTERAS DE YOGA, C\u00C9SPED ARTIFICIAL; PAPEL PINTADO, INCLUIDO EL PAPEL PINTADO DE MATERIAS TEXTILES; ALFOMBRAS ANTIDESLIZANTES; ALFOMBRAS IGN\u00CDFUGAS PARA CHIMENEAS Y BARBACOAS; BAJO ALFOMBRAS; C\u00C9SPED ARTIFICIAL; PASTO ARTIFICIAL; ESTERAS DE JUNCO; ESTERAS; ESTERAS DE YOGA; TATAMIS.', NULL),
