(181, E'2023-007722', E'MP', E'mixta', E'7int', E'SMART HOME', E'M\u00C1QUINAS, M\u00C1QUINAS HERRAMIENTAS Y HERRAMIENTAS MEC\u00C1NICAS; MOTORES, EXCEPTO MOTORES PARA VEH\u00CDCULOS TERRESTRES; ACOPLAMIENTOS Y ELEMENTOS DE TRANSMISI\u00D3N, EXCEPTO PARA VEH\u00CDCULOS TERRESTRES; INSTRUMENTOS AGR\u00CDCOLAS QUE NO SEAN HERRAMIENTAS DE MANO QUE FUNCIONAN MANUALMENTE; INCUBADORAS DE HUEVOS; DISTRIBUIDORES AUTOM\u00C1TICOS.070287 ABRELATAS EL\u00C9CTRICOS 070295 AMASADORAS MEC\u00C1NICAS 070485 APARATOS DE LIMPIEZA A VAPOR 070423 APARATOS ELECTROMEC\u00C1NICOS PARA PREPARAR ALIMENTOS 070315 APARATOS ELECTROMEC\u00C1NICOS PARA PREPARAR BEBIDAS 070508 ASPIRADORAS / ASPIRADORES 070403 BATIDORAS EL\u00C9CTRICAS 070267 BATIDORAS* 070459 BATIDORES EL\u00C9CTRICOS PARA USO DOM\u00C9STICO 070563 BOQUILLA DE SUCCI\u00D3N PARA ASPIRADORAS 070611 BRAZOS ROB\u00D3TICOS PARA PREPARAR BEBIDAS 070559 CEPILLOS PARA ASPIRADORAS 070578 CORTADORES DE VERDURAS, HORTALIZAS EN ESPIRAL EL\u00C9CTRICOS 070131 CUCHILLOS EL\u00C9CTRICOS 070460 EXPRIMIDORES DE FRUTA EL\u00C9CTRICOS PARA USO DOM\u00C9STICO 070565 EXTRACTORES DE ZUMO EL\u00C9CTRICOS / EXTRACTORES DE JUGO EL\u00C9CTRICOS 070234 LAVADORAS / LAVARROPAS / M\u00C1QUINAS PARA LAVAR LA ROPA 070588 LAVADORAS CON TAMBOR DE SECADO INTEGRADO 070231 LAVAPLATOS [M\u00C1QUINAS] / LAVAVAJILLAS [M\u00C1QUINAS] 070415 MOLINILLOS DE CAF\u00C9 QUE NO SEAN ACCIONADOS MANUALMENTE 070307 MOLINILLOS DE PIMIENTA QUE NO SEAN MANUALES 070553 MOLINILLOS EL\u00C9CTRICOS DE COCINA 070277 MOLINILLOS PARA USO DOM\u00C9STICO QUE NO SEAN MANUALES 070586 PELADORES EL\u00C9CTRICOS DE VERDURAS Y HORTALIZAS 070211 PICADORAS DE CARNE EL\u00C9CTRICAS / MOLINOS DE CARNE EL\u00C9CTRICOS / TRITURADORAS DE CARNE EL\u00C9CTRICAS 070475 ROBOTS DE COCINA EL\u00C9CTRICOS / PROCESADORES DE ALIMENTOS EL\u00C9CTRICOS 070084 SECADORAS CENTR\u00CDFUGAS.', E'Consiste en un conjunto sobre un fondo color blanco, sobre este se observa una figura que simula ser una letra (S), sin embargo dejamos claro que no forma parte del nombre marcario, pero si es parte del dise\u00F1o, la figura tiene un trazo grueso de color gris oscuro con una l\u00EDnea gruesa color azul y se ve un segundo trazo de color blanco y construyen la letra (S). Debajo de esto se encuentra el nombre marcario (Smart Home) (Inteligente hogar), Smart en color gris y Home en color azul, las letras finas, en may\u00FAscula, letra tipo imprenta. Se reivindica el conjunto y colores mencionados.'),
(182, E'2023-008002', E'MS', E'mixta', E'44int', E'JOHNSON&JOHNSON', E'SERVICIOS M\u00C9DICOS Y SANITARIOS; SUMINISTRO DE INFORMACI\u00D3N Y SERVICIOS M\u00C9DICOS; INFORMACI\u00D3N PROPORCIONADA A PACIENTES Y PROFESIONALES SANITARIOS SOBRE PRODUCTOS FARMAC\u00C9UTICOS, VACUNAS, DISPOSITIVOS M\u00C9DICOS, ENFERMEDADES Y TRASTORNOS M\u00C9DICOS Y TRATAMIENTOS RELACIONADOS; SERVICIOS DE TRATAMIENTO M\u00C9DICO DE TERAPIA DE GENES Y CELULAR; SERVICIOS M\u00C9DICOS Y DE ATENCI\u00D3N SANITARIA; PRUEBAS GEN\u00C9TICAS Y HUELLAS GEN\u00C9TICAS CON FINES M\u00C9DICOS; PRESTACI\u00D3N DE SERVICIOS DE INFORMACI\u00D3N, CONSULTOR\u00CDA Y ASESORAMIENTO RELACIONADOS CON CUALQUIERA DE LOS SERVICIOS MENCIONADOS.', E'LA ETIQUETA TIENE COMO ELEMENTO PRINCIPAL LAS PALABRAS \u201CJOHNSON&JOHNSON\u201D, ESCRITAS EN LETRA TIPO MOLDE, DE TRAZO GRUESO, COLOR ROJO, DONDE LAS LETRAS \u201CJ\u201D SE PRESENTAN EN MAY\u00DASCULAS Y EL RESTO DE LAS LETRAS EN MIN\u00DASCULAS, AMBAS PALABRAS \u201CJOHNSON\u201D EST\u00C1N SEPARADAS POR EL CAR\u00C1CTER O S\u00CDMBOLO TIPOGR\u00C1FICO \u201C&\u201D QUE REPRESENTA LA Y COMERCIAL Y ES LA CONJUNCI\u00D3N COPULATIVA LATINA ET. TODO EL CONJUNTO ANTERIORMENTE DESCRITO SE OBSERVA SOBRE UN FONDO DE COLOR BLANCO. SE REIVINDICA EL CONJUNTO ANTERIORMENTE DESCRITO Y LA COMBINACI\u00D3N DE COLORES SEG\u00DAN SE DESCRIBE. LA DESCRIPCI\u00D3N DE COLORES SE HA HECHO EN CUMPLIMIENTO AL AVISO OFICIAL S/N EMANADO DEL REGISTRO DE LA PROPIEDAD INTELECTUAL FECHADO 18 DE NOVIEMBRE DE 1996.'),
