(187, E'2023-008291', E'MP', E'mixta', E'12int', E'ZAMUSA', E'REPUESTOS, PARTES Y ACCESORIOS PARA VEH\u00CDCULOS COMO MOTORES PARA VEH\u00CDCULOS TERRESTRES, SOPORTES DE MOTOR DE VEH\u00CDCULOS TERRESTRES, SOPORTES DE CAJA DE VEH\u00CDCULOS TERRESTRES, AMORTIGUADORES PARA VEH\u00CDCULOS, RODAMIENTOS COMO PARTE DE VEH\u00CDCULOS, ACOPLAMIENTOS DEL TREN DELANTERO, ACOMPLAMIENTO Y ELEMENTOS DE TRANSMISI\u00D3N PARA VEH\u00CDCULOS TERRESTRES, PUNTAS DE EJE PARA VEH\u00CDCULOS, LIMPIAPARABRISAS Y FRENOS DE VEH\u00CDCULOS, PARACHOUES, VOLANTES, BOMBAS DE AIRE', E'Consiste en la representaci\u00F3n gr\u00E1fica de la palabra \u201CZAMUSA\u201D escrita con un grafismo especial, con trazos gruesos, con la letra inicial \u201CZ\u201D con mayor tama\u00F1o; todas las letras se presentan con color azul turquesa, y con excepci\u00F3n de la letra inicial Z, todas presentan en diversas partes de su estructura algunos peque\u00F1os trazos con color negro; en la parte superior de este vocablo aparecen dos l\u00EDneas paralelas semicurvas, con grosor creciente de izquierda a derecha, observ\u00E1ndose la l\u00EDnea superior con mayor longitud que la l\u00EDnea inferior y que termina con su extremo derecho en forma de estrella de mediano tama\u00F1o; estas dos l\u00EDneas paralelas se presentan con el mismo color azul turquesa con matices negros que tiene el vocablo ZAMUSA; todo el conjunto aparece sobre un fondo blanco, tal como se observa en la etiqueta. Se reivindican los colores descritos de la etiqueta.'),
