(191, E'2023-008927', E'NC', E'mixta', E'46int', E'PINTURAS COINPICA', E'EMPRESA DEDICADA A LA FABRICACI\u00D3N, COMPRA, VENTA AL MAYOR Y DETAL, IMPORTACI\u00D3N, EXPORTACI\u00D3N, DISTRIBUCI\u00D3N Y COMERCIALIZACI\u00D3N DE TODO TIPO DE PINTURAS.', E'CONSISTE EN LAS PALABRAS \u201CPINTURAS COINPICA\u201D ESCRITAS EN DOS RENGLONES EN LETRAS MAYUSCULAS DE IMPRENTA COLOR NEGRO, RESALTANDO LA PALABRA DE FANTASIA \u201CCOINPICA\u201D POR SER DE MAYOR TAMA\u00D1O Y POR FORMAR LA LETRA \u201CO\u201D DE DICHA PALABRA UN CIRCULO SIN CERRAR EN COLOR AZUL CIELO. TODO LO ANTES DESCRITO SE ENCUENTRA SOBRE UN FONDO RECTANGULAR COLOR NEGRO. NO REINVINDICAMOS EL TERMINO PINTURAS. COINPICA ES UNA PALABRA DE FANTAS\u00CDA, Y NO SE REIVINDICA EL TERMINO GENERICO PINTURAS.'),
