(194, E'2023-009386', E'MS', E'mixta', E'35int', E'DELANTO', E'La organizaci\u00F3n y la administraci\u00F3n comercial de una empresa comercial o industrial, as\u00ED como los servicios de publicidad, marketing y promoci\u00F3n, los servicios de asistencia comercial, los servicios administrativos relativos a transacciones de negocios y registros financieros.', E'Se describe una etiqueta fondo blanco, d\u00F3nde se observa el logo que se lee como \\\\\\\"delanto\\\\\\\", una palabra de fantas\u00EDa la cual finalizando el dise\u00F1o se observa la silueta de una flecha doble y curva que parte de la letra \\\\\\\" t\\\\\\\" y termina en la letra \\\\\\\"o\\\\\\\", en color ,azul rey, todo lo descrito,Se REIVINDICAN el conjunto decrito.,Se REIVINDICAN los colores descritos.'),
(195, E'2023-009409', E'MS', E'denominativa', E'35int', E'SABRE', E'Proporcionar un portal de Internet que proporciona a los clientes acceso a informaci\u00F3n comercial e informes en las industrias de viajes, transporte, turismo, hospitalidad y log\u00EDstica; proporcionar un portal de Internet que permite a los usuarios acceder, rastrear, gestionar, buscar, supervisar y generar informaci\u00F3n comercial e informes de informaci\u00F3n comercial sobre servicios de pasajeros, comercio electr\u00F3nico, precios, gesti\u00F3n de inventario, gesti\u00F3n de costes y gesti\u00F3n de ingresos; gesti\u00F3n de bases de datos, procesamiento de datos y servicios de an\u00E1lisis de datos en las industrias de viajes, transporte, turismo, hospitalidad y log\u00EDstica; gesti\u00F3n de bases de datos; servicios de procesamiento de datos; consultor\u00EDa empresarial, servicios de informaci\u00F3n, organizaci\u00F3n empresarial, gesti\u00F3n. consultor\u00EDa y gesti\u00F3n de las relaciones con los clientes en los sectores de los viajes, el transporte, el turismo, la hosteler\u00EDa y la log\u00EDstica; servicios de consultor\u00EDa e informaci\u00F3n empresarial; consultor\u00EDa en organizaci\u00F3n y gesti\u00F3n empresarial; servicios de consultor\u00EDa y gesti\u00F3n empresarial en relaci\u00F3n con la estrategia, el marketing, las ventas y las operaciones empresariales; servicios de consultor\u00EDa y gesti\u00F3n empresarial en relaci\u00F3n con la estrategia, el marketing, las ventas y las operaciones, en particular especializados en el uso de modelos anal\u00EDticos y estad\u00EDsticos para comprender y predecir las tendencias y acciones de los consumidores, las empresas y el mercado; servicios de monitorizaci\u00F3n y consultor\u00EDa empresarial, en concreto, seguimiento de datos y aplicaciones de otros para proporcionar apoyo en estrategia, conocimiento, marketing, ventas y operaciones, en particular, especializ\u00E1ndose en el uso de modelos anal\u00EDticos y es