(196, E'2023-009487', E'NC', E'mixta', E'46int', E'YOY', E'UNA EMPRESA QUE SE DEDICARA A PRESTAR SERVICIOS CIENT\u00CDFICOS Y TECNOL\u00D3GICOS, AS\u00CD COMO SERVICIOS DE INVESTIGACI\u00D3N Y DISE\u00D1O CONEXOS, SERVICIOS DE AN\u00C1LISIS E INVESTIGACI\u00D3N INDUSTRIALES, DISE\u00D1O Y DESARROLLO DE EQUIPOS INFORM\u00C1TICOS Y SOFTWARE, DESARROLLAR Y OPERAR SOLUCIONES TECNOL\u00D3GICAS PROPIAS Y DE TERCEROS DE FORMA AGILES QUE PERMITAN A LAS ORGANIZACIONES Y PERSONAS ALCANZAR SUS METAS DE NEGOCIO, EMPLEANDO ENFOQUES Y RECURSOS PROPIOS DEL DESARROLLO DE LA COMUNIDAD TECNOL\u00D3GICA, A TRAV\u00C9S DE PROFESIONALES ESPECIALIZADOS EN EL \u00C1REA DE PROGRAMACI\u00D3N, AN\u00C1LISIS DE BASE DE DATOS, CONFIGURACI\u00D3N DE SERVIDORES.', E'SE TRATA DE UNA ETIQUETA DE FONDO BLANCO DONDE SE PUEDEN OBSERVAR EN LA PARTE IZQUIERDA SUPERIOR Y POSTERIOR DOS FIGURAS FANTASIOSAS EN FORMA DE SEMI ARCO Y COLOR CELESTE, EN LA CUAL LA DE ARRIBA ES M\u00C1S PEQUE\u00D1A QUE LA DE ABAJO, EN SU PARTE CENTRAL SUPERIOR SE PUEDE NOTAR UNA FRANJA VERTICAL DE TRAZO GRUESO Y DE COLOR CELESTE, EN LA PARTE SUPERIOR DERECHA SE PUEDE APRECIAR UN C\u00CDRCULO EN COLOR CELESTE, TODO LO DESCRITO FORMA LA FIGURA CARICATURESCA DE UNA CARA GUI\u00D1ANDO EL OJO IZQUIERDO; EN LA PARTE DE ABAJO SE PUEDE LEER LA PALABRA DE FANTAS\u00CDA QUE NO TIENE TRADUCCI\u00D3N ALGUNA Y\u00D6Y ESCRITA EN LETRAS DE MOLDE DE TRAZO GRUESO Y COLOR CELESTE EN DONDE LA PRIMERA LETRA (Y) EST\u00C1 ESCRITA EN MAY\u00DASCULA, LA LETRA (\u00D6) EST\u00C1 ESCRITA EN MIN\u00DASCULA Y LA MISMA PRESENTA EN SU PARTE SUPERIOR DOS CUADRADOS DE TRAZO GRUESO Y COLOR CELESTE, LA SEGUNDA LETRA (Y) EST\u00C1 ESCRITA EN MIN\u00DASCULA. SE REIVINDICAN LOS COLORES Y LOS T\u00C9RMINOS DESCRITOS.'),
(197, E'2023-009541', E'MP', E'denominativa', E'5int', E'NIZOX', E'PRODUCTOS FARMAC\u00C9UTICOS, PREPARACIONES PARA USO M\u00C9DICO Y VETERINARIO; PRODUCTOS HIGI\u00C9NICOS Y SANITARIOS PARA USO M\u00C9DICO; ALIMENTOS Y SUSTANCIAS DIET\u00C9TICAS PARA USO M\u00C9DICO O VETERINARIO, ALIMENTOS PARA BEB\u00C9S; SUPLEMENTOS ALIMENTICIOS PARA PERSONAS O ANIMALES; EMPLASTOS, MATERIAL PARA AP\u00D3SITOS; MATERIAL PARA EMPASTES E IMPRESIONES DENTALES; DESINFECTANTES; PREPARACIONES PARA ELIMINAR ANIMALES DA\u00D1INOS; FUNGICIDAS, HERBICIDAS.', NULL),
(198, E'2023-009612', E'MP', E'mixta', E'25int', E'CALIFORNIA COLLECTION', E'COMPRENDE PRINCIPALMENTE LAS PRENDAS DE VESTIR, EL CALZADO; PARA DAMAS, CABALLEROS Y NI\u00D1OS, LENCERIA Y LOS ART\u00CDCULOS DE SOMBRERER\u00CDA PARA PERSONAS.', E'LA MARCA SOLICITADA CONSISTE, EN UNA ETIQUETA SIN ENMARCAR, SIN FONDO DE COLOR. SE APRECIA UNA FLOR DE PETALOS OVALADOS PUNTIAGUDOS, CUYOS PETALOS INTERNOS SON DE COLOR GRIS OSCURO Y LOS PETALOS EXTERNOS SON DE COLOR GRIS INTERMEDIO. DEBAJO DE LA FLOR ESTA ESCRITO LA PALABRA CALIFORNIA COLLECTION. LA PALABRA CALIFORNIA ESTA ESCRITA EN LETRA CORRIDA, EN CURSIVA, EN NEGRITA Y DE COLOR GRIS INTERMEDIO; LA PALABRA COLLECTION ESTA ESCRITA EN LETRA IMPRENTA, EN CURSIVA, DE COLOR GRIS INTERMEDIO. LA PALABRA COLLECTION EN IDIOMA CASTELLANO SIGNIFICA COLECCION.SE REIVINDICA EL CONJUNTO DESCRITO A EXCEPCION DE LOS ELEMENTOS GENERICOS QUE LA PRESENTE ETIQUETA PUDIESE CONTENER.'),
(199, E'2023-009789', E'MS', E'mixta', E'35int', E'IMPOL', E'Servicios de reagrupamiento por cuenta de terceros de productos (excepto su transporte), para que los consumidores puedan examinarlos y comprarlos a su conveniencia; este servicio puede ser prestado por comercios minoristas o mayoristas, o mediante cat\u00E1logos de venta por correo o medios de comunicaci\u00F3n electr\u00F3nicos, por ejemplo, sitios web o programas de tele-venta.', E'Consiste en una etiqueta de fondo color blanco, sobre la cual se observa una figura triangular, compuesta por tres figuras irregulares, todas ellas en forma de boomerang, entrelazadas entre ellas, siendo la del extremo izquierdo de fondo color amarillo, la del extremo superior de fondo color negro, y la del extremo derecho de fondo color verde oscuro, con la particularidad de que el centro de la figura se observa de color blanco. Debajo de la figura antes descrita, se lee la palabra IMPOL, escrita en letras caracter\u00EDsticas, en formato imprenta, en may\u00FAsculas y de fondo color verde oscuro. Se reivindica el conjunto descrito y los colores en \u00E9l se\u00F1alados.'),
(200, E'2023-009931', E'MS', E'grafica', E'43int', NULL, E'SERVICIOS DE RESTAURACI\u00D3N (ALIMENTACI\u00D3N), HOSPEDAJE TEMPORAL. -RESERVA DE ALOJAMIENTO TEMPORAL, POR EJEMPLO, LA RESERVA DE HOTELES, PARADOR TUR\u00CDSTICO;-SERVICIOS DE RESIDENCIAS PARA ANIMALES;-ALQUILER DE SALAS DE REUNI\u00D3N, TIENDAS DE CAMPA\u00D1A Y CONSTRUCCIONES TRANSPORTABLES;-SERVICIOS DE RESIDENCIAS PARA LA TERCERA EDAD;-SERVICIOS DE GUARDER\u00CDAS INFANTILES;-DECORACI\u00D3N DE ALIMENTOS, LA ESCULTURA DE ALIMENTOS;-ALQUILER DE APARATOS DE COCCI\u00D3N;-ALQUILER DE SILLAS, MESAS, MANTELER\u00CDA Y CRISTALER\u00CDA;-SERVICIOS DE BARES DE SHISHA;-SERVICIOS DE CHEFS DE COCINA A DOMICILIO.', E'EL LOGOTIPO DE "KORAL OHS HOTEL & MARINA MORROCOY" SE DSCRIBE EN UNA SUPERFICIE COLOR BLANCO, LAS LETRAS "K" EN COLOR MARRON OSCURO, "O" EN COLOR MOSTAZA CLARO, "RAL" EN COLOR MARR\u00D3N OSCURO, EN LA PARTE SUPERIOR DE LA LETRA "O" SE ENCUENTRAN UBICADOS UNOS P\u00C9TALOS U HOJAS DE LOS CUALES UNO EST\u00C1 EN COLOR MOSTAZA CLARO Y OTRO EN MARR\u00D3N OSCURO, DEBAJO DE LA PALABRA KORAL, LAS LETRAS "OHS HOTEL & MARINA" EN COLOR MARR\u00D3N OSCURO Y DEBAJO DE ESTAS, LAS LETRAS "MORROCOY" EN COLOR MOSTAZA CLARO. SE REIVINDICA LA TOTALIDAD DEL LOGO QUE SE PRETENDE PROTEGER Y TAMBI\u00C9N SE REIVINDICA EN TODOS LOS COLORES EN QUE SE PRESENTE EL MISMO.LA CENTRALIDAD DE LOS ELEMENTOS DEFINE UNA SIMETR\u00CDA EXACTA Y DE ALTO CONTRASTE ENTRE TIPOGRAF\u00CDA Y SILUETAS CREANDO UN BUEN IMPACTO PSICOL\u00D3GICO VISUAL. SE SOLICITA EL USO EXCLUSIVO DE LOS ELEMENTOS GR\u00C1FICOS QUE LA INTEGRAN, AS\u00CD COMO DE LOS COLORES ARRIBA INDICADOS, A EXCEPCI\u00D3N DE AQUELLOS COMPONENTES QUE POR SU NATURALEZA PUDIERAN CONSIDERARSE GEN\u00C9RICOS O DESCRIPTIVOS DE LOS PRODUCTOS QUE PRETENDE DISTINGUIR.'),
(201, E'2023-009999', E'MP', E'mixta', E'21int', E'AIKOZ', E'UTENSILIOS Y RECIPIENTES PARA USO DOM\u00C9STICO Y CULINARIO; UTENSILIOS DE COCINA Y VAJILLA, EXCEPTO TENEDORES, CUCHILLOS Y CUCHARAS; PEINES Y ESPONJAS; CEPILLOS; MATERIALES PARA FABRICAR CEPILLOS; MATERIAL DE LIMPIEZA; VIDRIO EN BRUTO O SEMIELABORADO, EXCEPTO VIDRIO DE CONSTRUCCI\u00D3N; ART\u00CDCULOS DE CRISTALER\u00CDA, PORCELANA Y LOZA.', E'CONSISTE EN UN RECTANGULO DE COLOR BLANCO, DENTRO DE ESTE SE ENCUENTRA LA PALABRA DE FANTASIA AIKOZ, EN UNA TIPOGRAFIA ESPECIAL, LA LETRA A Y Z ESTAN DE COLOR AMARILLO MOSTAZA Y LAS LETRAS I, K Y O ESTAN DE COLOR VERDE CLARO, A EXCEPCION DEL PUNTO QUE SE ENCUENTRA ARRIBA DE LA I , QUE ESTA DE COLOR AMARILLO MOSTAZA. DEBAJO DE LA PALABRA DE FANTASIA SE ENCUENTRA UNA LINEA EN FORMA DE MEDIA LUNA DE COLOR VERDE CLARO. SE REIVINDICA EL CONJUNTO ANTERIORMENTE DESCRITO Y LA COMBINACION DE COLORES SE HA HECHO EN CUMPLIMIENTO AL AVISO OFICIAL S/N EMANADO DEL REGISTRO DE LA PROPIEDAD INTELECTUAL FECHA 18 DE NOVIEMBRE DE 1996'),
