(206, E'2024-000709', E'MS', E'mixta', E'35int', E'Gmillet', E'Servicios de abastecimiento de productos farmac\u00E9uticos para terceros; demostraci\u00F3n de productos farmac\u00E9uticos; organizaci\u00F3n de exposiciones de productos farmac\u00E9uticos con fines comerciales o publicitarios; gesti\u00F3n informatizada de archivos y registros m\u00E9dicos; servicios de intermediaci\u00F3n comercial de productos farmac\u00E9uticos; presentaci\u00F3n de productos farmac\u00E9uticos en cualquier medio de comunicaci\u00F3n para su venta minorista; publicidad de productos farmac\u00E9uticos; suministro de espacios de venta en l\u00EDnea para vendedores y compradores de productos farmac\u00E9uticos y servicios relacionados al \u00E1rea de productos farmac\u00E9uticos.', E'El signo solicitado consiste en un dise\u00F1o conformado por los siguientes elementos: Se aprecia el termino GMILLET siendo que la letra G est\u00E1 escrita en letra molde, may\u00FAscula de color verde aguamarina, el trazado de dicha letra G est\u00E1 unida a lo que se asemeja a un semi-c\u00EDrculo de color verde aguamarina, seguidamente se observa el termino MILLET escrita en letra de molde, min\u00FAscula, de color negro. Se reivindica el conjunto y colores descritos con independencia del tama\u00F1o, y no as\u00ED las palabras o t\u00E9rminos gen\u00E9ricos (GMILLET= PALABRA DE FANTASIA), todo de acuerdo a los facs\u00EDmiles que se acompa\u00F1an.'),
