(209, E'2024-000970', E'MP', E'mixta', E'24int', E'ROSWILL', E'LA MARCA ES PARA IDENTIFICAR TEJIDOS Y SUS SUCED\u00C1NEOS; ROPA DE HOGAR; CORTINAS DE MATERIAS TEXTILES O DE MATERIAS PL\u00C1STICAS.TAMBIEN TELAS Y LAS FUNDAS DE TELA PARA USO DOM\u00C9STICO.LA ROPA DE HOGAR, LAS COLCHAS, LAS FUNDAS DE ALMOHADA, LAS TOALLAS DE MATERIAS TEXTILES, LA ROPA DE CAMA DE PAPEL, LOS SACOS DE DORMIR, LAS S\u00C1BANAS PARA SACOS DE DORMIR, LOS MOSQUITEROS.', E'CONSISTE EN LA REPRESENTACION GRAFICA DE LA PALABRA ROSWILL, LA CUAL PROVIENE DE LA UNION DE DOS NOMBRES "ROSMERY" Y "WILLIAM". LA MARCA A PROTEGER ESTA ESCRITA EN LETRAS MAYUSCULAS DE COLOR BLANCO CENTRADA EN UN FONDO DE COLOR FUCSIA. SE REIVINDICAN LOS COLORES.'),
(210, E'2024-000983', E'MS', E'mixta', E'35int', E'LUATEK', E'AGRUPAMIENTO POR CUENTA DE TERCEROS DE UNA AMPLIA VARIEDAD DE PRODUCTOS COMO: APARATOS DE ILUMINACI\u00D3N; APARATOS DE REFRIGERACI\u00D3N; APARATOS DE VENTILACI\u00D3N; APARATOS E INSTRUMENTOS PARA CONDUCIR INTERRUMPIR, TRANSFORMAR, ACUMULAR, REGULAR O CONTROLAR LA ELECTRICIDAD; DISPOSITIVOS DE GRABACI\u00D3N, TRANSMISI\u00D3N Y REPRODUCCI\u00D3N DE SONIDO O IM\u00C1GENES; ART\u00CDCULOS DE ILUMINACI\u00D3N; EQUIPOS DE PROCESAMIENTO DE DATOS Y COMPUTADORAS; ART\u00CDCULOS DE OFICINA; UTENSILIOS Y ENVASES DEL HOGAR O LA COCINA; PARA QUE LOS CONSUMIDORES PUEDAN VERLOS Y ADQUIRIRLOS CON COMODIDAD A TRAV\u00C9S DE SERVICIOS PRESTADOS POR COMERCIOS MINORISTAS O MAYORISTAS, DISTRIBUIDORES AUTOM\u00C1TICOS, CAT\u00C1LOGOS DE VENTA POR CORRESPONDENCIA O MEDIOS DE COMUNICACI\u00D3N ELECTR\u00D3NICOS TALES COMO SITIOS WEB O PROGRAMAS DE TELEVENTA; REPRESENTACI\u00D3N COMERCIAL DE APARATOS EL\u00C9CTRICOS, ELECTR\u00D3NICOS Y T\u00C9RMICOS.', E'CONSISTE EN LA PALABRA LUATEK (PALABRA DE FANTAS\u00CDA, TAL Y COMO SE SOLICITA NO TIENE TRADUCCI\u00D3N) ESCRITA EN LETRA DE IMPRENTA, MAY\u00DASCULA, DE TRAZO GRUESO Y DE COLOR AZUL; CON LA PARTICULARIDAD QUE LA BARRA HORIZONTAL DE LA LETRA A Y EL TRAZO MEDIO HORIZONTAL DE LA LETRA E, NO TIENEN CONTACTO CON EL ASTA IZQUIERDA DE LAS LETRAS. SE REIVINDICA LA PALABRA LAUTEK Y TODO EL CONJUNTO DESCRITO CON EL COLOR INDICADO EN \u00C9L.'),
(211, E'2024-001107', E'MS', E'mixta', E'35int', E'MAREAH', E'SERVICIOS DE AGENCIA DE IMPORTACI\u00D3N-EXPORTACI\u00D3N DE UNA AMPLIA GAMA DE PRODUCTOS: ALIMENTOS, ART\u00CDCULOS DE LIMPIEZA, BEBIDAS, ART\u00CDCULOS DE PERFUMER\u00CDA, ALIMENTOS PARA MASCOTAS, ENTRE OTROS; SERVICIOS DE VENTA MINORISTA DE PREPARACIONES FARMAC\u00C9UTICAS, VETERINARIAS Y SANITARIAS.', E'SE DESCRIBE UNA ETIQUETA DONDE SE OBSERVA UN DISE\u00D1O EN LA PARTE SUPERIOR DE DOS L\u00CDNEAS GRUESAS CURVAS, QUE SE UNEN EN EL EXTREMO INFERIOR IZQUIERDO, COMPUESTO POR LOS COLORES ROSADO, ANARANJADO Y AMARILLO DEGRADO QUE VAN EN ESE ORDEN DE IZQUIERDA A DERECHA. ABAJO SE OBSERVA LA PALABRA FANTAS\u00CDA \\\"MAREAH\\\" EN MAY\u00DASCULA CON UNA TIPOGRAF\u00CDA GRUESA Y ESPECIAL EN LAS LETRAS \\\"A\\\" Y \\\"H\\\" EN EL COLOR AZUL MARINO. SE REIVINDICA EL CONJUNTO DESCRITO CON INDEPENDENCIA DEL TAMA\u00D1O, Y NO AS\u00CD LAS PALABRAS, LEYENDAS GEN\u00C9RICAS O DESCRIPTIVAS POR SEPARADO, TODO SE ACUERDO A LOS FACS\u00CDMILES QUE SE ACOMPA\u00D1AN. SE REIVINDICAN LOS COLORES DESCRITOS.'),
(212, E'2024-001117', E'NC', E'mixta', E'46int', E'ARABITO FERRETERIAS', E'Empresa que se dedica a la compra y venta de materiales de construcci\u00F3n; productos de ferreter\u00EDa; productos e instrumentos agr\u00EDcolas.', E'Consiste en el termino ARABITO escrito en letra caracteristica en donde la letra A esta en color naranja y la letra O en color naranja y en el centro tiene forma de hexagono el resto de las letras en color negro y el punto de la letra i en color naranja separada por una linea blanca. Debajo del termino ARABITO destaca el termino FERRETERIAS (No se reivindica) escrita en letra caracteristica, en menor tama\u00F1o y en color negro. El conjunto antes descrito esta sobre un fondo blanco. Se reivindica el conjunto descrito y los colores. No se reivindica el termino Ferreterias.'),
(213, E'2024-001240', E'MP', E'denominativa', E'9int', E'EVOLUTION', E'BATER\u00CDAS Y ACUMULADORES EL\u00C9CTRICOS PARA VEH\u00CDCULOS, INCLUIDOS VEH\u00CDCULOS TERRESTRES, MOTOCICLETAS, EMBARCACIONES, COCHES DE GOLF; PILAS, PILAS RECARGABLES, APARATOS DE DIAGN\u00D3STICO PARA PILAS; BATER\u00CDAS ALKALINAS; BATER\u00CDAS DE ARRANQUE', NULL),
(214, E'2024-001327', E'MP', E'mixta', E'17int', E'MAXWELL', E'MATERIALES AISLANTES. CINTAS AISLANTES, CINTAS ADHESIVA DE REPARACI\u00D3N, MANGUERAS FLEXIBLES NO MET\u00C1LICAS, PINTURAS AISLANTES, CINTAS ADHESIVAS QUE NO SEAN DE PAPELER\u00CDA NI PARA USO M\u00C9DICO O DOM\u00C9STICO, JUNTAS PARA TUBER\u00CDAS, EMPAQUETADURAS.', E'SE OBSERVA UN SIGNO MIXTO, EN CUYOS COMPONENTES SE APRECIAN UN ELEMENTO DENOMINATIVO Y OTRO FIGURATIVO. EL ELEMENTO DENOMINATIVO EST\u00C1 COMPUESTO POR LA PALABRA MAXWELL, EN LETRA IMPRENTA, EN MAY\u00DASCULAS Y DE COLOR NEGRO. LA DENOMINACI\u00D3N MAXWELL NO TIENE TRADUCCI\u00D3N AL CASTELLANO, CONSTITUYENDO UN SIGNO DE FANTAS\u00CDA, EL CUAL POSEE UN SIGNIFICADO PROPIO, ES TOTALMENTE FRUTO DE LA IMAGINACI\u00D3N, Y NO TRANSMITE OTRO SIGNIFICADO M\u00C1S QUE EL DE ACTUAR COMO MARCA. EL ELEMENTO FIGURATIVO, SE ENCUENTRA MANIFIESTO A TRAV\u00C9S DE LA FIGURA DE UN OSO POLAR DE COLOR BLANCO, EN EL CUAL LAS L\u00CDNEAS SUPERIORES SON DE COLOR NEGRO, MIENTRAS QUE LAS INFERIORES SON DE COLOR ROJO, EN ESTE SENTIDO, LA FIGURA DEL OSO POLAR SE ENCUENTRA DIRECCIONADA CON LA CABEZA HACIA LA DERECHA Y SE UBICA SOBRE UNA L\u00CDNEA FINA DE COLOR ROJO. POR OTRO LADO, LA PALABRA MAXWELL SE ENCUENTRA UBICADA EN LA PARTE INFERIOR DEL REFERIDO DISE\u00D1O SOBRE UNA L\u00CDNEA DE COLOR NEGRO. SE REIVINDICA TODO EL DISE\u00D1O EN SU CONJUNTO.'),
(215, E'2024-001377', E'MP', E'mixta', E'29int', E'SEU ALIMENTOS', E'Carne, pescado, carne de ave y carne de caza; extractos de carne; frutas y verduras, hortalizas y legumbres en conserva, congelados, secas y cocidas; jaleas, confituras, compotas; huevos; leche y productos l\u00E1cteos, aceites y grasas comestibles. Leche condensada, lecha condensada con az\u00FAcar.', E'Consiste en un dise\u00F1o cuadrado de fondo blanco, en donde se puede observar escrita de forma horizontal la palabra SEU (palabra de fantas\u00EDa), en letras de imprenta, may\u00FAsculas, de trazo grueso y de color negro y bordes blancos. Debajo de esta, se aprecia la palabra Alimentos, escrita en letra de molde, may\u00FAsculas, de trazo fino y de color negro, en tama\u00F1o m\u00E1s peque\u00F1o. En la parte inferior de la letra \u201CS\u201D, parte una l\u00EDnea ondulada, la cual lleva una direcci\u00F3n ascendente y m\u00E1s gruesa en su parte central, terminando en una parte fina en su parte m\u00E1s alta y es de color rojo y finaliza sobre la letra \u201CN\u201D de la palabra alimentos. Paralela a esta, se encuentra otra l\u00EDnea ondulada, con las mismas caracter\u00EDsticas, de color naranja, con la diferencia que parte desde la parte inferior de la letra \u201CU\u201D y finaliza sobre la letra \u201CS\u201D de la palabra alimentos. Se reivindica el conjunto descrito, con su combinaci\u00F3n de colores a excepci\u00F3n del termino gen\u00E9rico \u201CAlimentos\u201D.'),
(216, E'2024-001415', E'MP', E'mixta', E'4int', E'FLUXUS', E'\u00C9TER DE PETR\u00D3LEO; GASES COMBUSTIBLES; GAS DE PETR\u00D3LEO; DI\u00C9SEL; VASELINA PARA USO INDUSTRIAL; FUEL [COMBUSTIBLE PESADO]; ACEITES COMBUSTIBLES; ACEITE DE ESQUISTO BITUMINOSO; ACEITES INDUSTRIALES; ACEITE DE MOTOR; PETR\u00D3LEO, CRUDO O REFINADO', E'CONSISTE EN LA PALABRA FLUXUS (TRADUCE AL CASTELLANO: FLUJO), ESCRITA EN LETRAS DE IMPRENTA, MAY\u00DASCULAS, DE TRAZO GRUESO Y DEGRADADAS DE COLOR AZUL CLARO A OSCURO DE IZQUIERDA A DERECHA. EN LA PARTE SUPERIOR SE OBSERVA LA FIGURA DE UN SHURIKEN AZUL DE TRES PUNTAS, CADA UNA FORMADA POR UNA MEDIALUNA Y UNIDAS EN EL CENTRO FORMANDO UNA GOTA DE COLOR BLANCO. SE REIVINDICA LA PALABRA FLUXUS Y TODO EL CONJUNTO DESCRITO CON LOS COLORES INDICADOS EN \u00C9L.'),
(217, E'2024-001548', E'MP', E'mixta', E'33int', E'T TAWALA', E'BEBIDAS ALCOHOLICAS (EXCEPTO CERVEZAS).', E'CONSISTE EN UNA ETIQUETA DE FONDO COLOR BLANCO, DENTRO DE LA CUAL SE OBSERVA EN SU PARTE CENTRAL UNA LETRA \"T\" MAY\u00DASCULA, EN LETRA MOLDE Y ESCRITA DE UNA FORMA PARTICULAR, EN CUANTO A SUS TERMINACIONES SUPERIORES E INFERIORES, DE TRAZO GRUESO DE COLOR NEGRO ENTREVIENDO EL FONDO DE COLOR BLANCO DE LA ETIQUETA, VI\u00C9NDOSE A SU VEZ INTERRUMPIDA EN SU PARTE CENTRAL POR LA PALABRA DE FANTAS\u00CDA \"TAWALA\", LA CUAL SE PROYECTA EN LETRA MOLDE Y MAY\u00DASCULA SOSTENIDA, TENIENDO EN SU COMPOSICI\u00D3N LAS SIGUIENTES CARACTER\u00CDSTICAS: LA LETRA \"T\" Y \"L\" EST\u00C1N ESCRITA EN COLOR NEGRO Y BORDEADAS CON UNA L\u00CDNEA SEMI GRUESA DE COLOR NEGRO DEJANDO VER EL COLOR BLANCO DEL FONDO DE LA ETIQUETA; LAS LETRAS \"AWA\" Y \"A\" SE PROYECTAN DE COLOR NEGRO BORDEADAS CON UNA L\u00CDNEA SEMI GRUESA DE COLOR NEGRO OBSERV\u00C1NDOSE CON UN EFECTO DE SOMBRA IRREGULAR Y ENTREVIENDO EL FONDO BLANCO DE LA ETIQUETA. SE REIVINDICA EL CONJUNTO DESCRITO.'),
(218, E'2024-001716', E'MP', E'mixta', E'3int', E'WILD OLIVE', E'Cosm\u00E9ticos; limpiadores faciales; cremas faciales; colorantes para el cabello; lociones para el cuerpo; mascarillas de belleza; champ\u00FAs; loci\u00F3n de ba\u00F1o; acondicionadores para el cabello; limpiadores de manos; exfoliantes corporales; aceites esenciales; cremas de manos; preparaciones con filtro solar; l\u00E1pices de labios [pintalabios]; aceites de masaje; pastillas de jab\u00F3n; t\u00F3nicos para uso cosm\u00E9tico; perfumes; preparaciones cosm\u00E9ticas para el tratamiento del cabello que no sean para uso m\u00E9dico.', E'La marca consiste en la palabra WILD OLIVE (Olivo Silvestre), escrita en letras may\u00FAsculas, manuscritas, estilizadas, gruesas de color negro sobre la cual se halla la figura de un ramillete de tres hojas con dos olivos en negro, gris y con toques ligeramente abrillantados, todo lo descrito sobre un fondo blanco. Lo esencial de la marca lo constituye el conjunto descrito. Se reivindican los colores blanco, negro y gris.'),
(219, E'2024-001777', E'MP', E'mixta', E'29int', E'KALY', E'CARNE, PESCADO, CARNE DE AVE Y CARNE DE CAZA; EXTRACTOS DE CARNE; FRUTAS YVERDURAS, HORTALIZAS Y LEGUMBRES EN CONSERVA, CONGELADAS, SECAS Y COCIDAS;JALEAS, MERMELADAS, CONFITURAS, COMPOTAS; HUEVOS; LECHE, QUESOS, MANTEQUILLA,YOGUR Y OTROS PRODUCTOS L\u00C1CTEOS; ACEITES Y GRASAS PARA USO ALIMENTICIO.', E'ES UN CIRCULO AMARILLO QUE ACEMEJA EL SOL CON UNA FINA LINEA DE COLOR BLANCO QUE BORDEA EL CIRDULO Y EN EL CENTRO DEL MISMO SE ENCUENTRA LA PALABRA KALY LETRAS DE COLOR ROJO Y EL BORDE DE COLOR BLANCO.'),
