(236, E'2024-003318', E'MP', E'mixta', E'16int', E'M M', E'CATALOGOS, CUADERNOS, ARTICULOS DE ESCRITURA, ETIQUETAS, FOLLETOS, FUNDAS PORTADOCUMENTOS, LAPICES, MARCADORES, PLUMAS (ARTICULOS DE OFICINA), SOBRES, TARJETAS, TOALLAS DE PAPEL, REVISTAS, PUBLICACIONES IMPRESAS, GRABADOS.', E'CONSISTE EN UNA ETIQUETA CUADRADA DE FONDO COLOR NEGRO Y BORDE DE COLOR BLANCO, DONDE SE OBSERVAN LAS LETRAS M Y M, ESCRITAS EN LETRA DE IMPRENTA, MAYUSCULA, DE TRAZO GRUESO, DE FONDO COLOR BLANCO, CON LA PARTICULARIDAD DE QUE DEBAJO DE LAS MISMAS, SE ENCUENTRAN DOS SEMICIRCULOS DE FONDO COLOR BLANCO, Y DENTRO DE LAS MISMAS SE ENCUENTRAN UNA FIGURA QUE ASEMEJA LA REPRESENTACION GRAFICA DE LA CABEZA DE UN PERRO Y SUS OREJAS DE FONDO COLOR NEGRO, Y EN LA DE AL LADO, UNA FIGURA QUE ASEMEJA LA REPRESENTACION GRAFICA DE LA CABEZA DE UN GATO CON SUS OREJAS, DE FONDO COLOR NEGRO. SE REIVINDICA TODO EL CONJUNTO DESCRITO ANTERIORMENTE, CON LOS COLORES INDICADOS EN EL, EXCEPTUANDO LOS TERMINOS GENERICOS Y DESCRIPTIVOS.'),
(237, E'2024-003463', E'MP', E'mixta', E'9int', E'FarmaPay', E'Aparatos para la transmisi\u00F3n de sonido, datos o im\u00E1genes ; aplicaciones de m\u00F3vil descargables para transmisi\u00F3n de informaci\u00F3n ; aplicaciones de m\u00F3viles ; aplicaciones de m\u00F3viles descargables para la gesti\u00F3n de datos ; aplicaciones de m\u00F3viles descargables para la gesti\u00F3n de informaci\u00F3n ; aplicaciones de m\u00F3viles descargables para transmisi\u00F3n de datos ; aplicaciones de software descargables ; aplicaciones descargables para su uso con dispositivos m\u00F3viles ; archivos digitales descargables autenticados por t\u00F3kenes no fungibles [nft] ; bases de datos electr\u00F3nicas ; bases de datos electr\u00F3nicas grabadas en soportes inform\u00E1ticos ; bases de datos inform\u00E1ticas ; bases de datos interactivas ; billeteras electr\u00F3nicas descargables ; dispositivos y medios para almacenamiento de datos ; equipos de procesamiento de datos ; libretas digitales ; motores de bases de datos ; plataformas de software para ordenadores ; plataformas de software, grabado o descargable ; plataformas y software de telefon\u00EDa digital ; programas de aplicaci\u00F3n ; programas de ordenador (software descargable) ; programas inform\u00E1ticos para el acceso, consulta y b\u00FAsqueda en bases de datos en l\u00EDnea ; programas inform\u00E1ticos para la gesti\u00F3n de bases de datos ; redes de datos ; registradores de datos ; software ; software de acceso multiusuario a redes inform\u00E1ticas mundiales de informaci\u00F3n ; software de aplicaci\u00F3n para dispositivos m\u00F3viles ; software de ordenador para su uso en dispositivos electr\u00F3nicos digitales m\u00F3viles de mano y otros productos electr\u00F3nicos de consumo ; software inform\u00E1tico de comercio electr\u00F3nico que permite a los usuarios realizar transacciones comerciales electr\u00F3nicas a trav\u00E9s de una red inform\u00E1tica ; software para gesti\u00F3n de datos y de fich