(238, E'2024-003557', E'MS', E'mixta', E'37int', E'AGC YOUR DREAMS, OUR CHALLENGE', E'CONSTRUCCI\u00D3N; ACRISTALAMIENTO DE VENTANAS; INSTALACI\u00D3N Y MANTENIMIENTO DE INSTALACIONES FOTOVOLTAICAS; REPARACI\u00D3N O MANTENIMIENTO DE AUTOM\u00D3VILES; SERVICIOS DE CALAFATEO DE EDIFICIOS; PINTURA, INTERIOR Y EXTERIOR; CARPINTER\u00CDA; IMPERMEABILIZACI\u00D3N DE EDIFICIOS; ALBA\u00D1ILER\u00CDA; RENOVACI\u00D3N DE EDIFICIOS; INSTALACI\u00D3N Y MANTENIMIENTO DE INSTALACIONES SOLARES T\u00C9RMICAS; SERVICIOS DE ASESORAMIENTO EN MATERIA DE CARPINTER\u00CDA; ASFALTADO; COLOCACI\u00D3N DE AZULEJOS, ALBA\u00D1ILER\u00CDA O COLOCACI\u00D3N DE BLOQUES; CONSTRUCCI\u00D3N DE OLEODUCTOS; INSTALACI\u00D3N Y REPARACI\u00D3N DE APARATOS DE AIRE ACONDICIONADO; REPARACI\u00D3N O MANTENIMIENTO DE MATERIAL RODANTE FERROVIARIO; REPARACI\u00D3N O MANTENIMIENTO DE EMBARCACIONES; REPARACI\u00D3N O MANTENIMIENTO DE AERONAVES; REPARACI\u00D3N O MANTENIMIENTO DE VEH\u00CDCULOS DE MOTOR DE DOS RUEDAS.', E'LA ETIQUETA QUE SE PRESENTA A CONTINUACI\u00D3N CONSISTE EN LA REPRESENTACI\u00D3N GR\u00C1FICA DE LA DENOMINACI\u00D3N AGC YOUR DREAMS, OUR CHALLENGE (AGC = PARTE DEL NOMBRE DEL MANDANTE, YOUR = SUS, DREAMS = SUE\u00D1OS, OUR = NUESTRO, CHALLENGE = DESAF\u00CDO), LAS LETRAS AGC SE ENCUENTRAN ESCRITA EN MAY\u00DASCULAS, DE COLOR AZUL OSCURO, CON LA PARTICULARIDAD QUE LA LETRA G PRESENTA EN LA PARTE INTERIOR UNA FRANJA DE COLOR ROJO EN FORMA DE TRAPEZOIDE, DEBAJO DE LAS LETRAS AGC SE ENCUENTRAN LA DENOMINACI\u00D3N YOUR DREAMS, OUR CHALLENGE ESCRITA EN MIN\u00DASCULAS, DE COLOR GRIS OSCURO, CON LA PARTICULARIDAD QUE LAS LETRAS Y, D, O Y C SE ENCUENTRAN ESCRITAS EN MAY\u00DASCULAS. EL FONDO DE LA ETIQUETA ES BLANCO, SE REIVINDICA EL CONJUNTO DESCRITO.'),
(239, E'2024-003597', E'MS', E'mixta', E'35int', E'ASTER', E'SERVICIOS DE PUBLICIDAD; MARKETING Y PROMOCION; SUMINISTRO DE ESPACIO EN SITIOS WEB PARA PUBLICIDAD DE BIENES Y SERVICIOS; PRESTACION DE SERVICIOS DE DIRECTORIO DE NEGOCIOS; ALQUILER DE VALLAS PUBLICITARIAS; PAGINA WEB COMERCIAL; TRABAJOS DE OFICINA; FERIAS Y EXPOSICIONES COMERCIALES DIRIGIDAS A LA EXPLOTACION DEL RUBRO TEXTIL Y DE CALZADO.', E'CONSISTE EN UNA ETIQUETA DE FONDO COLOR BLANCO, EN ELA CUAL SE PUEDE OBSERVAR EL NOMBRE MARCARIOS DISPUESTO EN LETRA MAYUSCULA Y TRAZO GRUESO CARACTERISTICO. ASTER CONSISTE EN UNA PALABRA DE FANTASIA, LA PARTICULARIDAD DE LA MARCA ES QUE LA LETRA R SOBRE SALE DEL CONJUNTO Y SE UNE CON UNAS FIGURAS DE COLOR BLANCO EN LO ALTA AZUL Y ROJA A LOS COSTADOS, EN TOTAL SON 3 FIGURAS SEMI CIRCULARES.'),
(240, E'2024-003632', E'MP', E'mixta', E'3int', E'IZY', E'DETERGENTE EN POLVO; JAB\u00D3N PARA LAVAR PLATOS; DETERGENTE LIQUIDO MULTIUSO; PRODUCTOS PARA LA LIMPIEZA DE SUPERFICIE Y PISO; JAB\u00D3N INDUSTRIAL; JAB\u00D3N L\u00CDQUIDO; JABONES; JABONES DESODORANTES; JABONES GRANULADOS; JABONES COSM\u00C9TICOS; JABONES DETERGENTES; JAB\u00D3N EN POLVO; JAB\u00D3N DE AFEITAR; ESPONJAS IMPREGNADAS DE JAB\u00D3N; JABONES Y GELES; JABONES PARA LA PIEL; JABONES PARA LA COLADA; JAB\u00D3N EN FORMA DE L\u00C1MINAS; JABONES PARA AVIVAR LOS TEJIDOS; JABONES DE TOCADOR NO MEDICINALES; JAB\u00D3N L\u00CDQUIDO PARA LAVAR LA LOZA; PASTILLAS DE JAB\u00D3N PARA LIMPIEZA DOM\u00C9STICA; DETERGENTES; DETERGENTE L\u00CDQUIDO; DETERGENTES DOM\u00C9STICOS; DETERGENTE PARA LAVAVAJILLAS; DETERGENTES PARA LAVANDER\u00CDAS; DETERGENTES DE ESPUMA; DETERGENTES PARA AUTOM\u00D3VILES; DETERGENTES SINT\u00C9TICOS PARA LA ROPA; TOALLITAS PARA GAFAS IMPREGNADAS CON DETERGENTE; PA\u00D1OS DE LIMPIEZA IMPREGNADOS CON DETERGENTE; PASTILLAS DE DETERGENTE PARA M\u00C1QUINAS DE CAF\u00C9; DETERGENTES QUE NO SEAN PARA PROCESOS DE FABRICACI\u00D3N NI PARA USO M\u00C9DICO.', E'LA MARCA CONSISTE EN UNA REPRESENTACI\u00D3N GR\u00C1FICA DEL T\u00C9RMINO DE FANTAS\u00CDA IZY EN COLOR AZUL Y ESCRITA EN CARACTERES DE IMPRENTA DE TRAZO GRUESO, DONDE LA LETRA I SE REPRESENTA EN MIN\u00DASCULA Y EL RESTO DE LAS LETRAS SON MA\u00DASCULAS DE COLOR AZUL M\u00C1S OSCURO, DEGRADANDO SUS EXTREMOS EN COLOR AZUL M\u00C1S CLARO HACIA EL LADO DERECHO DEL SIGNO, COMO SE PUEDE OBSERVAR LA LETRA Z CORTA CON UNA L\u00CDNEA SINUOSA INFERIOR A LA LETRA Y; LAS LETRAS TIENEN APARIENCIA Y BRILLOS PARA HACER PERCIBIR QUE TIENEN VOL\u00DAMEN. REIVINDICAMOS EL ALCANCE DE ESTRA DESCRIPCI\u00D3N CON SUS COLORES Y PARTICULARIDADES.'),
(241, E'2024-003658', E'MP', E'mixta', E'3int', E'LUVENE', E'PREPARACIONES PARA BLANQUEAR Y OTRAS SUSTANCIAS PARA LAVAR; PREPARACIONES PARA LIMPIAR, PULIR, DESGRASAR Y RASPAR, JABONES, PERFUMER\u00CDA, ACEITES ESENCIALES, COSM\u00C9TICOS, LOCIONES PARA EL CABELLO, DENT\u00CDFRICOS, DESODORANTES, TALCO DE TOCADOR.', E'OBSERVAMOS LA PALABRA LUVENE (DEL INGLES: AMOR) ESCRITA EN LETRAS DE MOLDE CURSIVAS, ESTANDO LA LETRA L EN MAY\u00DASCULA Y EL RESTO DE LAS LETRAS EN MIN\u00DASCULAS, ENCIMA DE LA ULTIMA LETRA E SE VE UNA TILDE INCLINADA HACIA LA IZQUIERDA, LA PALABRA ESTA DIBUJADA EN COLOR NEGRO EN UN FONDO BLANCO. SE REIVINDICA EL CONJUNTO ANTERIORMENTE DESCRITO, LA DESCRIPCI\u00D3N DE LOS COLORES SE HA HECHO EN CUMPLIMIENTO AL AVISO OFICIAL S/N EMANADO DEL REGISTRO DE LA PROPIEDAD INTELECTUAL, FECHADO 18/11/1996.'),
(242, E'2024-003934', E'MP', E'denominativa', E'5int', E'CELAFLOR', E'Preparaciones para uso veterinario; lociones para uso veterinario; preparaciones para eliminar animales da\u00F1inos; productos antiparasitarios; insecticidas; productos para lavar el ganado [insecticidas]; repelentes de insectos; productos para lavar animales [insecticidas] para el control de pulgas, piojos, garrapatas y moscas en bovinos, ovinos, porcinos, caballos y perros; preparaciones matamoscas; preparaciones qu\u00EDmicas para uso veterinario; pesticidas; preparaciones de tratamiento antipiojos [pediculicida]; champ\u00FAs insecticidas para animales; productos de lavado insecticidas para uso veterinario; champ\u00FAs medicinales para animales de compa\u00F1\u00EDa.', NULL),
(243, E'2024-003960', E'MS', E'mixta', E'44int', E'MENTALINK', E'SERVICIOS DESTINADOS A PROTEGER Y PROMOVER EL BIENESTAR PSICOLOGICO, AS\u00CD COMO TRATAR TRASTORNOS DE LA SALUD MENTAL.', E'CONSISTE EN UNA ETIQUETA SOBRE UN FONDO GRIS CLARO CONFORMADA POR UNA FIGURA SEMICIRCULAR QUE ASEMEJA LA SILUETA DE UNA PERSONA DE LINEAS DELGADAS DE COLOR AZUL Y EN LA CONTRAPCARA UNA LINEA CIRCULAR LIGERAMENTE MAS GRUESA DE COLOR AZUL CLARO. DENTRO DE LA FIGURA SE MUESTRA UN EXAGONO DE LINEAS DE COLOR AZUL OSCURO CON SEIS EXTENSIONES TAMBIEN DE COLOR AZUL DOBLADAS DURANTE SU RECORRIDO Y CULMINANDO CON UN CIRCULO AZUL OSCURO CON FONDO GRIS CLARO. DENTRO DEL EXAGONO SE REPRODUCE UNA FIGURA CIRCULAR DE COLOR AZUL CLARO CON VARIOS SEMICIRCULOS CON LIGEROS CORTES EN SUS EXTREMOS. EN LA PARTE INFERIOR DE LA FIGURA, SE REPRODUCE LA PALABRA \"MENTALINK\" (LINK TRADUCIDO DEL INDIOMA INGL\u00C9S AL ESPA\u00D1OL SIGNIFICA: ENLACE) ESTANDO LA PALABRA \"MENTA\" EN COLOR AZUL OSCURO Y LINK EN AZUL CLARO. SE REIVINDICAN LOS DISE\u00D1OS, FORMAS Y COLORES.'),
(244, E'2024-004466', E'MP', E'mixta', E'12int', E'ZETA´S MOTORCYCLE PARTS', E'MOTOCICLETAS, REPUESTOS DE LAS MISMAS, AMORTIGUADORES, EMBRAGUES, BOMBAS DE AIRE Y RINES', E'CONSISTE EN UN CIRCULO DE FONDO COLOR BLANCO, QUE EN EL TERCIO SUPERIOR TIENE DOS LINEAS QUE CONFLUYEN Y LUEGO SE UNEN DE MANERA ASCENDENTE, FORMANDO UNA V INVERTIDA Y A LOS LADOS DOS PUNTAS SEMEJANDO SER UNA CORONA Y EN LOS DOS TERCIOS INFERIORES, TIENE UNA ZETA DEL LADO IZQUIERDO Y UNA Z INVERTIDA DEL LADO DERECHO Y ENTRE AMBAS UNA FIGURA QUE SEMEJA SER UN EMBUDO APUNTANDO HACIA ABAJO, TANTO EN LA PARTE SUPERIOR E INFERIOR DEL CIRCULO ASI COMO PARTE DE LAS Z Y EL EMBUDO SE OBSERVA LA PRESENCIA DEL COLOR GRIS, DEBAJO DE LA FIGURA DESCRITA SE LEE LA PALABRA ZETA´S MOTORCYCLE PARTS EN LETRAS DE COLOR BLANCO DE TRAZOS GRUESOS Y SOBRE UN FONDO MUY TENUE DE COLOR GRIS, QUE TRADUCIDO AL CASTELLANO SIGNIFICA ZETA´S PARTES DE MOTOCICLETAS, NO SE REIVINDICAN LAS PALABRAS, TERMINOS O FIGURAS QUE PUDIERAN RESULTAR GENERICOS O DESCRIPTIVOS, MAS SI SE REIVINDICAN LOS COLORES'),
(245, E'2024-004614', E'MP', E'mixta', E'16int', E'MI REGALO PA CHAVEZ ES VOTANDO', E'PAPEL Y CART\u00D3N; PRODUCTOS DE IMPRENTA; MATERIAL DE ENCUADERNACI\u00D3N; FOTOGRAF\u00CDAS; ART\u00CDCULOS DE PAPELER\u00CDA Y ART\u00CDCULOS DE OFICINA, HOJAS, PEL\u00CDCULAS Y BOLSAS DE MATERIAS PL\u00C1STICAS PARA EMBALAR Y EMPAQUETAR; CARACTERES DE IMPRENTA, CLICH\u00C9S DE IMPRENTA.', E'EL LOGOTIPO CONSISTE EN LA FRASE \"MI REGALO PA CHAVEZ ES VOTANDO\" DE LAS CUALES EN LA PARTE SUPERIOR SE DISTINGUE QUE LAS PALABRAS \"MI\" Y \"PA\" SON EN LETRA CURSIVA Y COLOR NEGRO, LA PALABRA \"REGALO\" ES DE COLOR ROJO CON UN LEVE OSCURECIMIENTO HACIA LA DERECHA Y LA PALABRA \"CHAVEZ\" ES COMPLETAMENTE EN MAYUSCULA Y DE COLOR AZUL, CON UN LEVE OSCURECIMIENTO HACIA LA PARTE IZQUIERDA, DEBAJO SE PUEDE LEER LAS PALABRAS \"ES\" Y \"VOTANDO\", IGUALMENTE EN LETRA CURSIVA Y COLOR NEGRO, ESTA ULTIMA SE ENCUENTRA SUBRAYADA Y VIENE SEGUIDA DE DOS SIGNOS DE EXCLAMACION. SE REIVINDICA LA TOTALIDAD DEL LOGOTIPO INCLUYENDO SUS COLORES Y NO LOS ELEMENTOS QUE LOS CONSTITUYEN DE FORMA SEPARADA.'),
(246, E'2024-004796', E'MP', E'mixta', E'16int', E'HO.LA', E'LIBROS Y PUBLICACIONES DE TODO GENERO.', E'Consiste en una figura triangular que es dividida en dos por una l\u00EDnea blanca en el centro y esta misma l\u00EDnea se ensancha en la parte inferior. Esta triangulo descrito anteriormente tiene en sus parte interior varias l\u00EDneas de color blanco de trazos fino que subdivide a esta figura en varias en varias figuras geom\u00E9tricas de color azul de varia tonalidades como azul oscuro, claro y oro de mayor claridad. En la parte inferior de este triangulo subdividido podemos ver una figura que se entrecruza de color gris y de esta uni\u00F3n se ve una figura en forma de rombo de color gris oscuro. En la parte inferior de las figuras antes descrita encontramos las letras HO que en qu\u00EDmica significa o equivale al elemento HOLMIO Es un metal relativamente blando, plateado, bastante resistente a la corrosi\u00F3n y maleable, seguidamente encontramos un punto seguidamente de la HO y despu\u00E9s del punto encontramos las letras LA que es la sexta nota de la escala musical. Las cuatro letras mas el punto estos escritos en trazos gruesos de color gris y en may\u00FAscula. Se reivindica los colores, figuras y letras anteriormente descritas.'),
(247, E'2024-004891', E'MS', E'mixta', E'38int', E'PORTADAS AL D\u00CDA', E'COMPRENDE PRINCIPALMENTE LOS SERVICIOS QUE PERMITEN LA COMUNICACI\u00D3N ENTRE AL MENOS DOS PARTES, AS\u00CD COMO LOS SERVICIOS DE DIFUSI\u00D3N Y TRANSMISI\u00D3N DE DATOS; SERVICIOS DE TELECOMUNICACIONES; LA RADIODIFUSI\u00D3N Y LA TELEDIFUSI\u00D3N; LA TRANSMISI\u00D3N DE V\u00CDDEO A LA CARTA; ALQUILER DE TIEMPO DE ACCESO A REDES INFORM\u00C1TICAS MUNDIALES; COMUNICACIONES POR TERMINALES DE ORDENADOR / COMUNICACIONES POR TERMINALES DE COMPUTADORA; COMUNICACIONES TELEF\u00D3NICAS; SERVICIOS DE COMUNICACI\u00D3N POR TELEFON\u00CDA M\u00D3VIL; TRANSMISI\u00D3N DE ARCHIVOS DIGITALES / TRANSMISI\u00D3N DE ARCHIVOS INFORM\u00C1TICOS; TRANSMISI\u00D3N DE FLUJO CONTINUO DE DATOS [STREAMING].', E'\u201CSE DESCRIBE UNA ETIQUETA CON UN FONDO COLOR NARANJA DONDE SE OBSERVA LA PALABRA \u201CPORTADAS\u201D ESCRITA EN MAY\u00DASCULAS DE UN TAMA\u00D1O MUCHO MAYOR A LOS DEM\u00C1S COMPONENTES Y SITUADA EN EL CENTRO; DEBAJO DE ESTA SE OBSERVA LA PALABRA \u201CAL\u201D ESCRITA EN MINISCULAS DE UN TAMA\u00D1O MUCHO MENOR AL RESTO Y AL LADO DE ESTA SE OBSERVA LA PALABRA \u201CD\u00CDA\u201D ESTAS PALABRAS SE ENCUENTRAN ESCRITAS EN COLOR BLANCO; LAS PALABRAS DESCRITAS SE ENCUENTRAN SOBRE UN CIRCULO NARANJA CON DEGRADADO AMARILLO Y ESTE CIRCULO A LOS LADOS TIENE DOS FIGURAS QUE SIMULAN SER DOS SEMICIRCULOS DE COLOR NARANJA DEGRADADO A ROJO CON UNA FRANJA DELGADA DE COLOR VERDE. SE REIVINDICA EL CONJUNTO DESCRITO INCLUYENDO LOS COLORES, CON INDEPENDENCIA DEL TAMA\u00D1O. Y NO AS\u00CD LA PALABRA GEN\u00C9RICA \u201CD\u00CDA\u201D, TODO DE ACUERDO A LOS FACS\u00CDMILES QUE SE ACOMPA\u00D1AN\u201D.'),
(248, E'2024-004983', E'MP', E'mixta', E'9int', E'FEITIAN', E'DISPOSITIVOS DE MEMORIA DE ORDENADOR; APARATOS DE TRATAMIENTO DE DATOS; PROGRAMAS DE ORDENADOR, GRABADOS; TARJETAS DE IDENTIDAD, MAGN\u00C9TICAS; DISPOSITIVOS PERIF\u00C9RICOS DE ORDENADOR; LECTORES \u00D3PTICOS DE CARACTERES; LECTORES [EQUIPO DE TRATAMIENTO DE DATOS];ESC\u00C1NERES PARA TRATAMIENTO DE DATOS; TARJETAS DE CIRCUITO INTEGRADO [TARJETAS INTELIGENTES]; UNIDADES FLASH USB; FICHAS DE SEGURIDAD [DISPOSITIVOS DE CIFRADO]; TERMINALES DE PANTALLA T\u00C1CTIL INTERACTIVA; MONEDEROS ELECTR\u00D3NICOS DESCARGABLES; IMPRESORAS DE C\u00D3DIGOS DE BARRAS; TERMINALES DE ORDENADOR; CAJAS REGISTRADORAS ELECTR\u00D3NICAS; M\u00C1QUINAS DE PUNTO DE VENTA [M\u00C1QUINAS DE PUNTO DE VENTA]; ESC\u00C1NERES BIOM\u00C9TRICOS; CAJAS REGISTRADORAS; EQUIPOS DE RECONOCIMIENTO FACIAL; IDENTIFICADORES DE HUELLAS DACTILARES; CRON\u00D3GRAFOS [APARATOS DE REGISTRO DE TIEMPO] ;APARATOS DE REGISTRO DE TIEMPO.', E'EL SIGNO QUE SE PRESENTA A CONTINUACI\u00D3N SE ENCUENTRA CONFORMADO POR LA PALABRA DE FANTAS\u00CDA  \u00ABFEITIAN\u00BB, LA CUAL, NO POSEE TRADUCCI\u00D3N ALGUNA AL IDIOMA CASTELLANO NI TIENE UN SIGNIFICADO ESPEC\u00CDFICO Y, EN SU CONJUNTO, NO TIENE NING\u00DAN SIGNIFICADO EN EL COMERCIO O LA INDUSTRIA PERTINENTE O APLICADA A LOS PRODUCTOS ENUMERADOS EN LA SOLICITUD. LA PALABRA SE ENCUENTRA ESCRITA EN LETRAS MAY\u00DD\u00DASCULAS, DE MOLDE, DE COLOR NEGRO, DE TRAZOS GRUESOS, CON UNA TIPOGRAF\u00CDA ESPECIAL, POSICIONADA DE FORMA HORIZONTAL, SOBRE UN FONDO DE COLOR BLANCO. SE REIVINDICA EL CONJUNTO DESCRITO EN SU TOTALIDAD SIN REIVINDICAR NING\u00DAN ELEMENTO QUE, DE FORMA AISLADA, PUEDA SER CONSIDERADO GEN\u00C9RICO O DESCRIPTIVO EN LA CLASE SOLICITADA.'),
(249, E'2024-005013', E'MS', E'denominativa', E'41int', E'APPLE SPORTS', E'Servicios de entretenimiento; suministro (provisi\u00F3n) de informaci\u00F3n de noticias; suministro (provisi\u00F3n) de noticias e informaci\u00F3n deportiva, resultados deportivos, estad\u00EDsticas deportivas, pron\u00F3sticos de apuestas, informaci\u00F3n sobre atletas, informaci\u00F3n sobre deportes de fantas\u00EDa (fantasy sports), informaci\u00F3n sobre competiciones deportivas, comentarios, v\u00EDdeos deportivos, televisi\u00F3n deportiva, eventos deportivos en directo y otras informaciones sobre temas de deportes; servicios de entretenimiento, en particular, provisi\u00F3n (suministro) de programas de televisi\u00F3n en curso en el \u00E1mbito de los deportes a trav\u00E9s de una red de computadora; servicios de entretenimiento, a saber, producci\u00F3n y distribuci\u00F3n de programas de televisi\u00F3n en curso (ongoing television) en el \u00E1mbito de deportes a trav\u00E9s de una red inform\u00E1tica; servicios de entretenimiento, incluyendo, servicios de producci\u00F3n y distribuci\u00F3n de programas de televisi\u00F3n en curso (ongoing televisi\u00F3n) en el \u00E1mbito deportivo; suministro (provisi\u00F3n) de juegos de computadoras, juegos interactivos y videojuegos no descargables.', NULL),
(250, E'2024-005030', E'MP', E'denominativa', E'19int', E'KERAKOLL', E'MATERIALES DE CONSTRUCCI\u00D3N NO MET\u00C1LICOS; COMPUESTOS DE MASILLA; MATERIALES Y ELEMENTOS DE CONSTRUCCI\u00D3N Y CONSTRUCCI\u00D3N A BASE DE ARENA, PIEDRA, ROCA, ARCILLA, MINERALES Y CONCRETO; MORTERO DE REVESTIMIENTO; MORTERO; REVESTIMIENTOS NO MET\u00C1LICOS PARA CONSTRUCCI\u00D3N Y EDIFICACI\u00D3N; MATERIALES DE REVESTIMIENTO (NO MET\u00C1LICOS); YESO PARA USO EN CER\u00C1MICA; RODAPI\u00C9S [FRISOS] NO MET\u00C1LICOS; BALDOSAS NO MET\u00C1LICAS PARA LA CONSTRUCCI\u00D3N; MOSAICOS PARA LA CONSTRUCCI\u00D3N; CONCRETO; RECUBRIMIENTOS IMPERMEABILIZANTES CEMENTOSOS; AGLUTINANTES Y SOLERAS PREMEZCLADAS PARA HACER SUBSUELOS ANTES DE COLOCAR LOS PISOS; MORTEROS PREMEZCLADOS PARA RESTAURAR CONCRETO Y MAMPOSTER\u00CDA; EMPLASTOS.', NULL),
(251, E'2024-005075', E'MP', E'mixta', E'11int', E'PERFECT SENSE', E'APARTOS DE DISTRIBUCION DE AGUA, INSTALACIONES SANITARIAS Y APARATOS DESIFECTANTES', E'LA IMAGEN ESTA COMPUESTA POR UN FONDO BLANCO UN ELEMENTO GRAFICO Y UN TEXTO EN COLOR NEGRO EL ELEMENTO GRAFICO UBICADO EN EL LADO IZQUIERDO DE LA IMAGEN COMPUESTO POR FIGURAS GEOMETRICAS CONSISTE EN UNA REPRESENTACI\u00D3N ESTILIZADA DE TRES (3) CAPAS SUPERPUESTAS LA CAPA SUPERIOR DA LA ILUSION OPTICA DE FORMA DE DIAMANTE POR DEBAJO HAY OTRAS DOS CAPAS ANGULADAS QUE DAN LA SENSACION DE PROFUNDIDAD O TRIDIMENSIONALIDAD Y LA CAPA CENTRAL TIENE LINEAS HORIZONTALES QUE SUGIEREN TEXTURA A LA DERECHA DE LA GRAFICA SE ENCUENTRA EL TEXTO. COMPUESTO POR DOS PALABRAS PERFECT SENSE PERFECTA SENSACI\u00D3N) AMBAS PALABRAS ESCRITAS EN TIPOGRAFIA SANS-SERIF NEGRITA LA PALABRA PERFECT QUE SIGNIFICA PERFECTA ESCRITA CON LA LETRA P EN MAYUSCULA Y LA LETRAS ERFECT MINUSCULAS Y CON LA CARACTERISTICA QUE LA SEGUNDA E TIENE UNA LEVE INCLINACION QUE REPRESENTA LO DIFERENTE, NUEVO, NOVEDOSO, ADEMAS EL TAMA\u00D1O DE LA FUENTE ES LIGERAMENTE MAS GRANDE CON RESPECTO DE LA PALABRA SENSE POR OTRA PARTE LA PALABRA SENSE QUE SIGNIFICA SENSACION SE ENCUENTRA ESCRITA CON LA S INICIAL EN MAYUSCULA Y LAS LETRAS ENSE EN MINUSCULAS'),
