(256, E'2024-005392', E'MP', E'mixta', E'11int', E'ROC', E'APARATOS E INSTALACIONES DE ALUMBRADO, CALEFACCI\u00D3N, ENFRIAMIENTO, PRODUCCI\u00D3N DE VAPOR, COCCI\u00D3N, SECADO, VENTILACI\u00D3N Y DISTRIBUCI\u00D3N DE AGUA, AS\u00CD COMO INSTALACIONES SANITARIAS, NEVERAS, AIRE ACONDICIONADO, SECADORA PARA ROPA, MICROONDAS, HORNO, VENTILADOR, LAMPARA, COCINAS, CALENTADOR DE AGUA, ARTEFACTOS SANITARIOS Y ACCESORIOS.', E'CONSISTE EN UN ISOLOGO DE FONDO DE COLOR NEGRO QUE EN EL CENTRO SE APRECIA UNA SILUETA ANIMAL DE COLOR BLANCO QUE SE ASEMEJA A LA CABEZA DE UN GALLO EL MISMO SE ENCUENTRA EN DIRECCI\u00D3N HACIA LA DERECHA, EL PLUMAJE DEL CUELLO SE APRECIA DE MANERA PUNTEAGUDAS EL OJO SE ENCUENTRA UN POCO CERRADO DEBAJO DE EL UN PEQUE\u00D1O RAYO DE COLOR BLANCO, DEL LADO DERECHO DEL PICO SE OBSERVA UN PEQUE\u00D1O PUNTO DE COLOR BLANCO DEBAJO DE LA FIGURA ANIMAL SE APRECIAN LAS LETRAS (ROC) ESCRITAS DE COLOR BLANCO Y REPRESENTANDO UNA PALABRA DE FANTAS\u00CDA SIN NING\u00DAN SIGNIFICADO. SE REIVINDICAN LOS COLORES, FORMAS Y DISE\u00D1OS PRESENTADOS.'),
(257, E'2024-005406', E'MP', E'mixta', E'29int', E'MOLLY', E'AT\u00DAN EN LATA, AT\u00DAN EN ACEITE, AT\u00DAN (EN CONSERVA), AT\u00DAN (PESCADO), AT\u00DAN (PESCADO NO VIVO).', E'LA FIGURA ESTA REPRESENTADA POR UN ISOLOGO, ES UN CIRCULO DE COLOR ROJO CLARO, DENTRO DE ESTE SE PUEDE OBSERVAR UN GRUPO DE LETRAS QUE FORMAN LA PALABRA MOLLY EN TRAZOS GRUESOS DE COLOR BLANCO, A SU AL REDEDOR SE PUEDE APRECIAR UN GRUPO DE LINEAS EN TRAZOS GRUESOS DE COLOR BLANCO QUE EST\u00C1N EN FORMAS DE CIRCULO SOBRE EL TEXTO SE PUEDE DECIR CON SON SEMIC\u00CDRCULOS INCLINADOS MAS AL COSTADO IZQUIERDO DE LA PALABRA, ENTRE EL SEMIC\u00CDRCULO MAS ESPEC\u00CDFICAMENTE SOBRE LAS LETRAS LL SE PUEDE OBSERVAR UN CIRCULO PEQUE\u00D1O DE COLOR BLANCO, TODO ESTE CONJUNTO SE REIVINDICA, AS\u00CD COMO SU COLORES, A EXCEPCI\u00D3N DE ELEMENTOS QUE POR USTEDES PUDIERAN SER TOMADOS COMO GEN\u00C9RICOS, LA PALABRA MOLLY ES UNA PALABRA DE FANTAS\u00CDA(COMPUESTA), MOTIVO POR EL CUAL NO TIENE NING\u00DAN TIPO DE TRADUCCI\u00D3N.'),
(258, E'2024-005412', E'MS', E'mixta', E'35int', E'NEXGO CLOUD', E'SERVICIOS DE ALQUILER DE SISTEMAS DE PUNTO DE VENTA ELECTR\u00D3NICO, GESTI\u00D3N DE NEGOCIOS COMERCIALES DE PUNTOS DE VENTA AL MAYOR Y DETAL, PROMOCI\u00D3N DE LA VENTA DE PRODUCTOS Y SERVICIOS DE TERCEROS MEDIANTE LA CONCESI\u00D3N DE PUNTOS DE COMPRA POR EL USO DE TARJETA DE CR\u00C9DITO, PROMOCI\u00D3N DE VENTAS EN PUNTOS DE COMPRA O DE VENTAS, PARA TERCEROS, ASISTENCIA EN LA ADMINISTRACI\u00D3N COMERCIAL A TRAV\u00C9S DE LA SUPERVISION DE PUNTOS DE VENTA PROMOCIONALES.', E'LOGO TIPO IMAGOTIPO, USANDO TIPOGRAF\u00CDA SOFACHOME BOOK Y COLOR AZUL, TANTO PARA EL TEXTO COMO PARA LA IMAGEN, SE LEE DE LADO DERECHO LA PALABRA NEXGO CLOUD, EL CUAL NEXGO ES SIN NING\u00DAN TIPO DE TRADUCCI\u00D3N DE COLOR AZUL Y LA PALABRA CLOUD TRADUCIDO AL ESPA\u00D1OL SIGNIFICA NUBE, Y DEL LADO IZQUIERDO UN GRUPO DE LINEAS SOBREPUESTAS ENTRE SI DE COLOR AZUL, SE REIVINDICA EL CONJUNTO DESCRITO, A EXCEPCI\u00D3N DE AQUELLOS ELEMENTOS QUE PUEDAN SER TOMADOS COMO GEN\u00C9RICOS.'),
