(260, E'2024-006078', E'MP', E'mixta', E'9int', E'VDI', E'Aparatos e instrumentos cient\u00EDficos, de investigaci\u00F3n, de navegaci\u00F3n, geod\u00E9sicos, fotogr\u00E1ficos, cinematogr\u00E1ficos, audiovisuales, \u00F3pticos, de pesaje, de medici\u00F3n, de se\u00F1alizaci\u00F3n, de detecci\u00F3n, de pruebas, de inspecci\u00F3n, de salvamento y de ense\u00F1anza; aparatos e instrumentos de conducci\u00F3n, distribuci\u00F3n, transformaci\u00F3n, acumulaci\u00F3n, regulaci\u00F3n o control de la distribuci\u00F3n o del consumo de electricidad; aparatos e instrumentos de grabaci\u00F3n, transmisi\u00F3n, reproducci\u00F3n o tratamiento de sonidos, im\u00E1genes o datos; soportes grabados o descargables, software, soportes de registro y almacenamiento digitales o an\u00E1logos v\u00EDrgenes; mecanismos para aparatos que funcionan con monedas; cajas registradoras, dispositivos de c\u00E1lculo; ordenadores y perif\u00E9ricos de ordenador; trajes de buceo, m\u00E1scaras de buceo, tapones auditivos para buceo, pinzas nasales para submarinistas y nadadores, guantes de buceo, aparatos de respiraci\u00F3n para la nataci\u00F3n subacu\u00E1tica; extintores.', E'EL LOGO VDI ES UNA COMBINACION DE LA ABREVIATURA DE VENEZOLANA DE INGENIERIA PARA PRODUCTOS DE INGENIERIA ELECTRICA, ELECTRONICA Y TELECOMUNICACIONES , CON LETRAS NEGRAS Y FONDO BLANCO'),
(261, E'2024-006104', E'MS', E'mixta', E'41int', E'JUEGOS INDIGENAS', E'EDUCACI\u00D3N; FORMACI\u00D3N; SERVICIOS DE ENTRETENIMIENTO; ACTIVIDADES DEPORTIVAS Y CULTURALES. LA ORGANIZACI\u00D3N DE EXPOSICIONES CON FINES CULTURALES O EDUCATIVOS, LA ORGANIZACI\u00D3N Y LA DIRECCI\u00D3N DE CONFERENCIAS, CONGRESOS Y SIMPOSIOS; LA PUBLICACI\u00D3N DE LIBROS Y TEXTOS, QUE NO SEAN TEXTOS PUBLICITARIOS;LOS SERVICIOS DE REPORTEROS, LOS REPORTAJES FOTOGR\u00C1FICOS;LOS SERVICIOS FOTOGR\u00C1FICOS;LA REALIZACI\u00D3N Y LA PRODUCCI\u00D3N DE PEL\u00CDCULAS NO PUBLICITARIAS;LOS SERVICIOS CULTURALES, EDUCATIVOS Y RECREATIVOS PRESTADOS POR PARQUES DE ATRACCIONES, CIRCOS, ZOOS, GALER\u00CDAS DE ARTE Y MUSEOS;LOS SERVICIOS DE ENTRENAMIENTO DEPORTIVO Y PARA EL MANTENIMIENTO F\u00CDSICO; LA RESERVA DE ENTRADAS Y LOS SERVICIOS DE RESERVA PARA EVENTOS EDUCATIVOS, DEPORTIVOS Y DE ENTRETENIMIENTO; ALQUILER DE CAMPOS DE DEPORTE, ORGANIZACI\u00D3N Y DIRECCI\u00D3N DE EVENTOS DEPORTIVOS, LIGA DEPORTIVA.', E'CONSISTE EN UNA ETIQUETA DE FONDO COLOR BLANCO EN EL CUAL SE ENCUENTRA DISPUESTA UNA FIGURA CARACTERISTICA CON DISE\u00D1O CARACTERISTCIO Y PARTICULAR ASIMETRICO, EN COLOR BLANCO SOBRE FONDO VINOTINTO POSEE UNS CIRCULOS PEUQE\u00D1OS, EN EL CENTRO UNA LINEA CARACOL DE COLOR VINOTINTO Y EN LA PARTE SUPERIOR DERECHO LAS SIGLAS FVF DE MENOR TAMA\u00D1O, COLOR BLANCO EN MAYUSCULA. SEGUIDO DE ESTE ELEMENTO SE ENCUENTRA EK NOMBRE JUEGOS INDIGENAS, DE GRAN TAMA\u00D1O DISPIESTA EN LETRAS MAYUSCULAS TRAZO GRUESO Y LETRAS CARACTERISTICAS COLOR VINOTINTO.'),
(262, E'2024-006140', E'NC', E'mixta', E'46int', E'FVF', E'FEDERACION PRIVADA DE DEPORTE ENCARGADA DE GESTIONAR Y ADMINISTRAR LA LIGA DE FUTBOL NACIONAL, ORGANIZACION DE EVENTOS DEPORTIVOS.', E'CONSISTE EN UNA ETIQUETA DE FONDO COLOR BLANCO EN LA CUAL EN LA PARTE LATERAL IZQUIERDA SE OBSERVA EL EMBLEMA CARACTERISTICOS DE LA FEDERACION VENEZOLANA DE FUTBOL, ESTE EMBLEMA ES DE COLOR VINOTINTO CON LETRAS COLOR DORADAS, TIENE UN FINA LINEA QUE DELINEA TODO EL EMBLEMA EN COLOR DORADO, SE ENCUENTRA UNAS FRANJAS QUE ASEMEJAN SER LA BANDERA EN COLOR AMARILLO AZUL Y ROJO Y SOBRE ESTAS FRANJAS SE ENCUENTRAN DISPUESTAS 8 ESTELLAS COLOR BLANCO. SEGUIDAMENTE JUSTO AL LADO SE OBSERVAN DE GRAN TAMA\u00D1O LAS SIGLAS FVF MAYUSCULAS DE TRAZO GRUESO, LETRA TIPO IMPRENTA DE COLOR DORADO.'),
(263, E'2024-006328', E'MP', E'mixta', E'12int', E'XTREME PERFORMANCE', E'VEH\u00CDCULOS; APARATOS DE LOCOMOCI\u00D3N POR TIERRA, AIRE O AGUA', E'CONSISTE EN LA REPRESENTACION GRAFICA DEL NOMBRE XTREME PERFORMANCE ESCRITA DE LA SEGUIENTE MANERA: LA PALABRA XTREME ESCRITA ASI: LA LETRA X EN MAYUSCULA Y EL RESTO DE LA PALABRA ES DECIR LAS LETRAS T,R,E,M,E EN MAYUSCULAS, CON UNA TIPOGRAFIA ARIAL BLACK DE COLOR NEGRO PANTONE 100% NEGRO. JUSTO ARRIBA DE LA PALABRA XTREME ENCONTRAMOS DENTRO DE UNA CIRCUNFERENCIA DE COLOR NEGRO UNA FIGURA QUE REPRESENTA LA LETRA PRINCIPAL DE LA MARCA, LA LETRA X, LA CUAL ESTA FUSIONADA CON DOS COLORES, EN SU LADO IZQUIERDO AMARILLO PANTONE 368C Y DEL LADO DERECHO NARANJA PANTONE 166C. SEGUIDAMENTE ENCONTRAMOS JUSTO DEBAJO DE LAS LETRAS M,E LA PALABRA PERFORMANCE, ESCRITA DE LA SIGUIENTE MANERA: LA LETRA P EN MAYUSCULA Y EL RESTO DE LA PALABRA, ES DECIR LAS LETRAS, E,R,F,O,R,M,A,N,C,E EN MAYUSCULAS CON UNA TIPOGRAFIA ARIAL BOLD ITALIC DE COLOR BLANCO Y CON UNA FRANJA DE COLOR NEGRO PANTONE 100% NEGRO PARA RESALTAR LA PALABRA. SE REIVINDICA TANTO LOS COLORES COMO LA PALABRA XTREME PERFORMANCE EN SU TOTALIDAD.'),
(264, E'2024-006362', E'MS', E'mixta', E'43int', E'HIPOCAMPO SALA SHOW', E'SERVICIOS DE RESTAURACI\u00D3N (RESTAURANTE).', E'IS\u00D3LOGO DE FONDO COLOR BLANCO, COMPUESTO POR LAS LETRAS MAY\u00DASCULAS Y TIPO MOLDE \\\\\\\"H\\\\\\\", \\\\\\\"I\\\\\\\", \\\\\\\"P\\\\\\\", \\\\\\\"O\\\\\\\", \\\\\\\"C\\\\\\\", \\\\\\\"A\\\\\\\", \\\\\\\"M\\\\\\\", \\\\\\\"P\\\\\\\", Y \\\\\\\"O\\\\\\\" FORMANDO AS\u00CD LA PALABRA \\\\\\\"HIPOCAMPO\\\\\\\", EN UN TONO COLOR DORADO QUE SE DEGRADA EN UN TONO M\u00C1S OSCURO DESDE LA PARTE MEDIA DE CADA LETRA HASTA SU PARTE INFERIOR HACIENDO VER CADA LETRA DE FORMA METALIZADA Y DANDO PROFUNDIDAD.LA LETRA \\\\\\\"C\\\\\\\" SE FORMA GRACIAS A LA PARTE GR\u00C1FICA DEL CONJUNTO LA CUAL SE ENCUENTRA REPRESENTADA POR LA SILUETA DE UN HIPPOCAMPUS O CABALLO DE MAR, UBICADO EN SU PERFIL IZQUIERDO A OJO DEL OBSERVADOR, NOTANDO EN SU PARTE SUPERIOR LA SILUETA DE SU TROMPA, Y CRESTA DORSAL CON UNA PEQUE\u00D1A L\u00CDNEA CURVA QUE ASEMEJA SER EL OJO, SU DORSO Y CUERPO SE ENCUENTRAN CONSTITUIDOS POR UNA LARGA CURVA QUE ATRAVIESA A LA LETRA \\\\\\\"A\\\\\\\" HASTA LLEGAR A SU COLA EN LA LETRA \\\\\\\"M\\\\\\\", EN MEDIO DE ESTA CURVA SE MUESTRA LO QUE PARECE SER UNA ALETA DORSAL DE TAMA\u00D1O MEDIA, TODA LA SILUETA ES DE UN TONO COLOR AZUL QUE COMIENZA EN SU PARTE SUPERIOR SIENDO DE UN TONO CLARO HASTA CONVERTIRSE EN SU PARTE INFERIOR EN UN TONO M\u00C1S OSCURO. EN LA PARTE BAJA DEL CONJUNTO JUSTO DEBAJO DE LA LETRA \\\\\\\" O \\\\\\\" SE OBSERVAN LAS LETRAS ITALICAS Y CURSIVAS \\\\\\\"S\\\\\\\", \\\\\\\"A\\\\\\\" , \\\\\\\"L\\\\\\\", \\\\\\\"A\\\\\\\", \\\\\\\"S\\\\\\\", \\\\\\\"H\\\\\\\", \\\\\\\"O\\\\\\\", \\\\\\\"W\\\\\\\", FORMANDO LOS T\u00C9RMINOS \\\\\\\"SALA SHOW\\\\\\\" QUE TRADUCIDOS AL CASTELLANO SIGNIFICAN \\\\\\\"ESPECT\u00C1CULO DE SALA\\\\\\\" EN UN TONO COLOR DORADO QUE SE DEGRADA EN UN TONO M\u00C1S OSCURO DESDE LA PARTE MEDIA DE CADA LETRA HASTA SU PARTE INFERIOR HACIENDO VER CADA LETRA DE FORMA METALIZADA. SE REIVINDICA EL CONJUNTO DE FORMA GENERAL INCLUYENDO SUS COLORES, M\u00C1S NO LO T\u00C9RMINOS GEN\u00C9RICOS O DESCRIPTIVOS COMO \"HIPOCAMPO\" \"SALA\" Y \"SHOW\" QUE PUEDAN SER EVALUADOS EN SU CONCEPTUALIZACI\u00D3N INDIVIDUAL Y SE ENCUENTRAN PRESENTES EN EL CONJUNTO.'),
(265, E'2024-006385', E'MP', E'mixta', E'8int', E'HUMMER', E'HERRAMIENTAS E INSTRUMENTOS DE MANO IMPULSADOS MANUALMENTE; CUCHILLER\u00CDA, TENEDORES Y CUCHARAS; ARMAS BLANCAS; MAQUINILLAS DE AFEITAR.', E'CONSISTE: EN UNA MARCA MIXTA CONSTITUIDA POR LA COMBINACI\u00D3N DE UN ELEMENTO GRAFICO CON UNO DENOMINATIVO. EL CONJUNTO GR\u00C1FICO EST\u00C1 REPRESENTADO POR UN RECT\u00C1NGULO CRUZADO EN FORMA DIAGONAL POR BANDAS PARALELAS DE DISTINTO GROSOR DE COLORES VERDE – NEGRO – VERDE. EN EL INTERIOR DE LA BANDA DE COLOR NEGRO, QUE ES LA M\u00C1S ANCHA Y LA CENTRAL, SE ENCUENTRA ESCRITA HORIZONTALMENTE LA PALABRA HUMMER (TRADUCCI\u00D3N: \u201CZUMBAR\u201D) EQUIPMENT FOR LIFE (TRADUCCI\u00D3N: \u201CEQUIPO PARA LA VIDA\u201D), EN LETRAS DE MOLDE, MAY\u00DASCULAS, DE FORMATO GRUESO, CENTRADAS EN EL RECT\u00C1NGULO Y DE COLOR BLANCO, EN CUYA PARTE SUPERIOR SE ENCUENTRA UN DISE\u00D1O QUE ASEMEJA LA LETRA \u201CH\u201D CARACTERIZADO POR SER DE MAYOR TAMA\u00D1O QUE EL RESTO DEL CONJUNTO, DONDE LOS PEDESTALES Y CAPITELES DE LAS COLUMNAS TERMINAN CON UNA APERTURA CAPRICHOSA Y CORONADAS CON UNA ESTRELLA, UNIDAS POR UN BRAZO QUE TERMINA EN PUNTA DE FLECHA QUE SE INSERTA EN LA COLUMNA DERECHA. SE REIVINDICA EL CONJUNTO DESCRITO, EN LA POSICI\u00D3N COMO SE PRESENTA. SE REIVINDICA LOS COLORES INDICADOS EN ESTA DESCRIPCI\u00D3N (BLANCO, NEGRO Y VERDE). NO SE REIVINDICAN LOS T\u00C9RMINOS QUE PUEDAN RESULTAR GEN\u00C9RICOS Y DESCRIPTIVOS NI LAS PALABRAS EQUIPMENT FOR LIFE (TRADUCCI\u00D3N: \u201CEQUIPO PARA LA VIDA\u201D) CONTENIDAS EN EL FACS\u00CDMIL ANEXO. (PRODUCTOS NACIONALES Y/O EXTRANJEROS).'),
(266, E'2024-006419', E'MP', E'denominativa', E'12int', E'ACTYON', E'VEH\u00CDCULOS UTILITARIOS DEPORTIVOS; AUTOS EL\u00C9CTRICOS; AUTOS DE CARRERAS; VEH\u00CDCULOS POLIVALENTES; FURGONETAS; AUTOBUSES; COCHECITO LATERAL DE UNA MOTOCICLETA; AUTOS DE PASAJEROS (AUTOM\u00D3VILES); AUTOS DE PASAJEROS PARA M\u00C1S DE 7 PASAJEROS; PIEZAS Y ACCESORIOS PARA AUTOM\u00D3VILES; NEUM\u00C1TICOS PARA AUTOM\u00D3VILES; TRACTORES; CAMIONES; CAMIONETAS; MOTORES PARA AUTOM\u00D3VILES; EJES PARA VEH\u00CDCULOS; MOTORES PARA VEH\u00CDCULOS TERRESTRES; DISPOSITIVOS DE FRENADO PARA VEH\u00CDCULOS. (PRODUCTOS NACIONALES Y/O EXTRANJEROS).', NULL),
(267, E'2024-006475', E'MP', E'mixta', E'17int', E'WOLF BY EBITEN', E'EMPAQUETADURAS.', E'CONSISTE EN UN DISE\u00D1O EN EL CUAL SE LEE `WOLF BY EBITEN` (LOBO POR EBITEN), EN LETRAS MAY\u00DASCULAS, DE TRAZO GRUESO Y COLOR NEGRO, CON LA PARTICULARIDAD QUE LA PALABRA `WOLF` SE ENCUENTRA EN LA PARTE SUPERIOR Y `BY EBITEN`, EN LA PARTE INFERIOR DERECHA Y DE MENOR TAMA\u00D1O. TODO EL CONJUNTO ANTES DESCRITO, SE ENCUENTRA DENTRO DE UN RECT\u00C1NGULO EN SENTIDO HORIZONTAL, DE COLO GRIS CLARO. SE REIVINDICA EL CONJUNTO ANTERIORMENTE DESCRITO Y LOS COLORES ANTES MENCIONADOS.'),
(268, E'2024-006523', E'MP', E'denominativa', E'5int', E'FERREXEL', E'PRODUCTOS FARMAC\u00C9UTICOS; PRODUCTOS VETERINARIOS; PREPARACIONES QU\u00CDMICAS PARA USO M\u00C9DICO; PREPARACIONES VITAM\u00CDNICAS; SUPLEMENTOS NUTRICIONALES; SUPLEMENTOS ALIMENTICIOS MINERALES; SUPLEMENTOS DIET\u00C9TICOS PARA USO M\u00C9DICO; COMPLEMENTOS DIET\u00C9TICOS Y NUTRITIVOS.', NULL),
(269, E'2024-006540', E'MS', E'mixta', E'44int', E'\u00DCMA', E'SERVICIOS M\u00C9DICOS; SERVICIOS VETERINARIOS; TRATAMIENTOS DE HIGIENE Y DE BELLEZA PARA PERSONAS O ANIMALES; SERVICIOS DE AGRICULTURA, ACUICULTURA, HORTICULTURA Y SILVICULTURA.', E'LA ETIQUETA TIENE COMO ELEMENTO PRINCIPAL LA PALABRA DE FANTAS\u00CDA \u201C\u00DCMA\u201D, CENTRADA, EN LETRAS MIN\u00DASCULAS, TIPO MOLDE Y TRAZO MEDIO. LA LETRA \u201C\u00DC\u201D ES DE COLOR AZUL, DONDE SE OBSERVA QUE EN CADA EXTREMO TIENE EN LA PARTE SUPERIOR UN PUNTO (.) LO CUAL ASEMEJA SER UNA DI\u00C9RESIS (\u00A8) DE DOS COLORES, EL PUNTO IZQUIERDO ES DE COLOR AMARILLO Y EL PUNTO DERECHO ES DE COLOR ROJO; LA LETRA \u201CM\u201D ES DE COLOR VERDE CLARO Y LA LETRA \u201CA\u201D ES DE COLOR ROJO. TODO EL CONJUNTO ANTERIORMENTE DESCRITO SE OBSERVA SOBRE UN FONDO DE COLOR VERDE OSCURO. SE REIVINDICA EL CONJUNTO ANTERIORMENTE DESCRITO, Y LA COMBINACI\u00D3N DE COLORES SEG\u00DAN SE DESCRIBE. LA COMBINACI\u00D3N DE COLORES SE HA HECHO EN CUMPLIMIENTO DEL AVISO OFICIAL S/N EMANADO DEL REGISTRO DE LA PROPIEDAD INTELECTUAL FECHADO 18 DE NOVIEMBRE DE 1996.'),
(270, E'2024-006650', E'MP', E'mixta', E'11int', E'UDUKE', E'APARATOS E INSTALACIONES DE ALUMBRADO, CALEFACCI\u00D3N, ENFRIAMIENTO, PRODUCCI\u00D3N DE VAPOR, COCCI\u00D3N, SECADO, VENTILACI\u00D3N Y DISTRIBUCI\u00D3N DE AGUA, AS\u00CD COMO INSTALACIONES SANITARIAS.', E'CONSISTE EN LA PALABRA UDUKE (TRADUCE AL CASTELLANO: DUQUE), ESCRITA EN LETRA DE IMPRENTA, MAY\u00DASCULA, DE TRAZO GRUESO Y DE COLOR AMARILLO, CON LA PARTICULARIDAD QUE LA LETRA U SE OBSERVA CON UN BORDE DEL QUE A SU VEZ FORMA A SU DERECHA UN RECT\u00C1NGULO EN POSICI\u00D3N HORIZONTAL Y DE COLOR NEGRO. EN SU LADO IZQUIERDO SE OBSERVAN TRECE ESTRELLAS DE COLOR NEGRO, CONFORMANDO UN C\u00CDRCULO INCONCLUSO RONDEANDOLA, DENTRO DEL RECTANGULO SE OBSERVAN LAS LETRAS D, U, K, E, LA LETRA K EN SU ASTA ASCENDENTE ESTA UNIDO CON SU BRAZO DERECHO. SE REIVINDICA LA PALABRA UDUKE Y TODO EL CONJUNTO DESCRITO CON LOS COLORES INDICADOS EN \u00C9L.'),
