(273, E'2024-006981', E'MP', E'mixta', E'3int', E'EBC COLLECTION', E'PRODUCTOS COSM\u00C9TICOS Y PREPARACIONES DE TOCADOR NO MEDICINALES;DENT\u00CDFRICOS NO MEDICINALES; PRODUCTOS DE PERFUMER\u00CDA, ACEITESESENCIALES; PREPARACIONES PARA BLANQUEAR Y OTRAS SUSTANCIAS PARALAVAR LA ROPA; PREPARACIONES PARA LIMPIAR, PULIR, DESENGRASAR Y RASPAR.', E'CONSISTE EN UNA SERIE DE LINEAS RECTAS, DANDO FORMA A UN DIAMANTE, DE TRAZOS GRUESOS DE COLOR BLANCO. DENTRO DEL MISMO SE OBSERVA LAS LETRA EBC, EN LETRA MOLDE, MAYUSCULA Y DE COLOR BLANCO. EN LA PARTE INFERIOR CENTRAL SE LEE LA PALABRA COLLECTION TRADUCCI\u00D3N AL ESPA\u00D1OL RECOPILACI\u00D3N. EN LETRA MAYUSCULA Y MOLDE, DE TRAZO COLOR BLANCO. TODA LA IMAGEN SE ENCUENTRA EN UN FONDE DE COLOR BLANCO.SE REINVIDICA EL CONJUNTO ANTES DESCRITO EN SU TOTALIDAD EXCEPTUANDO EL TERMINO COLLECTION.'),
(274, E'2024-006984', E'MP', E'mixta', E'5int', E'SHOFU', E'PRODUCTOS FARMAC\u00C9UTICOS, PREPARACIONES PARA USO M\u00C9DICO Y VETERINARIO; PRODUCTOS HIGI\u00C9NICOS Y SANITARIOS PARA USO M\u00C9DICO; ALIMENTOS Y SUSTANCIAS DIET\u00C9TICAS PARA USO M\u00C9DICO O VETERINARIO, ALIMENTOS PARA BEB\u00C9S; SUPLEMENTOS ALIMENTICIOS PARA PERSONAS O ANIMALES; EMPLASTOS, MATERIAL PARA AP\u00D3SITOS; MATERIAL PARA EMPASTES E IMPRESIONES DENTALES; DESINFECTANTES; PREPARACIONES PARA ELIMINAR ANIMALES DA\u00D1INOS; FUNGICIDAS, HERBICIDAS.', E'CONSISTE EN UN CUADRADO DE COLOR NEGRO, DENTRO DE EL SE OBSERVA UN CIRCULO DE COLOR AZUL. DENTRO DE EL SE LEE SHOFU (TRADUCE AL CASTELLANO: CALIGRAFIA) ESCRITA EN LETRAS DE IMPRENTA, MAYUSCULA, DE TRAZO GRUESO, LAS LETRAS S,H,O, ESTAN SUBRAYADA POR UNA LINEA GRUESO, EL LA PARTE SUPERIOS DE LAS LETRAS O,F,U, SE OBSERVA LA SILUETA DE UNA CIUDAD Y SOBRE ELLAS DIFERENTES LINEAS IRREGULARES QUE ASEMEJAN SER UNA MONTA\u00D1A. CON 4 SILUETAS QUE ASEMEJAN SER UNAS AVES. TODO EL CONJUNTO ANTERIORMENTE DESCRITO ES DE COLOR BLANCO. SE REIVINDICA LA PALABRA SHOFU Y TODO EL CONJUNTO DESCRITO INDICANDO LOS COLORES EN EL.'),
