S DE BANCA EN L\u00CDNEA; SERVICIOS DE BANCA EN L\u00CDNEA ACCESIBLES MEDIANTE APLICACIONES M\u00D3VILES DESCARGABLES; SERVICIOS DE TARJETAS DE D\u00C9BITO EN L\u00CDNEA, TALES COMO, CONTROL DE TRANSACCIONES, SALDOS DE CUENTAS, GASTOS Y ALERTAS ELECTR\u00D3NICAS RELACIONADAS CON LOS GASTOS, TODOS ACCESIBLES MEDIANTE APLICACIONES M\u00D3VILES DESCARGABLES; FINANCIACI\u00D3N DE INVENTARIO DE CONCESIONARIOS DE AUTOM\u00D3VILES; PR\u00C9STAMOS DE FINANCIACI\u00D3N PARA CONCESIONARIOS DE AUTOM\u00D3VILES Y PEQUE\u00D1AS EMPRESAS; PROPORCIONAR INFORMACI\u00D3N EN LOS CAMPOS DE GESTI\u00D3N DE FINANZAS PERSONALES Y EDUCACI\u00D3N FINANCIERA; FINANCIACI\u00D3N DE ARRENDAMIENTO DE AUTOM\u00D3VILES.', NULL),
(276, E'2024-007351', E'MP', E'denominativa', E'9int', E'ZIU', E'RELOJES INTELIGENTES; RELOJES DE CONTROL HORARIO; RELOJES DE ARENA. PALABRA DE FANTASIA', NULL),
(277, E'2024-007537', E'MP', E'mixta', E'19int', E'INTACO', E'MATERIALES DE CONSTRUCCI\u00D3N, CEMENTO, CAL Y MORTEROS.', E'CONSISTE LA ETIQUETA EN UN RECTANGULO DE COLOR ROJO, DISPUESTO DE FORMAL HORIZONTAL, EN SU INTERIOR SE DISPONE LA PALABRA DE FANTASI INTACO (PARTE DEL NOMBRE DE LA PETICIONARIA) EN LETRAS DE TIPO MOLDE, DE TRAZO GRUESO, EN MAYUSCULAS, DE COLOR BLANCO, ANTEPONIENDOSE A LA MENCIONADA PALABRA SE DISPONE LA FISURA DE UN MAPAMUNDI, EN TRAZOS BLANCOS, DONDE EVIDENCIA LA FORMA DEL CONTINENTE AMERICANO. SE REIVINDICA EL CONJUNTO EXCEPTUANDO LA FIGURA GENERICA DEL MAPAMUNDI.'),
(278, E'2024-007778', E'MS', E'mixta', E'38int', E'KUENTRO', E'Telecomunicaciones, programas de radio y televisi\u00F3n, cable sat\u00E9lite, agencia de prensa, correo, mensajer\u00EDa, mensajer\u00EDa electr\u00F3nica, internet, internet e mail, web site, motor, b\u00FAsqueda informaci\u00F3n, servidor, tel\u00E9fono, correo, dise\u00F1o y montaje de p\u00E1ginas web, informaci\u00F3n y asesor\u00EDa.', E'Observamos la palabra K\u00DCENTRO (palabra fantas\u00EDa) escrita en letra de molde, en color negro, en un fondo de color blanco, estando la letra K en may\u00FAscula y el resto de las letras en min\u00FAsculas, con la particularidad de que la letra U tiene dos puntos encima de ella, y est\u00E1 dibujada con cincos colores distintos, a saber de izquierda a derecha y partiendo de arribe, el punto y la punta superior de color rojo, debajo es de color naranja, la parte inferior de la U es verde manzana, la siguiente secci\u00F3n es verde turquesa y la parte superior derecha incluyendo el ponto redondo azul cielo. Se reivindica el conjunto anteriormente descrito. La descripci\u00F3n de colores se ha hecho en cumplimiento al aviso oficial s/n emanado del Registro de la Propiedad Intelectual, de fecha 18/11/1996.'),
(279, E'2024-007867', E'MP', E'mixta', E'31int', E'R', E'FLORES NATURALES, ARREGLOS DE FLORES FRESCAS, RAMO DE FLORES, FLORES FRESCAS.', E'CONSISTE EN UNA ETIQUETA DE FONDO COLOR BLANCO, EN LA CUAL SER OBSERVA UN RECUADRO DE TRAZO SEMI GRUESO COLOR MARR\u00D3N, DENTRO DE ESTE LA LETRA R CON UN DISE\u00D1O CARACTER\u00CDSTICO, ES DE COLOR VERDE Y DE ELLA SOBRE SOBRESALE UNA L\u00CDNEA QUE ASEMEJA SER UN TALLO DEL CUAL SE DESPRENDEN HOJAS Y C\u00CDRCULOS COLOR MARR\u00D3N.'),
(280, E'2024-007934', E'MP', E'denominativa', E'30int', E'PENOTTI', E'CAF\u00C9, T\u00C9, CACAO Y SUCED\u00C1NEOS DEL CAF\u00C9.', NULL),
(281, E'2024-007963', E'MP', E'grafica', E'29int', NULL, E'FRUTOS, LEGUMBRES SECOS, COCIDOS Y EN CONSERVA; GELATINA, MERMELADAS, COMPOTAS Y JALEAS.', E'EL DISE\u00D1O CONSISTE EN UNA FIGURA DE UN COCODRILO ANIMADO, DONDE PREDOMINA EL COLOR VERDE, SE PUEDE OBSERVAR SU BOCA ABIERTA, LA LENGUA DE COLOR ROJO Y DIENTES BLANCOS. EN EL DORSO SE OBSERVAN LAS ESCAMAS DEL COCODRILO EN COLOR AZUL OSCURO, EN LA PARTE POSTERIOR ES DE COLOR VERDE Y EN LA PARTE FRONTAL ES DE COLOR CREMA CON L\u00CDNEAS NEGRAS EN FORMA HORIZONTAL, TODO EL CONTORNO DEL COCODRILO ES CON L\u00CDNEAS NEGRAS, EN LA PARTE INFERIOR DE LA FIGURA, EN SUS DOS PATAS TRASERAS SE APRECIAN UNOS ZAPATOS EN COLOR MORADO, CON TRENZAS BLANCAS QUE LLEVAN DOS FIGURAS DE GOTAS DE COLOR BLANCO, DEBAJO DE LAS GOTAS, UNA L\u00CDNEA GRUESA HORIZONTAL DE COLOR MORADO, SUELA DE COLOR BLANCO Y LA SILUETA DE SU CABEZA EN LA PARTE SUPERIOR DERECHA DE LOS ZAPATOS, EN LA PATA SUPERIOR DERECHA SE APRECIA UNA FIGURA QUE SIMULA LA MITAD DE UN COCO. SE REINVINDICA EL CONJUNTO DESCRITO.'),
(282, E'2024-008038', E'MP', E'mixta', E'25int', E'MUSAI', E'ART\u00CDCULOS DE SOMBRERER\u00CDA; CALZADO; PARTES DE INDUMENTARIA, CALZADO Y SOMBRERER\u00CDA; PRENDAS DE VESTIR.', E'CONSISTE EN UNA FIGURA IRREGULAR CONFORMADA POR DOS PARTES, UNA SUPERIOR Y LA OTRA INFERIOR UNIDAS ENTRE S\u00CD, CON BORDES CURVOS Y RECTOS DE TRAZO GRUESO. DEBAJO DE LA QUE SE OBSERVA LA PALABRA MUSAI (PALABRA DE FANTAS\u00CDA, TAL Y COMO SE SOLICITA NO TIENE TRADUCCI\u00D3N) ESCRITA EN LETRAS DE IMPRENTA, MAYUSCULAS Y MINISCULAS CON EL MISMO TAMA\u00D1O. TODO EL CONJUNTO ANTERIORMENTE DESCRITO ES DE TRAZO GRUESO, COLOR NEGRO. SE REIVINDICA LA PALABRA MUSAI Y TODO EL CONJUNTO DESCRITO CON LOS COLORES INDICADOS EN EL.'),
(283, E'2024-008039', E'MP', E'mixta', E'9int', E'CAMEL', E'BATER\u00CDAS EL\u00C9CTRICAS PARA VEH\u00CDCULOS; BATERIAS PARA AUTOM\u00D3VILES; CARGADORES PARA ACUMULADORES EL\u00C9CTRICOS; SEPARADORES DE BATER\u00CDAS; BATER\u00CDA DE ION DE LITIO; BATER\u00CDAS SECUNDARIAS DE LITIO; BATER\u00CDAS EL\u00C9CTRICAS; VASOS DE ACUMULADORES; VASOS DE BATER\u00CDAS; ACUMULADORES EL\u00C9CTRICOS PARA VEH\u00CDCULOS.', E'CONSISTE EN UN C\u00CDRCULO, DE TRAZO GUESO, COLOR NEGRO Y FONDO COLOR BLANCO. DENTRO DEL QUE SE OBSERVA LA FIGURA DE UN CAMELLO, DE TRAZO FINO Y FONDO COLOR BLANCO. CON LA PARTICULARIDAD QUE SU CUELLO, PATAS, PELAJE Y COLA ESTAN CONFORMADAS POR UN TRAZO GRUESO. SUS DOS JOROBAS EST\u00C1N REPRESENTADAS DE FORMA ABSTRACTA POR TRAZOS CURVOS INCONCLUSOS DONDE ENCIMA DE ELLAS SE OBSERVAN 5 GOTAS Y DENTRO 5 L\u00CDNEAS GRUESAS. DEBAJO DE LA FIGURA SE OBSERVA UN TRAZO GRUESO, RECTO, DE COLOR NEGRO QUE ASEMEJA SER LA SOMBRA DEL CAMELLO. DEBAJO DEL CONJUNTO ANTERIORMENTE DESCRITO SE LEE LA PALABRA CAMEL, ESCRITA EN LETRAS DE IMPRENTA, MAY\u00DASCULAS, DE TRAZO GRUESO Y COLOR NEGRO. SE REIVINDICA LA PALABRA CAMEL Y EL CONJUNTO DESCRITO CON LOS COLORES INDICADOS EN EL.'),
