(287, E'2024-008587', E'MS', E'mixta', E'42int', E'TEDEXIS', E'SERVICIOS CIENT\u00CDFICOS Y TECNOL\u00D3GICOS, AN\u00C1LISIS E INVESTIGACI\u00D3N, DISE\u00D1O Y DESARROLLO DE TECNOLOG\u00CDA M\u00D3VIL DE PUNTA.', E'DESCRIPCI\u00D3N DEL DISE\u00D1O TEDEXIS CONSISTE EN LA REPRESENTACI\u00D3N GR\u00C1FICA DE LA PALABRA TEDEXIS, DE TRAZO GRUESO, COLOR AZUL, ESCRITA EN MIN\u00DASCULA. EN LA L\u00CDNEA SUPERIOR HORIZONTAL, QUE FORMA LA LETRA T, SE OBSERVA AL LADO IZQUIERDO UN CUADRADO DE COLOR AZUL. LA LETRA I TIENE POR PUNTO UNA FIGURA CUADRADA, DE COLOR AZUL. DEL LADO INFERIOR DERECHO SE OBSERVAN DIFERENTES S\u00CDMBOLOS LOS CUALES SON DE MULTIPLICAR, SUMA, DOS PUNTOS Y PAR\u00C9NTESIS DE CIERRE. TODOS DE COLOR AZUL Y DE MENOR TAMA\u00D1O. TODO LO DESCRITO SOBRE UN FONDO BLANCO. SE REIVINDICA EL CONJUNTO DESCRITO, AS\u00CD COMO LA COMBINACI\u00D3N DE LOS COLORES: AZUL Y BLANCO.'),
(288, E'2024-008821', E'MP', E'mixta', E'11int', E'MAXPRO', E'REFLECTORES PARA VEHICULOS, LAMPARAS ELECTRICAS, LAMPARAS DE SEGURIDAD, BOMBILLAS ELECTRICAS', E'CONSISTE EN UNA FIGURA DE FORMA CUADRADA, DE FONDO BLANCO, EN LA CUAL APRECIAMOS UNA FIGURA CIRCULAR, LA CUAL ES INTERRUMPIDA EN LA PARTE IZQUIERDA Y DERECHA. EN ESA INTERRUPCION, PODEMOS OBSERVAR QUE NACEN Y SE EXTIENDEN DOS FORMAS TRIANGULARES, SIN LOS PLANOS INFERIORES, HACIA LA PARTE CENTRAL DE LA FIGURA CIRCULAR, QUE SE ENTRECRUZAN ENTRE S\u00CD EN LA PARTE CENTRAL. REALIZADO EN TRAZO GRUESO Y DE COLOR ROJO. LUEGO SE LEEN EN LA PARTE INFERIOR CENTRAL INTERNA DE LA FIGURA CIRCULAR, LAS LETRAS \u201C M A X P R O\u201D (PALABRA DE FANTASIA, SIN TRADUCCION ALGUNA), ESCRITA EN LETRAS DE MOLDE, MAYUSCULA, DE TRAZOS FINO Y DEL MISMO COLOR ROJO. SE REIVINDICA EL CONJUNTO DESCRITO, ASI COMO SUS COLORES.'),
(289, E'2024-009057', E'MP', E'denominativa', E'24int', E'SOFTMOVE', E'TEJIDOS Y SUCED\u00C1NEOS DE LOS TEJIDOS; TEJIDOS RECUBIERTOS; TEJIDOS PARA CONFECCIONAR PRENDAS DE VESTIR; TEJIDOS IMPERMEABLES PARA LA CONFECCI\u00D3N DE PRENDAS DE VESTIR; TEJIDOS PARA LA CONFECCI\u00D3N DE ROPA DEPORTIVA; PIEZAS TEXTILES IMPERMEABILIZADAS.', NULL),
(290, E'2024-009191', E'MS', E'mixta', E'41int', E'+QCAMPUS', E'DISTINGUE (CLASE 41): SERVICIOS ACAD\u00C9MICOS O DE EDUCACI\u00D3N EN CUALQUIER \u00C1MBITO Y FORMATO; SERVICIOS CULTURALES Y RECREATIVOS; ORGANIZACI\u00D3N Y DIRECCI\u00D3N DE SEMINARIOS; CERTIFICACIONES EDUCATIVAS; SUMINISTRO DE FORMACI\u00D3N Y EX\u00C1MENES PEDAG\u00D3GICOS; ORGANIZACI\u00D3N Y DIRECCI\u00D3N DE TALLERES EDUCATIVOS; TRANSFERENCIA DE CONOCIMIENTOS ESPECIALIZADOS; SERVICIOS DE TUTOR\u00CDA E INSTRUCCI\u00D3N; ORGANIZACI\u00D3N Y DIRECCI\u00D3N DE CONFERENCIAS;ORGANIZACI\u00D3N Y DIRECCI\u00D3N DE CONGRESOS; FORMACI\u00D3N PR\u00C1CTICA Y DEMOSTRATIVA; SESIONES INDIVIDUALES O GRUPALES DE MENTOR\u00CDA SOBRE TEMAS ESPEC\u00CDFICOS; DESARROLLO DE CURSOS Y PROGRAMAS DIGITALES EN VIVO O POR DEMANDA.', E'EL LOGO ES PARA UNA MARCA MIXTA QUE COMBINA ELEMENTOS GR\u00C1FICOS Y TEXTUALES. EN LA PARTE SUPERIOR IZQUIERDA, SE ENCUENTRA UNA PEQUE\u00D1A CRUZ FORMADA POR CUATRO TRI\u00C1NGULOS IS\u00D3SCELES DE COLORES VIVOS: ROJO, AZUL, AMARILLO Y VERDE. ESTA CRUZ SE INSERTA EN LA PARTE SUPERIOR IZQUIERDA DE LA LETRA Q MAY\u00DASCULA DE COLOR AZUL \u00CDNDIGO, LA MISMA SE OBSERVA DE MANERA INACABADA PARA LUEGO COMPLETARSE CON EL AUXILIO DE PARTE DE LA CITADA CRUZ Y ASI COMPLETANDO SU FORMA. LA PALABRA CAMPUS, QUE SIGUE A LA Q ESTA ESCRITA EN MIN\u00DASCULAS Y EN FUENTE KALLISTO BOLD EN EL MISMO COLOR AZUL \u00CDNDIGO, LA COMBINACI\u00D3N DE LA Q Y LA CRUZ SUGIERE UN ESPACIO DIN\u00C1MICO Y EN CONSTANTE CRECIMIENTO, MIENTRAS QUE LA PALABRA CAMPUS EVOCA UN AMBIENTE EDUCATIVO Y COMUNITARIO. EL T\u00C9RMINO CAMPUS PROVIENE DEL LAT\u00CDN Y SIGNIFICA CAMPO O LLANURA. SE REIVINDICA EL CONJUNTO DESCRITO, INCLUYENDO LOS COLORES, PERO NO SE REIVINDICAN T\u00C9RMINOS GEN\u00C9RICOS QUE PUEDAN ENCONTRARSE EN EL CONJUNTO DESCRITO.'),
(291, E'2024-009219', E'NC', E'denominativa', E'46int', E'SYNTHESIA TECHNOLOGY', E'EMPRESA DEDICADA A LA COMPRA, VENTA, FABRICACI\u00D3N, DISTRIBUCI\u00D3N, IMPORTACI\u00D3N Y EXPORTACI\u00D3N DE SUSTANCIAS QU\u00CDMICAS DE USO INDUSTRIAL; GASES REFRIGERANTES; ADITIVOS DESTINADOS A LA INDUSTRIA; CONSERVADORES QU\u00CDMICOS; REACTIVOS QU\u00CDMICOS.', NULL),
(292, E'2024-009363', E'MP', E'denominativa', E'5int', E'ECARVIT', E'PRODUCTOS FARMAC\u00C9UTICOS, PREPARACIONES PARA USO M\u00C9DICO Y VETERINARIO; PRODUCTOS HIGI\u00C9NICOS Y SANITARIOS PARA USO M\u00C9DICO; ALIMENTOS Y SUSTANCIAS DIET\u00C9TICAS PARA USO M\u00C9DICO O VETERINARIO, ALIMENTOS PARA BEB\u00C9S; SUPLEMENTOS ALIMENTICIOS PARA PERSONAS O ANIMALES; EMPLASTOS, MATERIAL PARA AP\u00D3SITOS; MATERIAL PARA EMPASTES E IMPRESIONES DENTALES; DESINFECTANTES; PREPARACIONES DE VITAMINAS; VITAMINAS; COMPLEMENTOS NUTRICIONALES QUE CONTIENEN VITAMINAS Y MINERALES; COMPRIMIDOS VITAM\u00CDNICOS EFERVESCENTES; PASTILLAS DE VITAMINAS; SUPLEMENTOS DIET\u00C9TICOS DE \u00C1CIDO F\u00D3LICO; COMPLEJOS VITAM\u00CDNICOS; SUPLEMENTOS NUTRICIONALES; MULTIVITAM\u00CDNICOS; PREPARACIONES MULTIVITAM\u00CDNICAS; JALEA REAL PARA USO FARMAC\u00C9UTICO; COMPLEMENTOS ALIMENTICIOS A BASE DE JALEA REAL; JARABES PARA USO FARMAC\u00C9UTICO; COMPLEMENTOS MINERALES NUTRICIONALES.', NULL),
(293, E'2024-009400', E'MP', E'mixta', E'30int', E'DON VILLA', E'CAF\u00C9, T\u00C9, CACAO Y SUS SUCED\u00C1NEOS; ARROZ, PASTAS ALIMENTICIAS Y FIDEOS; TAPIOCA Y SAG\u00DA; HARINAS Y PREPARACIONES A BASE DE CEREALES; PAN, PRODUCTOS DE PASTELER\u00CDA Y CONFITER\u00CDA; CHOCOLATE; HELADOS CREMOSOS, SORBETES Y OTROS HELADOS; AZ\u00DACAR, MIEL, JARABE DE MELAZA; LEVADURA, POLVOS DE HORNEAR; SAL, PRODUCTOS PARA SAZONAR, ESPECIAS, HIERBAS EN CONSERVA; VINAGRE, SALSAS Y OTROS CONDIMENTOS; HIELO.', E'CONSISTE EN UN LOGOTIPO DE FONDO COLOR BLANCO, EN EL CENTRO SE APRECIA UN ROSTRO DE FIGURA HUMANA CON PERFIL DEL LADO IZQUIERDO CON UN BORDEADO DE COLOR AMARILLO, DE PIEL MORENA CON UNA GRAN SONRISA, BIGOTES Y BARBILLA DE COLOR NEGRO QUE LLEVA PUESTO UN SOMBRERO DE COLOR MARR\u00D3N CON CUELLO DE LA CAMISA DE COLOR MARRON Y BORDEADO DE COLOR NEGRO, DEBAJO SE APRECIA LA PALABRA (DON VILLA) LIGERAMENTE INCLINADO HACIA LA IZQUIERDA, PALABRA COMPUESTA EN DELINEADO FINO DE COLOR MARR\u00D3N LA MISMA SE ENCUENTRA ENCIMA DE UNA SUPERFICIE COLOREADA DE COLOR AMARILLO, SE REVINDICA LOS COLORES Y TODO EL CONJUNTO COMO TAL. NO REIVINDICO LOS ASPECTOS GEN\u00C9RICOS Y DESCRIPTIVOS POR SI SOLOS, AQU\u00CD DESCRITOS.'),
