(296, E'2024-009586', E'MS', E'denominativa', E'41int', E'PLAYA SECA POLAR LIGHT', E'ORGANIZACI\u00D3N DE ESPECT\u00C1CULOS, COMPETENCIAS DEPORTIVAS, EVENTOS DEPORTIVOS Y ACTIVIDADES CULTURALES, ORGANIZACI\u00D3N DE CONFERENCIAS, COLOQUIOS Y CONGRESOS. ACTIVIDADES PARA LA PROMOCI\u00D3N DEL DEPORTE, ESPARCIMIENTO Y ENTRETENIMIENTO.', NULL),
(297, E'2024-009620', E'MP', E'mixta', E'25int', E'FLIGHT', E'CALZADO; PRENDAS DE VESTIR, TALES COMO, JERS\u00C9IS, PANTALONES, PANTALONES CORTOS; CAMISETAS, CAMISAS, SUDADERAS, SUDADERAS CON CAPUCHA, PANTALONES DEPORTIVOS, CHALECOS, CAMISETAS SIN MANGAS, CH\u00C1NDALES (MONOS DEPORTIVOS), CHAQUETAS, ANORAKS (PARKA), ABRIGOS, ROPA INTERIOR, CINTURONES, SUJETADORES DEPORTIVOS, CALCETINES, MU\u00D1EQUERAS, CINTAS PARA LA CABEZA, SOMBREROS, GORROS, GORRAS; VISERAS; BANDAS PARA EL SUDOR; SU\u00C9TERES; FALDAS; VESTIDOS, BUFANDAS; GUANTES; ROPA DEPORTIVA; UNIFORMES DEPORTIVOS; MALLAS DEPORTIVAS; ROPA PARA USO DEPORTIVO, CALZADO Y PRENDAS QUE INCORPORAN TECNOLOG\u00CDA DE COMUNICACI\u00D3N DE CAMPO CERCANO (NFC).', E'CONSISTE EN UN DISE\u00D1O EN EL CUAL SE LEE `FLIGHT` (VUELO) EN LETRAS ESTILIZADAS, DE TRAZO FINO, MIN\u00DASCULAS (CON EXCEPCI\u00D3N DE LA PRIMERA LETRA) Y DE COLOR NEGRO; CON LA PARTICULARIDAD QUE LAS LETRAS SEMEJAN SER ESCRITURA MANUSCRITA Y QUE LAS DOS PRIMERAS LETRAS Y LAS TRES \u00DALTIMAS SE UNEN EN ALG\u00DAN PUNTO DE SU TRAZO. SE REIVINDICA EL CONJUNTO ANTERIORMENTE DESCRITO Y LOS COLORES ANTES MENCIONADOS.'),
(298, E'2024-009782', E'MS', E'mixta', E'41int', E'GRAN LOGIA DE LA REPUBLICA DE VENEZUELA', E'ACADEMIAS, ORGANIZACI\u00D3N Y DIRECCI\u00D3N DE CONGRESOS Y CONFERENCIAS, EDUCACI\u00D3N, ENSE\u00D1ANZA E INSTRUCCI\u00D3N RELIGIOSA, ASOCIACIONES CIVILES, INSTITUCIONES FILOS\u00D3FICAS, GRUPO DE AMISTAD, INSTITUCION.', E'EL DISE\u00D1O CONSISTE EN UN CONJUNTO FORMADO POR DISTINTAS L\u00CDNEAS Y FIGURAS IRREGULARES. EL DISE\u00D1O COMIENZA CON DOS CIRCUNFERENCIAS DE COLOR NEGRO Y TRAZO DELGADO, SEGUIDO DE ESTO SE LEE \u201CGRAN LOGIA DE LA REP\u00DABLICA DE VENEZUELA\u201D EN EL CENTRO DEL DISE\u00D1O SE ENCUENTRA UN CIRCULO COMPUESTO POR PEQUE\u00D1AS L\u00CDNEAS Y FIGURAS, EN LA PARTE DE ARRIBA SE PUEDEN VER UN CIRCULO CON TRES PUNTOS EN EL CENTRO, UN TRI\u00C1NGULO CON UNA FIGURA IRREGULAR EN EL CENTRO QUE SEMEJA SER UN OJO HUMANO, Y UNA L\u00CDNEA CURVA CERRADA, TODOS ESTOS CON L\u00CDNEAS DE DISTINTOS TAMA\u00D1OS A SU ALREDEDOR, M\u00C1S ABAJO SE PUEDEN OBSERVAR L\u00CDNEAS CURVAS DE DISTINTOS TAMA\u00D1OS Y EN COMBINACI\u00D3N CON PEQUE\u00D1AS CIRCUNFERENCIAS, DEBAJO DE ESTAS SE ENCUENTRAN L\u00CDNEAS RECTAS EN HORIZONTAL, DEBAJO DE ESTAS TAMBI\u00C9N HAY L\u00CDNEAS PERO EN ORIENTACI\u00D3N VERTICAL Y FINALMENTE EN LA PARTE INFERIOR HAY L\u00CDNEAS EN HORIZONTAL. TODO LO DESCRITO ES EN TRAZOS DELGADOS Y DE COLOR NEGRO. SE REIVINDICA \u201CGRAN LOGIA DE LA REP\u00DABLICA DE VENEZUELA\u201D COMO UN CONJUNTO, PERO NO SE REIVINDICA LA PALABRA VENEZUELA.'),
(299, E'2024-009915', E'NC', E'mixta', E'46int', E'ACCUMES', E'LA COMPA\u00D1\u00CDA SE DEDICA A LA EXPLOTACI\u00D3N COMERCIAL DE COMBUSTIBLES F\u00D3SILES, PRINCIPALMENTE GAS, AS\u00CD COMO LA REALIZACI\u00D3N DE TODAS LAS ACTIVIDADES RELACIONADAS.', E'CONSISTE EN UN RECT\u00C1NGULO HORIZONTAL DE COLOR NEGRO. EN MEDIO DEL RECT\u00C1NGULO, SE OBSERVA UNA FIGURA TRIANGULAR SEMI ABIERTA EN SU BASE Y SEMI ABIERTA EN SU LADO IZQUIERDO QUE SIMULA SER LA LETRA /\u201CA\u201D/. ESTA FIGURA TRIANGULAR, EST\u00C1 FORMADA POR L\u00CDNEAS GRUESAS, DE DERECHA A IZQUIERDA, LA PRIMERA DE COLOR BLANCO, LA SEGUNDA DE COLOR NEGRO Y FINALMENTE UN TRI\u00C1NGULO EQUIL\u00C1TERO DE COLOR ROJO. A LA DERECHA DEL CONJUNTO ANTERIORMENTE DESCRITO SE LEE: CCUMES, EL CUAL EN CONJUNTO CON EL LOGO ANTES DESCRITO SE LEE: ACCUMES (PALABRA DE FANTAS\u00CDA, TAL Y COMO SE SOLICITA NO TIENE TRADUCCI\u00D3N), EN LETRA DE IMPRENTA, MIN\u00DASCULA, DE TRAZO GRUESO Y DE COLOR BLANCO. SE REIVINDICA EL LOGO, LA PALABRA ACCUMES Y TODO EL CONJUNTO ANTES DESCRITO, CON LOS COLORES INDICADOS EN \u00C9L.'),
(300, E'2024-009938', E'MS', E'mixta', E'35int', E'SIMPLE', E'SERVICIOS PUBLICITARIOS EN ESPECIFICO LO QUE SE REFIERE A SERVICIOS DE PUBLICIDAD ENTRE EMPRESAS; SERVICIOS DE AN\u00C1LISIS PUBLICITARIO; ALQUILER DE TIEMPO PUBLICITARIO; SERVICIOS DE PUBLICIDAD DIGITAL; DIFUSI\u00D3N DE PUBLICIDAD PARA TERCEROS A TRAV\u00C9S DE REDES INAL\u00C1MBRICAS, INTERNET, CABLE, SAT\u00C9LITE Y REDES DE COMPUTACI\u00D3N MUNDIALES, REGIONALES Y LOCALES; SERVICIOS DE PUBLICIDAD, MERCADEO Y PROMOCI\u00D3N EN L\u00CDNEA E INTERNET; SUMINISTRO DE ESPACIO EN DISPOSITIVOS M\u00D3VILES, APLICACIONES DE SOFTWARE Y SITIOS WEB PARA PUBLICITAR BIENES Y SERVICIOS; SERVICIOS DE SITIOS DE COMPRAS MINORISTAS EN L\u00CDNEA Y POR INTERNET CON CONTENIDO DESCARGABLE O TRANSMISI\u00D3N AUDIOVISUAL EN LOS CAMPOS DE NOTICIAS, ENTRETENIMIENTO, DEPORTES, COMEDIA, DRAMA, M\u00DASICA Y VIDEOS MUSICALES; SERVICIOS DE FIDELIDAD PARA CLIENTES Y SERVICIOS DE CLUB DE CLIENTES, CON FINES COMERCIALES, PROMOCIONALES, PUBLICITARIOS Y DE PARTICIPACI\u00D3N DEL CLIENTE.', E'EL SIGNO SOLICITADO CONSISTE EN UN DISE\u00D1O DONDE SE LEE LA PALABRA `SIMPLE` (SIN TRADUCCI\u00D3N) ESCRITA EN LETRA MOLDE, MAY\u00DASCULA LA PRIMERA LETRA Y MIN\u00DASCULA EL RESTO, DE COLOR BLANCO Y DE TRAZO GRUESO. EN EL LADO IZQUIERDO DEL DISE\u00D1O, SE APRECIA UN C\u00CDRCULO DE COLOR NARANJA QUE, EN SU INTERIOR, TIENE DOS L\u00CDNEAS IRREGULARES Y GRUESAS DE COLOR NEGRO Y EXTREMOS REDONDEADOS, QUE EST\u00C1N SEPARADAS ENTRE S\u00CD, EN LAS QUE SOBRESALE EL HECHO QUE EN EL EXTREMO INFERIOR IZQUIERDO Y EL SUPERIOR DERECHO, CONCLUYEN CON UNAS L\u00CDNEAS PUNTIAGUDAS, DONDE AMBAS FRANJAS, ASEMEJAN UNA LETRA S. EL CONJUNTO DE LA FIGURA Y EL TEXTO EST\u00C1 SOBRE UN RECT\u00C1NGULO S\u00D3LIDO DE COLOR NEGRO (SENTIDO HORIZONTAL). SE REIVINDICA EL CONJUNTO DESCRITO Y LA EXACTITUD DE LOS COLORES ANTES MENCIONADOS. NO SE REIVINDICA LOS T\u00C9RMINOS DE USO COM\u00DAN QUE FORMAN PARTE DEL CONJUNTO SOLICITADO.');
